INSERT INTO `recipeurl` VALUES ('Tropical Granola','https://sugarspiceslife.com/2018/07/12/tropical-granola-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/07/Tropical-Granola-5.jpg?resize=1024%2C683&ssl=1','Oats, hemp and flax seeds, dried cranberries and pineapples, and coconut. A delicious, easy to make granola with tropical vibes.',198),('Mini Fruit Pizza','https://sugarspiceslife.com/2018/07/10/mini-fruit-pizza-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/07/Mini-Fruit-Pizza-5.jpg?resize=1024%2C683&ssl=1','Individually sized fruit pizzas. A sugar cookie crust with cream cheese and Cool Whip topping, fresh fruit, and finished with a perfectly sweetened glaze.',0),('Korean Beef Bowl','https://sugarspiceslife.com/2018/07/02/korean-beef-bowl-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Korean-Beef-Bowl-2.jpg?resize=1024%2C683&ssl=1','Tender, spicy beef in a delicious sauce served over vegetables and rice. ',639),('Peach Cobbler','https://sugarspiceslife.com/2018/05/09/peach-cobbler-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Peach-Cobbler-5.jpg?resize=1024%2C683&ssl=1','This peach cobbler could not be easier to make or quicker to put together. Delicious, amazing, and can be made any time of the year.',0),('Churro Cake','https://sugarspiceslife.com/2018/05/25/churro-cake-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Churro-Cake.jpg?resize=1024%2C683&ssl=1','Soft ,cinnamon layers made with brown butter, a rich pralina filling, and a buttercream frosting with melted dark and white chocolates mixed in. It is so amazing and delicious that it has been known for people to fall in love AND to get married while eating it.',0),('Triple Chocolate Cookies','https://sugarspiceslife.com/2018/06/02/triple-chocolate-cookies-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Triple-Chocolate-Cookies-2.jpg?resize=1024%2C683&ssl=1','Fudgy, chocolate cookies made with melted Baker’s chocolate, cocoa powder, dark chocolate chips, and chocolate chunks. A chocolate lover’s dream!',0),('Easy Homemade Ice Cream','https://sugarspiceslife.com/2018/06/15/easy-homemade-ice-cream-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Easy-Homemade-Ice-Cream-2.jpg?resize=1024%2C683&ssl=1','This homemade ice cream is creamy, full of fruit, addictively delicious, and lactose-free!',161),('Restaurant Style Blender Salsa','https://sugarspiceslife.com/2018/05/28/restaurant-style-blender-salsa-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Restaurant-Style-Blender-Salsa-2.jpg?resize=1024%2C683&ssl=1','This salsa couldn’t be easier or quicker to make, and will rival even the best of restaurant salsas.',32),('Cheesy Chicken Lasagna','https://sugarspiceslife.com/2018/05/16/cheesy-chicken-lasagna-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/09/Cheesy-Chicken-Lasagna-1.jpg?resize=1024%2C683&ssl=1','Layers of flavorful chicken topped with creamy sauce, and lots of cheese. This recipe takes chicken lasagna to a new level!',1075),('Zucchini Crust Pepperoni Pizza','https://sugarspiceslife.com/2018/07/31/zucchini-crust-pepperoni-pizza-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/07/Zucchini-Crust-Pepperoni-Pizza-8.jpg?resize=1024%2C683&ssl=1','A delicious pizza crust made of zucchini, topped with pizza sauce, pepperoni, and cheese. Top it how you like but your kids will never guess there are vegetables in the crust!',423),('Baked Blueberry Cake Donuts','https://sugarspiceslife.com/2018/09/03/baked-blueberry-cake-donuts-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/09/Baked-Blueberry-Cake-Donuts-2.jpg?resize=1024%2C683&ssl=1','Soft, delicious donuts filled with blueberries and topped with a sweet blueberry gaze. A healthier, and tastier take on donuts. ',237),('Fresh Herb and Vegetable Couscous Salad','https://sugarspiceslife.com/2018/09/13/fresh-herb-and-vegetable-couscous-salad-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/09/Fresh-Herb-and-Vegetable-Couscous-Salad-1.jpg?resize=1024%2C683&ssl=1','Couscous tossed with fresh herbs, vegetables, and feta cheese, and finished with a balsamic dressing. Light and deliciously flavorful! ',204),('Skillet Shepherd’s Pie','https://sugarspiceslife.com/2018/10/05/skillet-shepherds-pie-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/10/Skillet-Shepherds-Pie-2.jpg?resize=1024%2C683&ssl=1','Deliciously seasoned beef and vegetables topped with creamy mashed potatoes and baked in a cast iron skillet. Pure, delicious comfort food.',641),('Muddy Buddy Cupcakes','https://sugarspiceslife.com/2018/08/28/muddy-buddy-cupcakes-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/08/Muddy-Buddy-Cupcakes-2.jpg?resize=1024%2C683&ssl=1','Chocolate cupcakes filled with homemade muddy buddies, topped with peanut butter buttercream, and finished with powdered sugar and chocolate ganache.',0),('Instant Pot Yogurt','https://sugarspiceslife.com/2018/06/05/instant-pot-yogurt-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Instant-Pot-Yogurt-1.jpg?resize=1024%2C683&ssl=1','This yogurt takes about 3 minutes to put together, makes a ton, and is delicious! Plus, it’s made with Fairlife lactose free milk, making it easier on those who are lactose sensitive.',128),('Ground Turkey Pot Stickers','https://sugarspiceslife.com/2018/06/24/ground-turkey-pot-stickers-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Ground-Turkey-Pot-Stickers-5.jpg?resize=1024%2C683&ssl=1','Pure comfort food that is on the healthy side. Easy to make potstickers that are filled with deliciously seasoned turkey and vegetables. ',316),('Quinoa Turkey Enchilada Stuffed Peppers','https://sugarspiceslife.com/2018/06/19/enchilada-stuffed-peppers-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Quinoa-Turkey-Enchilada-Stuffed-Peppers-2.jpg?resize=1024%2C683&ssl=1','Peppers filled with delicious quinoa and Mexican spiced turkey, with enchilada sauce and veggies, and topped with a bit of melted cheese! A cross between stuffed peppers and enchiladas, and a healthier take on both.',321),('Emily’s Baked Ziti','https://sugarspiceslife.com/2018/05/21/emilys-baked-ziti-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Baked-Ziti-1.jpg?resize=1024%2C683&ssl=1','This baked ziti has a sweet, amazing sauce! It doesn’t take much time or effort to put it together. And, it’ll feed a crowd, which is good, since the taste will bring one!',709),('Chocolate Covered Cherry Cake','https://sugarspiceslife.com/2018/06/18/chocolate-covered-cherry-cake-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Chocolate-Covered-Cherry-Cake-4-1.jpg?resize=1024%2C683&ssl=1','Chocolate cake with a cherry ganache filling, frosted with fresh cherry buttercream, topped with chocolate ganache and chocolate covered cherries. ',0),('Wasabi Teriyaki Chicken and Rice (Instant Pot or Stove Top)','https://sugarspiceslife.com/2018/06/17/wasabi-teriyaki-chicken-and-rice-instant-pot-or-stove-top-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Wasabi-Teriyaki-Chicken-and-Rice-5.jpg?resize=1024%2C683&ssl=1','This dish is full of delicious flavors and veggies, and super easy to make. It can be made in your Instant Pot or on the stove top!',295),('Instant Pot Roasted Balsamic Chicken','https://sugarspiceslife.com/2018/09/04/instant-pot-roasted-balsamic-chicken-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/09/Instant-Pot-Roasted-Balsamic-Chicken-2.jpg?resize=1024%2C683&ssl=1','A whole chicken marinated in balsamic and herbs de Provence, then cooked in an Instant Pot. Tastes like a pull-apart rotisserie chicken, but in much less time!',612),('Andouille Sausage Chicken and Rice','https://sugarspiceslife.com/2018/07/11/andouille-sausage-chicken-and-rice-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/07/Andouille-Sausage-Chicken-and-Rice-6.jpg?resize=1024%2C683&ssl=1','A one pot dish with chicken, Andouille sausage, vegetables, and rice. Quick, easy, and the whole family will love it.',510),('Thai Curry Soup with Turkey Meatballs','https://sugarspiceslife.com/2018/05/06/thai-curry-soup-with-turkey-meatballs-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Thai-Curry-Soup-with-Turkey-Meatballs-1-1.jpg?resize=1024%2C683&ssl=1','A curry soup with rice noodles, topped with red peppers, sugar snap peas, and lemongrass turkey meatballs.  Flavorful, filling, healthy and super delicious.',489),('Honey Lime Vinaigrette','https://sugarspiceslife.com/2018/06/21/honey-lime-vinaigrette-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Honey-Lime-Vinaigrette-6.jpg?resize=1024%2C683&ssl=1','Quick and easy to make. Tastes fresh, delicious, and amazing. It’ll change your attitude on store bought salad dressing.',538),('Fresh Herb Mac and Cheese','https://sugarspiceslife.com/2018/06/09/fresh-herb-mac-and-cheese-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Fresh-Herb-Mac-and-Cheese-1.jpg?resize=1024%2C683&ssl=1','Creamy mac and cheese filled with broccoli and ground chicken sausage, and topped with a Panko breadcrumb and fresh herb topping. Kids and adults both will love this stuff.',679),('Chicken Lime Tacos (Instant Pot or Slow Cooker)','https://sugarspiceslife.com/2018/05/05/chicken-lime-tacos-instant-pot-or-slow-cooker-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/chicken-lime-tacos.jpg?resize=300%2C300&ssl=1','These quick and easy chicken lime tacos can be made in an Instant Pot or Slow Cooker.',0),('Nutella Mousse Cake','https://sugarspiceslife.com/2018/09/07/nutella-mousse-cake-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/09/Nutella-Mousse-Cake-8.jpg?resize=1024%2C683&ssl=1','Fudgy chocolate cake base topped with a Nutella cream cheese mousse, followed by Nutella chocolate mousse, and topped with chocolate ganache. Decadently amazing. Pure heaven on a plate.',0),('Barbacoa Beef (Instant Pot or Slow Cooker)','https://sugarspiceslife.com/2018/06/07/barbacoa-beef-instant-pot-or-slow-cooker-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Barbacoa-Beef-1.jpg?resize=1024%2C683&ssl=1','Flavorful, delicious pulled beef made in your Instant Pot or slow cooker. Great in tacos or over cilantro lime rice.',470),('Instant Pot Key Lime Pie','https://sugarspiceslife.com/2018/10/09/instant-pot-key-lime-pie-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/10/Instant-Pot-Key-Lime-Pie-2.jpg?resize=1024%2C683&ssl=1','Creamy, perfectly sweet and tangy key lime filling in a lightly sweetened graham cracker crust. Topped with fresh, key lime whipped cream. Made quickly and easily in your Instant Pot!',0),('Blueberry Zucchini Muffins','https://sugarspiceslife.com/2018/08/03/blueberry-zucchini-muffins-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/08/Blueberry-Zucchini-Muffins-2.jpg?resize=1024%2C683&ssl=1','These mini muffins are made with zucchini, a mix of all purpose and coconut flours, and blueberries. Finished with a streusel topping, they are delicious!',142),('Dairy Free Instant Pot Yogurt','https://sugarspiceslife.com/2018/09/20/dairy-free-instant-pot-yogurt-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/09/Dairy-Free-Instant-Pot-Yogurt-7.jpg?resize=1024%2C683&ssl=1','Thick, creamy, delicious coconut cream yogurt made in your Instant Pot. It’s easily made with only four ingredients!',447),('Asian Noodles with Peanut Sauce','https://sugarspiceslife.com/2018/05/31/asian-noodles-with-peanut-sauce-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Asian-Noodles-with-Peanut-Sauce-4.jpg?resize=1024%2C683&ssl=1','Rice noodles with chicken and egg, mixed with peanut sauce, and topped with stir fried vegetables. Full of flavor and easy to make. No fish sauce or seafood!',715),('Brownie Pudding','https://sugarspiceslife.com/2018/07/03/brownie-pudding-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/06/Brownie-Pudding-4.jpg?resize=1200%2C800&ssl=1','If you’ve ever wished you could take the taste of hot brownie batter, and make it into something edible and amazing, this is the dessert for you. Life changing delicious.',0),('Easy Beef and Bean Chili (Slow Cooker or Instant Pot)','https://sugarspiceslife.com/2018/04/17/slow-cooker-beef-chili-with-beans-veggies-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/04/Easy-Beef-and-Bean-Chili-Slow-Cooker-or-Instant-Pot-2.jpg?resize=1024%2C683&ssl=1','Deliciously seasoned beef mixed with beans and vegetables. Easy and quick to put together! Can be cooked in a slow cooker or Instant Pot!',770),('Chicken and Vegetable Salad with Yogurt Tahini Sauce','https://sugarspiceslife.com/2018/07/23/chicken-and-vegetable-salad-with-yogurt-tahini-sauce-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/07/Chicken-and-Vegetable-Salad-with-Yogurt-Tahini-Sauce-7.jpg?resize=1024%2C683&ssl=1','Grilled chicken and vegetables over a quinoa lentil salad with fresh dill, finished with a yogurt tahini sauce. Full of flavor. The best meal you will eat all summer. ',754),('Homemade Hamburgers','https://sugarspiceslife.com/2018/05/09/homemade-hamburgers-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Homemade-Hamburgers-5.jpg?resize=1024%2C683&ssl=1','These delicious patties take less than ten minutes to put together, and taste a thousand times better than the frozen ones. You will never buy pre-made hambur