e/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/08/Pumpkin-English-Muffins-5.jpg?resize=1024%2C683&ssl=1','Soft English muffins with tastes of pumpkin, pumpkin pie spice, and a hint of sweetness. Addictively delicious!',187),('Buttermilk Biscuits','https://sugarspiceslife.com/2018/05/20/buttermilk-biscuits-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/Buttermilk-Biscuits-2.jpg?resize=1024%2C683&ssl=1','These buttermilk biscuits are buttery, flaky, and all around delicious. They’re perfect for breakfast sandwiches, with jam & honey, as a side for spaghetti, or just an afternoon snack.',246),('Zucchini Hush Puppies with Wasabi Dipping Sauce','https://sugarspiceslife.com/2018/08/02/zucchini-hush-puppies-with-wasabi-dipping-sauce-recipe/\n','https://i0.wp.com/sugarspiceslife.com/wp-content/uploads/2018/08/Zucchini-Hush-Puppies-with-Wasabi-Dipping-Sauce-2.jpg?resize=600%2C400&ssl=1','Hush puppies made with zucchini, fried to a perfect crisp, and dipped in a wasabi sauce. Vegetables have never tasted so good. ',88),('Mini Peanut Butter Oreo Chocolate No Bake Desserts','https://sugarspiceslife.com/2018/05/02/mini-peanut-butter-oreo-chocolate-no-bake-desserts-recipe/\n','https://i2.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/PB-oreo-no-bake-1.jpg?resize=300%2C231&ssl=1','Mini peanut butter chocolate no bake dessert. Perfect dessert for just about anything.',0),('Healthier Apple Crisp','https://sugarspiceslife.com/2018/10/01/healthier-apple-crisp-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/09/Healthier-Apple-Crisp-2-e1538358277783.jpg?resize=1200%2C801&ssl=1','Fresh apples baked with a honey sweetened oatmeal topping. A delicious dessert that’s on the healthy side!',451),('Slow Cooker Mac and Cheese','https://sugarspiceslife.com/2018/04/22/slow-cooker-mac-cheese-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/04/slow-cooker-mac-cheese.jpg?resize=900%2C600&ssl