om/sugarspiceslife.com/wp-content/uploads/2018/06/Skillet-Corn-Bread-2.jpg?resize=1024%2C683&ssl=1','Quick, easy, delicious cornbread make in a skillet. A perfect side dish for almost any meal.',296),('Indian Pot Pie Turnovers','https://sugarspiceslife.com/2018/05/27/indian-pot-pie-turnovers-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/IMG_0051.jpg?resize=1000%2C667&ssl=1','These delicious turnovers are an Indian take on pot pie. They’re filled with Indian spiced vegetables and turkey, and will satisfy the whole family.',420),('Lemon Strawberry Cake','https://sugarspiceslife.com/2018/05/14/lemon-strawberry-cake-recipe/\n','https://i1.wp.com/sugarspiceslife.com/wp-content/uploads/2018/05/IMG_9584.jpg?resize=1024%2C683&ssl=1','Soft, lemon cake with a strawberry filling and strawberry buttercream frosting. Delicious combination of sweet and tang!',0),('Oriental Cold Noodle Salad','https://www.allrecipes.com/recipe/83087/oriental-cold-noodle-salad/','https://images.media-allrecipes.com/userphotos/560x315/3894268.jpg','A zesty treat--Goes great with bbq\'d chicken and a beer.  This dish has more of a Thai flavor. For a Japanese flavor, omit the pepper flakes, peanuts, and cilantro. Add 1/4 c. of toasted sesame seeds. If you\'re feeling adventurous mix in 1/2 c. of shredded dried seaweed (nori) just before serving. You can substitute ramen noodles for soba.',242),('Russian Mushroom and Potato Soup','https://www.allrecipes.com/recipe/80773/russian-mushroom-and-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/3626794.jpg','I make this soup every Halloween and is the \'signal\' to the family that the cool weather has arrived. I\'ve been making it for 15 years now and out of all the soups I make, it is still everyone\'s favorite. Enjoy!',167),('Green Tomato and Bell Pepper Delight','https://www.allrecipes.com/recipe/22467/green-tomato-and-bell-pepper-delight/','https://images.media-allrecipes.com/userphotos/250x250/656498.jpg','Delicious, fresh and tasty! Serve as a side dish or top it on a  baked potato or some rice.',127),('Zucchini Herb Casserole','https://www.allrecipes.com/recipe/74077/zucchini-herb-casserole/','https://images.media-allrecipes.com/userphotos/560x315/580315.jpg','I\'ve been making this casserole for almost 20 years and it\'s always a hit. Even my meat-eater husband likes it. Serve with a crusty French bread or soft breadsticks. Leftovers are great in an omelet the next day.',266),('Eggs Benedict with Salmon','https://www.allrecipes.com/recipe/20915/eggs-benedict-with-salmon/','https://images.media-allrecipes.com/userphotos/560x315/833589.jpg','Smoked salmon and rye bread add a new twist to the traditional eggs Benedict. Sauce can be set aside at room temp for up to one hour. When ready to serve, reheat gently in double boiler.',223),('Make-Ahead Sour Cream Coffee Cake','https://www.allrecipes.com/recipe/220329/make-ahead-sour-cream-coffee-cake/','https://images.media-allrecipes.com/userphotos/250x250/857474.jpg','Easy to put together the night before, then pop in the oven in the morning for a hot, delicious coffee cake.',304),('Easy Meatloaf','https://www.allrecipes.com/recipe/16354/easy-meatloaf/','https://images.media-allrecipes.com/userphotos/560x315/682282.jpg','This is a very easy and no fail recipe for meatloaf. It won\'t take long to make at all, and it\'s quite good!',372),('Winter Leek and Potato Soup','https://www.allrecipes.com/recipe/220779/winter-leek-and-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/1040356.jpg','A great-tasting, hearty and satisfying soup that\'s perfect for a lunch or to start an otherwise light dinner.',364),('Fresh Broccoli Salad','https://www.allrecipes.com/recipe/14280/fresh-broccoli-salad/','https://images.media-allrecipes.com/userphotos/560x315/4550791.jpg','This is a yummy summer salad that uses an interesting combination of fruits, vegetables and meats.  Before you decide you won\'t like it, try it.  You\'ll be pleasantly surprised.  You can add an extra head of broccoli, if you like.',374),('Pecan Sour Cream Coffee Cake','https://www.allrecipes.com/recipe/246868/pecan-sour-cream-coffee-cake/','https://images.media-allrecipes.com/userphotos/560x315/3489946.jpg','For me, the best part about coffee cake is the crispy, crunchy, buttery crumbs. So here I significantly upped the amounts used. Bake times will vary according to pan size and composition.',634),('Goong Tod Kratiem Prik Thai (Prawns Fried with Garlic and White Pepper)','https://www.allrecipes.com/recipe/245888/goong-tod-kratiem-prik-thai-prawns-fried-with-garlic-and-white-pepper/','https://images.media-allrecipes.com/userphotos/560x315/3224366.jpg','This dish uses a classic Thai preparation method of protein. It might not sound like much, but it\'s a very satisfying dish, especially made with shrimp that\'s shell-on. We eat the shrimp shell and all, as to not miss out on any flavor. It\'s also a very kid-friendly dinner dish. Serve with lots of rice.',377),('Downeast Maine Pumpkin Bread','https://www.allrecipes.com/recipe/6820/downeast-maine-pumpkin-bread/','https://images.media-allrecipes.com/userphotos/560x315/4567827.jpg','This is a great old Maine recipe, moist and spicy. The bread actually tastes even better the day after it is baked. Great for holiday gift giving!',263),('Roasted Beets and Sauteed Beet Greens','https://www.allrecipes.com/recipe/54484/roasted-beets-and-sauteed-beet-greens/','https://images.media-allrecipes.com/userphotos/560x315/350902.jpg','This is a great way to use every part of the fresh beets you buy.  You can get two delicious side dishes out of this one vegetable.',204),('Roasted Brussels Sprouts with Apples, Golden Raisins, and Walnuts','https://www.allrecipes.com/recipe/230659/roasted-brussels-sprouts-with-apples-golden-raisins-and-walnuts/','https://images.media-allrecipes.com/userphotos/560x315/959436.jpg','Healthy veggies with a hint of sweet. Who knew Brussels sprouts could taste so good?',158),('Low Carb Cauliflower Leek Soup','https://www.allrecipes.com/recipe/69635/low-carb-cauliflower-leek-soup/','https://images.media-allrecipes.com/userphotos/560x315/429094.jpg','A simple yet tasty alternative to potato leek soup. Great for those watching their carbs or calories, or just looking for a different vegetarian soup.',155),('Bacon Cheese Muffins','https://www.allrecipes.com/recipe/229996/bacon-cheese-muffins/','https://images.media-allrecipes.com/userphotos/560x315/973572.jpg','A great dinner or wonderful for breakfast with eggs.',205),('Bacon and Potato Frittata with Greens','https://www.allrecipes.com/recipe/238314/bacon-and-potato-frittata-with-greens/','https://images.media-allrecipes.com/userphotos/560x315/4531057.jpg','This is a wonderful meal anytime of day or night. My grandfather used to make frittatas quite often. Instead of finishing a frittata under the broiler he would cook it halfway, put a plate on top of the pan, flip the pan over, and slide the frittata back into the pan to cook the other side. Sometimes a frittata would stick; other times the hot oil would drip on him as he performed this maneuver. It was during these moments that I learned all the really good Italian curse words I still use to this day.',150),('Cabbage Fat-Burning Soup','https://www.allrecipes.com/recipe/13116/cabbage-fat-burning-soup/','https://images.media-allrecipes.com/userphotos/560x315/3086983.jpg','This tomato and cabbage soup was rumored, in days of old, to melt away those thighs.',90),('Chicken Tikka Masala','https://www.allrecipes.com/recipe/45736/chicken-tikka-masala/','https://images.media-allrecipes.com/userphotos/560x315/39905.jpg','This is an easy recipe for Chicken Tikka Masala--chicken marinated in yogurt and spices and then served in a tomato cream sauce. Serve with rice or warm pita bread.',404),('Cream Cheese Pound Cake I','https://www.allrecipes.com/recipe/7326/cream-cheese-pound-cake-i/','https://images.media-allrecipes.com/userphotos/560x315/1449318.jpg','My children always loved this cake.  They are grown now, but when they come home they ask me to have the cake made.  It is an easy recipe.',541),('Green Tomato Pie III','https://www.allrecipes.com/recipe/12617/green-tomato-pie-iii/','https://images.media-allrecipes.com/userphotos/560x315/3721321.jpg','Tastes like the best apple pie you have ever had. Make people guess what it is! They will want another slice.',407),('Rich and Simple French Onion Soup','https://www.allrecipes.com/recipe/13309/rich-and-simple-french-onion-soup/','https://images.media-allrecipes.com/userphotos/560x315/1081318.jpg','We have been trying French onion soup in restaurants for years and my family and friends agree none can compare to my recipe for taste and simplicity of preparation.',585),('Quick Creamy Zucchini Soup','https://www.allrecipes.com/recipe/234112/quick-creamy-zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/1060935.jpg','This is one of my favorite soups! It\'s my grandma\'s recipe that she just handed down to me this year in celebration of my garden producing enough zucchini for a small army! It\'s creamy and filling but mild. This soup can be frozen.',182),('Country House Bed and Breakfast Casserole','https://www.allrecipes.com/recipe/24143/country-house-bed-and-breakfast-casserole/','https://images.media-allrecipes.com/userphotos/560x315/885833.jpg','A delicious casserole that can be altered in many ways to change it from day to day. You may substitute bacon or sausage for the ham if you wish. Add peppers, onions, hash browns or anything else that suits your fancy.',358),('Fiesta Slow Cooker Shredded Chicken Tacos','https://www.allrecipes.com/recipe/242342/fiesta-slow-cooker-shredded-chicken-tacos/','https://images.media-allrecipes.com/userphotos/560x315/2280317.jpg','Quick, easy, and tasty!',71),('Yummy Sweet Potato Casserole','https://www.allrecipes.com/recipe/21261/yummy-sweet-potato-casserole/','https://images.media-allrecipes.com/userphotos/560x315/4573472.jpg','My family begs me to make this creamy baked dish every Thanksgiving and Christmas. What makes it so good is the pecan topping! Try it and I\'m sure it will become your new tradition!',226),('Creamy Asparagus and Cauliflower Soup','https://www.allrecipes.com/recipe/237846/creamy-asparagus-and-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/4486082.jpg','This delicious bowl of soup, despite being dairy-free, looks and feels pretty creamy. We have cauliflower to thank for that. The soup looks like a classic cream of asparagus, and your eyes will fool your palate to a certain extent. In addition to giving it a nice color, the bumpy superfood cauliflower provides a smoother texture to the soup than the less-starchy asparagus could achieve alone.',84),('Southwestern Cauliflower and Ham Soup','https://www.allrecipes.com/recipe/25696/southwestern-cauliflower-and-ham-soup/','https://images.media-allrecipes.com/userphotos/560x315/5233469.jpg','Serve hot with a slice of cheese bread.  Enjoy!',345),('Sopapilla Cheesecake Pie','https://www.allrecipes.com/recipe/169305/sopapilla-cheesecake-pie/','https://images.media-allrecipes.com/userphotos/560x315/453301.jpg','I make this to take to pot luck dinners and get rave reviews!  Easy to make, smells great while cooking and tastes wonderful!',481),('Bacon, Egg, and Cheese Breakfast Bombs','https://www.allrecipes.com/recipe/258039/bacon-egg-and-cheese-breakfast-bombs/','https://images.media-allrecipes.com/userphotos/560x315/5978113.jpg','Cinnamon roll dough is stuffed with crispy bacon, scrambled eggs, and Cheddar cheese to make these family-friendly breakfast bombs.',622),('Chicken Tortellini Soup With Zucchini and Tomatoes','https://www.allrecipes.com/recipe/76960/chicken-tortellini-soup-with-zucchini-and-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/4480329.jpg','Beginning with my Fast Chicken Soup Base it is easy to knock hours off of the cooking time usually needed for homemade chicken soup and still end up with soup that tastes even better than the \'from scratch\' method. With a little creativity you can easily make two varieties of these soul-satisfying meals.',117),('Delicious Egg Salad for Sandwiches','https://www.allrecipes.com/recipe/147103/delicious-egg-salad-for-sandwiches/','https://images.media-allrecipes.com/userphotos/560x315/4537151.jpg','This is a wonderful-tasting egg salad sandwich that you will definitely devour. It\'s really good on rye.',344),('Baked Cider Doughnuts','https://www.allrecipes.com/recipe/33175/baked-cider-doughnuts/','https://images.media-allrecipes.com/userphotos/250x250/946821.jpg','This recipe is for those donut pans that are advertised in some magazines.  They were an attempt to duplicate the delicious cider donuts that my husband and I had on vacation in New Hampshire.',137),('Hungarian Mushroom Soup','https://www.allrecipes.com/recipe/17897/hungarian-mushroom-soup/','https://images.media-allrecipes.com/userphotos/560x315/8261.jpg','My family loves soup and this is one of their favorites. It has lots of flavor and is fairly quick to make. It\'s primarily a mushroom soup but derives a lot of its flavor from other ingredients.',201),('Thai Red Chicken Curry','https://www.allrecipes.com/recipe/85815/thai-red-chicken-curry/','https://images.media-allrecipes.com/userphotos/560x315/796526.jpg','This is a quick and easy curry stir-fry made with chicken, zucchini, red bell pepper and carrot. Coconut milk and curry paste make an irresistible sauce. No need to go out to eat, as this dish is ready in about 20 minutes!',271),('Smooth Cauliflower Soup','https://www.allrecipes.com/recipe/24416/smooth-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/2367.jpg','A great creamy-smooth soup for cold winter nights.  The thickness of the soup is determined by the proportions of cauliflower to water.  Because different sizes of cauliflower are out there, add water if soup comes out too thick.',44),('Caldo de Res (Mexican Beef Soup)','https://www.allrecipes.com/recipe/85055/caldo-de-res-mexican-beef-soup/','https://images.media-allrecipes.com/userphotos/560x315/5960367.jpg','This is an extremely hearty and satisfying soup.  The hind shank flavors the broth beautifully as does the marrow in the bones. Garnish with slivered raw onion, lime juice, jalapenos, and more cilantro.',234),('Quick and Easy Vegetable Soup','https://www.allrecipes.com/recipe/13338/quick-and-easy-vegetable-soup/','https://images.media-allrecipes.com/userphotos/560x315/5902259.jpg','A low calorie, but filling, tomato-based vegetable soup.  I use fresh vegetables when in season, frozen or canned in winter.',116),('Golden Potato Soup','https://www.allrecipes.com/recipe/13316/golden-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/3591534.jpg','This is a thick, hearty soup.  Kids love this because of the cheesy flavor.',299),('Perfect Fried Green Tomatoes','https://www.allrecipes.com/recipe/233122/perfect-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/3814538.jpg','I have been making fried green tomatoes for over 35 years, taught by my grandmother who is from down south. Over the years I have tried and made fried green tomato recipes and this is the one that is perfect. Cajun ranch sauce goes perfect with this crispy on the outside but smooth and creamy on the inside tomato.',443),('Eggy Veggie Bake','https://www.allrecipes.com/recipe/83573/eggy-veggie-bake/','https://images.media-allrecipes.com/userphotos/250x250/827500.jpg','Yummy dish that I created one night. You could add just about anything to it. Could be breakfast, lunch, or dinner! Warm, fresh, and dee-lish! I like mine with a dollop of sour cream and some slices of avocado.',175),('Broccoli with Lemon Butter Sauce','https://www.allrecipes.com/recipe/88520/broccoli-with-lemon-butter-sauce/','https://images.media-allrecipes.com/userphotos/560x315/1100901.jpg','A fast and zesty take on frozen broccoli. Can also use fresh broccoli. Great summer dish. Can be served hot or cold.',137),('No Time to Cook Chicken','https://www.allrecipes.com/recipe/17607/no-time-to-cook-chicken/','https://images.media-allrecipes.com/userphotos/560x315/1102594.jpg','Chicken, creamy soups, and sour cream in a slow cooker - cook all day, ready for you when you get home. Only 4 ingredients! Everyone loves this, a no hassle dinner good enough for company.',304),('Cream of Fresh Asparagus Soup II','https://www.allrecipes.com/recipe/13114/cream-of-fresh-asparagus-soup-ii/','https://images.media-allrecipes.com/userphotos/560x315/3275447.jpg','There\'s nothing like fresh asparagus when it\'s in season - take advantage!',196),('Asparagus and Mozzarella Stuffed Chicken Breasts','https://www.allrecipes.com/recipe/213647/asparagus-and-mozzarella-stuffed-chicken-breasts/','https://images.media-allrecipes.com/userphotos/250x250/794053.jpg','This dish is easy enough for a Tuesday, but looks pretty enough for company.  It has a really fresh flavor and goes great with roasted potatoes or rice.',390),('Judy\'s Hearty Vegetable Minestrone Soup','https://www.allrecipes.com/recipe/234695/judys-hearty-vegetable-minestrone-soup/','https://images.media-allrecipes.com/userphotos/560x315/1930650.jpg','Delicious vegetarian minestrone soup.',217),('Chorizo Breakfast Tacos with Potato Hash and Eggs','https://www.allrecipes.com/recipe/261547/chorizo-breakfast-tacos-with-potato-hash-and-eggs/','https://images.media-allrecipes.com/userphotos/560x315/4520890.jpg','Chorizo breakfast tacos with potato hash and eggs are ridiculously flavorful, quick, and easy. The perfect meal any time of day!',421),('Quick Creamed Curried Corn ','https://www.allrecipes.com/recipe/234316/quick-creamed-curried-corn/','https://images.media-allrecipes.com/userphotos/560x315/1060198.jpg','This is my new favorite corn side dish. You\'re going to be so shocked that without butter, without heavy cream, you\'re going to have a delicious corn side dish that\'s every bit as rich and decadent, and it\'s going to be significantly lower in calories.',98),('Lemon-Buttermilk Pound Cake with Aunt Evelyn\'s Lemon Glaze','https://www.allrecipes.com/recipe/236915/lemon-buttermilk-pound-cake-with-aunt-evelyns-lemon-glaze/','https://images.media-allrecipes.com/userphotos/560x315/2054794.jpg','My mother\'s blue-ribbon pound cake recipe. It always gets rave reviews.',630),('Brilliant Sauteed Broccoli','https://www.allrecipes.com/recipe/138016/brilliant-sauteed-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/1117117.jpg','If you want a slightly original restaurant-quality broccoli at any point within three days, this is the recipe you want! This is also great for entertaining guests with a large amount of food, and you want to shave some time without looking like you cut corners. This recipe shows how you can shock your greens to stay brilliant, while making a presentation that says you really care about your food.',81),('Chicken Cordon Bleu II','https://www.allrecipes.com/recipe/8669/chicken-cordon-bleu-ii/','https://images.media-allrecipes.com/userphotos/560x315/4535588.jpg','\'Cordon Bleu\' is a French term, literally translated as \'blue ribbon\', that originally referred to an award for culinary excellence given to women cooks! The term can now apply to any superior cook (yes, men too), and also to this dish (chicken, ham and Swiss cheese slices, breaded and sauteed). This yummy version adds paprika and a creamy white wine sauce worthy of its own blue ribbon. Two blue ribbon tastes in wedded bliss -- Chicken Cordon Bleu II!',584),('Jamie\'s Minestrone','https://www.allrecipes.com/recipe/13333/jamies-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/5283238.jpg','I created this soup after becoming tired of the excess salt and lack of veggies in canned minestrone.  I recalled a great bowl of minestrone that was overflowing with rich vegetables at the \'Sheepherder\'s Inn\' in Sacramento, California.  Great with a hearty bread, romaine salad and a nice Merlot!',227),('Shrimp and Cheesy Grits with Bacon','https://www.allrecipes.com/recipe/220903/shrimp-and-cheesy-grits-with-bacon/','https://images.media-allrecipes.com/userphotos/560x315/2468310.jpg','Lowcountry style shrimp and grits at its best!',508),('Cheesiest Potato Soup','https://www.allrecipes.com/recipe/25732/cheesiest-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/2631567.jpg','Cream and sharp Cheddar are added to pureed potatoes and the soup is seasoned with dill and cayenne for a creamy, thick meal.',366),('Country Sunday Breakfast Casserole','https://www.allrecipes.com/recipe/230966/country-sunday-breakfast-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1539295.jpg','A one-dish casserole with all of your Sunday morning favorites.',377),('Spicy Black Bean Vegetable Soup','https://www.allrecipes.com/recipe/12999/spicy-black-bean-vegetable-soup/','https://images.media-allrecipes.com/userphotos/560x315/1046805.jpg','Half of the black beans in this spicy soup are pureed with tomatoes, the other half are simmered with carrots, onion and kernels of corn.',164),('Chicken Makhani (Indian Butter Chicken)','https://www.allrecipes.com/recipe/45957/chicken-makhani-indian-butter-chicken/','https://images.media-allrecipes.com/userphotos/560x315/1116370.jpg','Chicken Makhani is one of my favorite Indian dishes. It is a full flavored dish that complements the chicken well. It can be made as mild or spicy as you wish by adjusting the cayenne. Serve with basmati rice and naan bread.',408),('Summer Zucchini Stew','https://www.allrecipes.com/recipe/52357/summer-zucchini-stew/','https://images.media-allrecipes.com/userphotos/560x315/998851.jpg','A wonderful, tasty summer stew. My mom always made this for us in the summer - I loved it then and I love it now! Serve topped with freshly grated Parmesan or Romano cheese.',381),('Pad Kee Mow (Drunkard\'s Noodles)','https://www.allrecipes.com/recipe/220443/pad-kee-mow-drunkards-noodles/','https://images.media-allrecipes.com/userphotos/560x315/860032.jpg','Pad Kee Mow, or Drunkard\'s Noodles, is a popular Thai dish. It is my personal favorite when visiting any Thai restaurant. It is made differently by every cook. My girlfriend and I experimented to come up with this version. Feel free to make alterations to suit your own taste! Many ingredients (Thai basil, fish sauce, palm sugar, etc.) may be difficult to find in a regular supermarket, but you can most likely find them in an Asian market.',301),('Chef John\'s Fried Green Tomatoes ','https://www.allrecipes.com/recipe/233658/chef-johns-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/3664748.jpg','Fried green tomatoes are a southern American classic. Such an easy recipe! Serve with a little dollop of spicy remoulade sauce (which is Southern for tartar sauce). Oh yeah.',514),('Strawberry Bread','https://www.allrecipes.com/recipe/9353/strawberry-bread/','https://images.media-allrecipes.com/userphotos/560x315/836956.jpg','This is wonderful hot or cold, for breakfast or as a dessert. A definite family favorite!',281),('Slow Cooker Buffalo Chicken Sandwiches','https://www.allrecipes.com/recipe/176132/slow-cooker-buffalo-chicken-sandwiches/','https://images.media-allrecipes.com/userphotos/560x315/494608.jpg','This is a spicy, hearty sandwich that will please those who love buffalo chicken wings. This recipe is perfect for those days spent watching football. I like to top these with blue cheese or ranch dressing.',578),('Creamy Au Gratin Potatoes','https://www.allrecipes.com/recipe/15925/creamy-au-gratin-potatoes/','https://images.media-allrecipes.com/userphotos/560x315/738814.jpg','This is my husband\'s favorite dish, and he considers it a special occasion every time I make it. The creamy cheese sauce and the tender potatoes in this classic French dish combine to make a deliciously addictive experience. It\'s a great side dish with a roast pork loin or beef tenderloin. Add a green salad and French bread, and you have found the magic path to a man\'s heart. To avoid lumps in your sauce, add the milk just a little at a time as you stir the flour and butter. Experiment with different cheeses for variety.',499),('Cheesy Grilled Broccoli','https://www.allrecipes.com/recipe/266397/cheesy-grilled-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/5533756.jpg','During grilling season, don\'t forget the veggies! Grilling veggies provides a whole new dimension and depth of flavor.  Wow your guests with this easy-to-make recipe.',125),('Roasted Garlic Lemon Broccoli','https://www.allrecipes.com/recipe/144346/roasted-garlic-lemon-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/549154.jpg','I was looking for a unique way to prepare broccoli and decided to give this a try! Florets are roasted after being tossed in olive oil and sprinkled with sea salt, freshly ground black pepper, and minced garlic. A squeeze of lemon juice before serving seals the deal.',49),('Mom\'s Zucchini Bread','https://www.allrecipes.com/recipe/6698/moms-zucchini-bread/','https://images.media-allrecipes.com/userphotos/560x315/1037957.jpg','Really, really good and moist- my kids eat it as quickly as I can make it.  Bread will freeze well, and keep in refrigerator for weeks.',255),('Old Charleston Style Shrimp and Grits','https://www.allrecipes.com/recipe/220895/old-charleston-style-shrimp-and-grits/','https://images.media-allrecipes.com/userphotos/560x315/1046567.jpg','Great recipe for shrimp and grits.',618),('Strawberry Spinach Salad I','https://www.allrecipes.com/recipe/14276/strawberry-spinach-salad-i/','https://images.media-allrecipes.com/userphotos/560x315/4539063.jpg','Someone brought this salad to a pot luck dinner and I had to have the recipe. I have made it many, many times since then and I have been asked for the recipe every time I bring it somewhere. It is also a great way to get kids to eat spinach!',491),('White Bean Chicken Chili','https://www.allrecipes.com/recipe/13010/white-bean-chicken-chili/','https://images.media-allrecipes.com/userphotos/560x315/2568455.jpg','This recipe was passed down from a friend, and now it is one of our favorites!  It\'s great to make whenever there is left over chicken or turkey around!  We pray for colder weather in California just so we can make this soup!  You can substitute additional diced tomatoes for the tomatillos. If you would like the soup to be spicier, you can add some red chili flakes or salsa. Serve with these toppings for people to choose from: limes, cilantro,  cheese, avocado, sour cream, and tortilla chips.',220),('Scones','https://www.allrecipes.com/recipe/20175/scones/','https://images.media-allrecipes.com/userphotos/560x315/5614372.jpg','This is a very simple recipe for scones. You can customize them by adding dried fruit or nuts. Half and half can also be substituted for milk if you wish.',397),('Tortellini Minestrone Soup','https://www.allrecipes.com/recipe/233756/tortellini-minestrone-soup/','https://images.media-allrecipes.com/userphotos/560x315/1120312.jpg','Good soup for cold day.',415),('Fire and Ice Smoked Salmon','https://www.allrecipes.com/recipe/217779/fire-and-ice-smoked-salmon/','https://images.media-allrecipes.com/userphotos/560x315/2275687.jpg','You will love this smoked salmon.  Has a bite, but is delicious. Came from a famous seafood restaurant in Phoenix.',396),('Winter Green Salad','https://www.allrecipes.com/recipe/230766/winter-green-salad/','https://images.media-allrecipes.com/userphotos/560x315/4581949.jpg','People tend to forget to eat salads and other raw foods in the cold weather. This salad is a good way to get your greens by combining somewhat heartier salad textures. I find that this salad is filling enough to be a main course, with a bit of bread or some rice cakes on the side. It will also work as an appetizer in a smaller serving.',421),('Fluffy French Toast','https://www.allrecipes.com/recipe/16895/fluffy-french-toast/','https://images.media-allrecipes.com/userphotos/560x315/2049275.jpg','This French toast recipe is different because it uses flour. I have given it to some friends and they\'ve all liked it better than the French toast they usually make!',123),('Hash Brown Casserole II','https://www.allrecipes.com/recipe/18511/hash-brown-casserole-ii/','https://images.media-allrecipes.com/userphotos/560x315/1060127.jpg','Cheesy and delicious, this hash brown casserole has a crunchy topping.',321),('Baja-Style Fish Tacos','https://www.allrecipes.com/recipe/79414/baja-style-fish-tacos/','https://images.media-allrecipes.com/userphotos/250x250/660035.jpg','These fish tacos have a delicious tequila-lime-chili flavor and are topped with a crunchy ranchero coleslaw. They are very easy to make. Optional toppings can include black beans, jalapeno peppers, diced tomato, julienned carrots, and green onions.',489),('Easy Pancakes','https://www.allrecipes.com/recipe/45396/easy-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/2361199.jpg','This recipe doesn\'t require much thought early in the morning, and tastes great!',247),('Fresh Tomato Salsa','https://www.allrecipes.com/recipe/14088/fresh-tomato-salsa/','https://images.media-allrecipes.com/userphotos/560x315/797844.jpg','This is a delicious homemade salsa.',51),('Waffles I','https://www.allrecipes.com/recipe/22180/waffles-i/','https://images.media-allrecipes.com/userphotos/560x315/3875444.jpg','You can keep the batter covered in the fridge for up to a week. Just be sure to whisk well before using again. You may also use whole wheat flour for this recipe.',382),('Thai Sweet Sticky Rice With Mango (Khao Neeo Mamuang)','https://www.allrecipes.com/recipe/150313/thai-sweet-sticky-rice-with-mango-khao-neeo-mamuang/','https://images.media-allrecipes.com/userphotos/560x315/4507196.jpg','This wonderful and authentic-tasting Thai dessert is as good, if not better, than any sweet sticky rice with Mango available in Thai restaurants.',817),('Stir-Fried Kale and Broccoli Florets','https://www.allrecipes.com/recipe/87822/stir-fried-kale-and-broccoli-florets/','https://images.media-allrecipes.com/userphotos/250x250/18782.jpg','A delicious, satisfying, low-calorie side dish for those who are dieting and can do without rice or potatoes.',114),('Cream of Cauliflower Soup II','https://www.allrecipes.com/recipe/25694/cream-of-cauliflower-soup-ii/','https://images.media-allrecipes.com/userphotos/560x315/46032.jpg','I make lots of cream soups and this is a good \'basic\' recipe. I originally made this in 1990 and always make some modifications - we like lots of garlic as reflected in this recipe!! I also add or substitute other vegetables, i.e., broccoli and spinach. I also use potatoes for thickening rather than cream to keep the fat down.',194),('Lentil Salad with a Persian Twist','https://www.allrecipes.com/recipe/223575/lentil-salad-with-a-persian-twist/','https://images.media-allrecipes.com/userphotos/560x315/972169.jpg','A refreshing salad made with diced vegetables and lentils, perfect for a side dish or on its own. To add more freshness, add chopped mint to the salad.',159),('Buffalo Chicken Skillet','https://www.allrecipes.com/recipe/245763/buffalo-chicken-skillet/','https://images.media-allrecipes.com/userphotos/560x315/5455182.jpg','Both simple and amazing, this is a family favorite!',509),('Bacon for the Family or a Crowd','https://www.allrecipes.com/recipe/158727/bacon-for-the-family-or-a-crowd/','https://images.media-allrecipes.com/userphotos/560x315/666312.jpg','This is the way to get crisp bacon without having to constantly turn it, watch over it, or get burnt by splatters of grease. It \'fries\' up flat and doesn\'t curl, which looks great beside a breakfast plate of eggs, and makes BLT sandwiches much easier. Very nice when feeding a family or crowd.',203),('Honey Roasted Red Potatoes','https://www.allrecipes.com/recipe/18293/honey-roasted-red-potatoes/','https://images.media-allrecipes.com/userphotos/560x315/890403.jpg','These slightly sweet potatoes are perfect with most entrees.',156),('Broccoli with Garlic Butter and Cashews','https://www.allrecipes.com/recipe/86687/broccoli-with-garlic-butter-and-cashews/','https://images.media-allrecipes.com/userphotos/560x315/814892.jpg','A new recipe a neighbor gave us. What a hit with my family. Just the right mixture of garlic and cashews with our favorite side dish, broccoli. And, so very easy to make!! If in a pinch, you could probably use frozen broccoli too, but I haven\'t tried.',187),('Spicy Fried Green Tomatoes','https://www.allrecipes.com/recipe/87990/spicy-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/250x250/40291.jpg','A quick snack or appetizer during the hot summer months. Old time family recipe. If you like fried zucchini you will like this.',207),('Apple-Raisin French Toast Casserole','https://www.allrecipes.com/recipe/45620/apple-raisin-french-toast-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1449378.jpg','This is a delicious breakfast dish that my mother likes to prepare for Christmas breakfast.  It is easy to prepare, and sets overnight, so in the morning you just put it in the oven and enjoy.',341),('Baked Dijon Salmon','https://www.allrecipes.com/recipe/21176/baked-dijon-salmon/','https://images.media-allrecipes.com/userphotos/560x315/877476.jpg','This is a wonderful way to prepare fresh salmon fillets in the oven. Be sure to make extra, your family will be begging for more!',422),('Broccoli in Roast Chicken Drippings','https://www.allrecipes.com/recipe/98544/broccoli-in-roast-chicken-drippings/','https://images.media-allrecipes.com/userphotos/560x315/1019848.jpg','Split breast chicken roasted with my favorite seasonings blend, taken out of the oven to rest.  In its place, fresh broccoli spears and sliced garlic roasted until tender.  Pure laziness, pure genius.',143),('Creamy Ham and Cheese Quiche','https://www.allrecipes.com/recipe/creamy-ham-and-cheese-quiche/','https://images.media-allrecipes.com/userphotos/560x315/2134337.jpg','This quiche is creamy, simple, and delicious!',327),('Delicious Ham and Potato Soup','https://www.allrecipes.com/recipe/56927/delicious-ham-and-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/962656.jpg','This is a delicious recipe for ham and potato soup that a friend gave to me. It is very easy and the great thing about it is that you can add additional ingredients, more ham, potatoes, etc and it still turns out great.',195),('Thai Chicken Curry in Coconut Milk','https://www.allrecipes.com/recipe/56094/thai-chicken-curry-in-coconut-milk/','https://images.media-allrecipes.com/userphotos/560x315/1320983.jpg','This recipe is one of the favorites in the family! If you don\'t have fish sauce available, try making it with soy sauce.',269),('Blueberry Sour Cream Coffee Cake','https://www.allrecipes.com/recipe/70828/blueberry-sour-cream-coffee-cake/','https://images.media-allrecipes.com/userphotos/560x315/5996429.jpg','One really delicious and really unhealthy Sunday coffee cake. I have no idea where I got this recipe from but it was about thirty years ago and has been a family favorite since. The bake time is a bit longer if you\'re using frozen berries.',459),('Baked Denver Omelet','https://www.allrecipes.com/recipe/229780/baked-denver-omelet/','https://images.media-allrecipes.com/userphotos/560x315/1029125.jpg','My family loves omelets, and this is a quick and easy one. These directions are for a Denver omelet, but experiment with other ingredients to make your favorite.',345),('Easy Broccoli Quiche','https://www.allrecipes.com/recipe/24148/easy-broccoli-quiche/','https://images.media-allrecipes.com/userphotos/560x315/82760.jpg','This easy vegetarian quiche is a snap to make but looks great on the table.',371),('Vanilla-Almond Spiced French Toast','https://www.allrecipes.com/recipe/240446/vanilla-almond-spiced-french-toast/','https://images.media-allrecipes.com/userphotos/560x315/1947544.jpg','A must for those who like their French toast sweet and super flavorful!',337),('The Best Ricotta Pancakes','https://www.allrecipes.com/recipe/242225/the-best-ricotta-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/3377754.jpg','This is a well loved recipe! I have an old, small crumpled piece of paper with this recipe hand written out from some years ago, not sure where it came from! I have my own scribbles and scratches on it, so I must have changed it somewhere in time, but this is how I have been making it the last 10 years. It is our favorite pancake recipe. So light, a little tangy, and very satisfying. Perfect with some fresh blueberries or strawberries.',86),('Chicken and Artichoke Minestrone','https://www.allrecipes.com/recipe/58181/chicken-and-artichoke-minestrone/','https://images.media-allrecipes.com/userphotos/250x250/311891.jpg','This hearty soup is a great \'warm you upper\' for a cold winter night! Served with fresh grated Romano cheese and oven warm Italian bread, it\'s a hit any night of the week. Mangia!',250),('Chicken Souvlaki with Tzatziki Sauce','https://www.allrecipes.com/recipe/231644/chicken-souvlaki-with-tzatziki-sauce/','https://images.media-allrecipes.com/userphotos/560x315/1010770.jpg','Greek kabobs. Fantastic flavor for chicken. Marinade can also be used for pork.',268),('Christmas Breakfast Sausage Casserole','https://www.allrecipes.com/recipe/9247/christmas-breakfast-sausage-casserole/','https://images.media-allrecipes.com/userphotos/560x315/2955929.jpg','My mom has always made this for us on Christmas morning, and since we only have it once a year it makes it even more good. It is so delicious, and everyone enjoys it! When I double the recipe I use 1 pound regular sausage and 1 pound sage sausage.',377),('Roasted Pumpkin Seeds','https://www.allrecipes.com/recipe/13768/roasted-pumpkin-seeds/','https://images.media-allrecipes.com/userphotos/560x315/729337.jpg','Here is an easy recipe for roasting fresh pumpkin seeds.',83),('Super Easy Egg Casserole','https://www.allrecipes.com/recipe/241925/super-easy-egg-casserole/','https://images.media-allrecipes.com/userphotos/560x315/2195255.jpg','Another husband-approved recipe. Made a couple times recently because of how easy it is to make! This recipe is easy to double or triple, but you may have to cook a bit longer if doing so.',340),('Chef John\'s Sweet Potato Muffins','https://www.allrecipes.com/recipe/245442/chef-johns-sweet-potato-muffins/','https://images.media-allrecipes.com/userphotos/560x315/3956699.jpg','Instead of sweet potato pie (which I\'m not that fond of), I made sweet potato muffins and I was thrilled with the results. Muffin or cupcake? Frosted or unfrosted? Doesn\'t matter--these really are fantastic.',260),('Churros','https://www.allrecipes.com/recipe/24700/churros/','https://images.media-allrecipes.com/userphotos/560x315/392145.jpg','These Mexican fritters are very common at fairs. In my border hometown, the line at this stand is always overwhelming. People wait hours in line just to get a taste of these churros. I have run across several recipes but this is the best one by far.',691),('Easy Mexican Casserole','https://www.allrecipes.com/recipe/20680/easy-mexican-casserole/','https://images.media-allrecipes.com/userphotos/560x315/5670908.jpg','This is an easy and very tasty dish. I often substitute ground turkey and low fat dairy products and it is still delicious! Serve with chips, salsa and green salad.',632),('Creamy Cottage Cheese Scrambled Eggs','https://www.allrecipes.com/recipe/creamy-cottage-cheese-scrambled-eggs/','https://images.media-allrecipes.com/userphotos/560x315/2036588.jpg','A nice change from regular scrambled eggs. These eggs come out creamy and soft. Perfect with a slice of tomato and turkey bacon for a delicious and fast low-carb breakfast.',224),('Black Bean Huevos Rancheros','https://www.allrecipes.com/recipe/143432/black-bean-huevos-rancheros/','https://images.media-allrecipes.com/userphotos/560x315/1004135.jpg','Layered with black beans plus fresh salsa and shredded Monterey Jack cheese, this is a delicious version of the classic Spanish or Mexican \'rancher\'s eggs\' dish.',440),('Laura\'s Quick Slow Cooker Turkey Chili','https://www.allrecipes.com/recipe/82768/lauras-quick-slow-cooker-turkey-chili/','https://images.media-allrecipes.com/userphotos/560x315/1009122.jpg','This is an easy chili recipe that you can throw in the slow cooker and forget about all day. Great topped with Cheddar cheese, crushed corn chips, and a dollop of sour cream.',276),('Kentucky Style Fried Green Tomatoes','https://www.allrecipes.com/recipe/89770/kentucky-style-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/250x250/31837.jpg','If you\'re not frying your green tomatoes in bacon grease then you have lost half of the great flavor! No self-respecting Southerner fries their green tomatoes in anything but bacon grease!',866),('Smoked Salmon Quiche','https://www.allrecipes.com/recipe/237700/smoked-salmon-quiche/','https://images.media-allrecipes.com/userphotos/560x315/2227552.jpg','Quiche quickly became my specialty. If you like smoked salmon, this dish will both surprise you and impress your guests. Best served with Caesar salad.',363),('Healthier Potato and Cauliflower Soup','https://www.allrecipes.com/recipe/235312/healthier-potato-and-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/1096287.jpg','This recipe is the result of my desire to lighten one of my favorite comfort foods: potato soup. Cauliflower adds bulk and nutrition while the potato keeps the strong flavor of the cauliflower from overwhelming the dish.',58),('Roasted Cauliflower Soup','https://www.allrecipes.com/recipe/216950/roasted-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/1012540.jpg','This is simple and delicious. The taste is so smooth and creamy most people think this is a fattening soup loaded with cream and potatoes. People are always shocked by how few ingredients are needed.',140),('Egg and Sausage Casserole','https://www.allrecipes.com/recipe/20916/egg-and-sausage-casserole/','https://images.media-allrecipes.com/userphotos/250x250/46338.jpg','This recipe was given to me by a friend several years ago. It\'s easy to make and always a hit! Co-workers beg for it, and it\'s my husband\'s favorite!',341),('Authentic Pad Thai','https://www.allrecipes.com/recipe/222350/authentic-pad-thai/','https://images.media-allrecipes.com/userphotos/560x315/1023388.jpg','Inspired by the pad thai at Thai Tom, this recipe features a tamarind paste, vinegar, sugar, and fish sauce mixture over perfectly stir-fried eggs, chicken breast, and rice noodles, garnished with peanuts, chives, and fresh bean sprouts.',583),('Overnight Blueberry French Toast','https://www.allrecipes.com/recipe/15057/overnight-blueberry-french-toast/','https://images.media-allrecipes.com/userphotos/560x315/381517.jpg','This is a very unique breakfast dish. Good for any holiday breakfast or brunch, it\'s filled with the fresh taste of blueberries, and covered with a rich blueberry sauce to make it a one of a kind.',485),('Spinach and Strawberry Salad','https://www.allrecipes.com/recipe/16409/spinach-and-strawberry-salad/','https://images.media-allrecipes.com/userphotos/560x315/4535439.jpg','My family loves this all year round if we can find strawberries. Even the grandchildren love this salad. Quick and easy.',235),('Easy Minestrone','https://www.allrecipes.com/recipe/240127/easy-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/5809439.jpg','I wanted a soup recipe that I could make with staples that I always have on hand. This has become a family favorite so I always make enough to freeze. Serve topped with grated Parmesan cheese.',216),('Spinach Stuffed Chicken Breasts','https://www.allrecipes.com/recipe/8551/spinach-stuffed-chicken-breasts/','https://images.media-allrecipes.com/userphotos/560x315/404016.jpg','Spinach and cheese stuffed into boneless, skinless chicken breasts.  Serve with rice, noodles, or a great Greek salad!',449),('Classic Minestrone Soup','https://www.allrecipes.com/recipe/255650/classic-minestrone-soup/','https://images.media-allrecipes.com/userphotos/560x315/4022830.jpg','Minestrone is a hearty, traditional Italian soup typically made with beans, pasta and lots of vegetables.  Enjoy the slow-cooked flavor in just about 30 minutes.',235),('True Maryland Crab Cakes','https://www.allrecipes.com/recipe/89037/true-maryland-crab-cakes/','https://images.media-allrecipes.com/userphotos/560x315/971099.jpg','This Crab Cake recipe is the true Crab Cake with no fillers and no heavy spices, all crab meat. This recipe has been in my family for generations.',388),('Kickin\' Collard Greens','https://www.allrecipes.com/recipe/51803/kickin-collard-greens/','https://images.media-allrecipes.com/userphotos/560x315/822015.jpg','If you like greens you will love this recipe.  The bacon and onions give them a wonderful flavor.  Add more red pepper for a little more spice.',127),('Zucchini and Pork Soup','https://www.allrecipes.com/recipe/14755/zucchini-and-pork-soup/','https://images.media-allrecipes.com/userphotos/250x250/104784.jpg','Besides being tasty, this soup is also low in calories and fat, inexpensive, and very quick to make. The ingredients are ones that I usually stock in my kitchen, but aren\'t expensive to buy if you don\'t. They can be used in many other ways, too, so you won\'t be wasting anything. This soup reheats and freezes well.',169),('Curried Apple and Leek Soup','https://www.allrecipes.com/recipe/25693/curried-apple-and-leek-soup/','https://images.media-allrecipes.com/userphotos/560x315/4557226.jpg','The title says it all -- with potatoes, too.',133),('Red Skinned Potato Salad','https://www.allrecipes.com/recipe/25155/red-skinned-potato-salad/','https://images.media-allrecipes.com/userphotos/560x315/96575.jpg','This creamy salad is made with red potatoes, which give this dish--chock full of melt-in-your-mouth bacon, bits of hard boiled egg, crunchy celery and spicy onion--a delectable, firm texture.',430),('Banana Sour Cream Bread','https://www.allrecipes.com/recipe/6984/banana-sour-cream-bread/','https://images.media-allrecipes.com/userphotos/560x315/4510541.jpg','I know, you\'re probably thinking, \'Oh no! Another banana bread recipe!\' But this one is a little different: the sour cream makes this one so moist it melts in your mouth. The flavor is just wonderful!  This one is great for gift giving and holidays. Loaves freeze well.',263),('Holiday Chicken Salad','https://www.allrecipes.com/recipe/8584/holiday-chicken-salad/','https://images.media-allrecipes.com/userphotos/560x315/708660.jpg','Serve on lettuce cups, or make sandwiches.  Stand back and enjoy the applause!',315),('All-American Loaded Baked Potato Salad','https://www.allrecipes.com/recipe/254568/all-american-loaded-baked-potato-salad/','https://images.media-allrecipes.com/userphotos/560x315/3774804.jpg','This is a great twist on two all-American favorites--the potato salad and the loaded baked potato. Served cold, this has been a crowd-pleaser at our many family functions and is often requested. Even people who don\'t normally love potato salad seem to love this!',434),('Provincial Tomatoes','https://www.allrecipes.com/recipe/61562/provincial-tomatoes/','https://images.media-allrecipes.com/userphotos/250x250/930848.jpg','Delicious fresh tomatoes broiled with a tasty cheese topping.',153),('Pesto Tuna Salad with Sun-Dried Tomatoes','https://www.allrecipes.com/recipe/80746/pesto-tuna-salad-with-sun-dried-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/280991.jpg','I was bored and hungry, and wondering what I was going to do with some left-over pesto and some pesky sun-dried tomatoes that I wanted to get out of the fridge. I\'m also a low-carber, so pasta was out of the question. It may seem kind of a weird combination, but the sun-dried tomatoes gave the tuna salad a nice sweetness and added an interesting texture.',368),('Breakfast Biscuits','https://www.allrecipes.com/recipe/24212/breakfast-biscuits/','https://images.media-allrecipes.com/userphotos/560x315/714403.jpg','The homemade version of fast food breakfast biscuits. You can exchange toppings to fit your taste buds. My kids love them!',482),('Fabulous Roasted Cauliflower Soup','https://www.allrecipes.com/recipe/151046/fabulous-roasted-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/209198.jpg','I love making homemade soups in the fall, and this is my new favorite. Serve with crusty rolls.',356),('Pan Seared Salmon I','https://www.allrecipes.com/recipe/21736/pan-seared-salmon-i/','https://images.media-allrecipes.com/userphotos/560x315/998740.jpg','Simply seasoned with salt and pepper, these salmon fillets are pan seared with capers, and garnished with slices of lemon.',371),('Jacob\'s Roasted Broccoli','https://www.allrecipes.com/recipe/255335/jacobs-roasted-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/3982285.jpg','Roasted broccoli topped with lemon juice is a quick and easy side dish that only requires 5 ingredients and is a simple addition to any meal. This recipe was made in a Panasonic CIO and appears on an episode of the Dinner Spinner TV Show on The CW!',172),('Butternut Squash Soup II','https://www.allrecipes.com/recipe/77981/butternut-squash-soup-ii/','https://images.media-allrecipes.com/userphotos/560x315/964341.jpg','This is a thick, rich soup with tons of flavor. Something I whipped up off the top of my head, with things I had on hand. Super easy, quick, and a great way to use squash. An instant hit at my house.',305),('Roasted Brussels Sprouts','https://www.allrecipes.com/recipe/67952/roasted-brussels-sprouts/','https://images.media-allrecipes.com/userphotos/560x315/812447.jpg','This recipe is from my mother. It may sound strange, but these are really good and very easy to make. The Brussels sprouts should be brown with a bit of black on the outside when done. Any leftovers can be reheated or even just eaten cold from the fridge. I don\'t know how, but they taste sweet and salty at the same time!',104),('Green Beans with Cherry Tomatoes','https://www.allrecipes.com/recipe/60616/green-beans-with-cherry-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/874594.jpg','These beans are briefly boiled and tossed with cherry tomatoes in a buttery basil sauce to make the most yummy green beans ever! We serve these at Easter Dinner every year but are a delicious accent to any meal.',122),('Cedar Planked Salmon','https://www.allrecipes.com/recipe/109297/cedar-planked-salmon/','https://images.media-allrecipes.com/userphotos/560x315/2609651.jpg','This is a dish my brother prepared for me in Seattle. It is by far the best salmon I\'ve ever eaten. I like to serve it with an Asian-inspired rice and roasted asparagus.',678),('Best Chocolate Chip Cookies','https://www.allrecipes.com/recipe/10813/best-chocolate-chip-cookies/','https://images.media-allrecipes.com/userphotos/560x315/4462051.jpg','Crisp edges, chewy middles.',298),('Sesame Broccoli','https://www.allrecipes.com/recipe/23262/sesame-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/12628.jpg','Light sesame oil works best for this recipe. Vegetable oil can be used instead.',67),('Simple Baked Chicken Breasts','https://www.allrecipes.com/recipe/240208/simple-baked-chicken-breasts/','https://images.media-allrecipes.com/userphotos/560x315/1769311.jpg','Simple basic recipe for cooking up a bunch of skinless boneless chicken breasts.',191),('Bodacious Broccoli Salad','https://www.allrecipes.com/recipe/14281/bodacious-broccoli-salad/','https://images.media-allrecipes.com/userphotos/560x315/352465.jpg','This recipe is requested at every family gathering. Let it be your next dish that they crave! I like this dish to be prepared at least two hours before serving. Be sure to have copies of the recipe on hand, as everyone will ask for it!',273),('Winter Root Soup','https://www.allrecipes.com/recipe/229119/winter-root-soup/','https://images.media-allrecipes.com/userphotos/560x315/3067875.jpg','This recipe comes from a cooking demonstration I attended in Garmisch, Germany. So easy! You can add your own topper like sour cream or fresh chopped chives and olive oil. When reheating, add a little cream or milk.',270),('Quick and Almost-Professional Buttercream Icing','https://www.allrecipes.com/recipe/174347/quick-and-almost-professional-buttercream-icing/','https://images.media-allrecipes.com/userphotos/560x315/572806.jpg','After failing to find the perfect recipe for buttercream icing, I found one that worked for me and then added my own two cents.',228),('Awesome Slow Cooker Pot Roast Plus Extras','https://www.allrecipes.com/recipe/236872/awesome-slow-cooker-pot-roast-plus-extras/','https://images.media-allrecipes.com/userphotos/560x315/3380713.jpg','This simple pot roast makes its own gravy in the slow cooker. As a single parent to girls, I am always trying to get the food groups into my abbreviated meals. I threw in potatoes, carrots, yellow squash, and zucchini to add to the original base recipe. They love stew, so this leads them in that direction, but is still a roast. It was a hit. I hope you enjoy it!',401),('Apple Puff Pancake','https://www.allrecipes.com/recipe/50936/apple-puff-pancake/','https://images.media-allrecipes.com/userphotos/560x315/681975.jpg','Apples are baked into a breakfast cake. This is so delicious that you don\'t need to add any syrup. A great alternative to regular pancakes.',192),('Peanut Butter Noodles','https://www.allrecipes.com/recipe/11835/peanut-butter-noodles/','https://images.media-allrecipes.com/userphotos/560x315/422062.jpg','This is kid friendly with an Asian twist. Can also be made with spaghetti pasta.',330),('Blueberry Zucchini Bread','https://www.allrecipes.com/recipe/74657/blueberry-zucchini-bread/','https://images.media-allrecipes.com/userphotos/560x315/2486000.jpg','Blueberries and zucchini baked up into delicious little summertime bread loaves!',461),('Slow Cooker Chicken Pot Pie Stew','https://www.allrecipes.com/recipe/180118/slow-cooker-chicken-pot-pie-stew/','https://images.media-allrecipes.com/userphotos/560x315/1002504.jpg','This is a great meal for busy families! It\'s hearty and easy. Kids love it, too! Serve over split buttermilk biscuits.',263),('Classic Macaroni Salad','https://www.allrecipes.com/recipe/81108/classic-macaroni-salad/','https://images.media-allrecipes.com/userphotos/560x315/878056.jpg','This is a salad that everyone seems to love. I always get lots of compliments on this recipe and it is just a pleasing taste that seems to suit everyone.',390),('Irish Chicken and Dumplings','https://www.allrecipes.com/recipe/11843/irish-chicken-and-dumplings/','https://images.media-allrecipes.com/userphotos/560x315/13725.jpg','This is our family\'s very favorite comfort food.',595),('American French Onion Soup','https://www.allrecipes.com/recipe/223049/american-french-onion-soup/','https://images.media-allrecipes.com/userphotos/560x315/4562804.jpg','This recipe takes French onion soup and gives it a few American twists that are going to make it a little bit easier.',460),('Kedgeree','https://www.allrecipes.com/recipe/52972/kedgeree/','https://images.media-allrecipes.com/userphotos/560x315/4547654.jpg','A delicious traditional English breakfast dish using smoked white fish, rice and eggs. It is based on the Indian dish Khichri and comes from the days of the Raj.',977),('Slow Cooker Beef Pot Roast','https://www.allrecipes.com/recipe/220125/slow-cooker-beef-pot-roast/','https://images.media-allrecipes.com/userphotos/560x315/3536308.jpg','The real secret here is making sure you sear the meat before the long, slow braising. Serve with mashed potatoes.',778),('Apple Pie by Grandma Ople','https://www.allrecipes.com/recipe/12682/apple-pie-by-grandma-ople/','https://images.media-allrecipes.com/userphotos/560x315/736203.jpg','This was my grandmother\'s apple pie recipe.  I have never seen another one quite like it.  It will always be my favorite and has won me several first place prizes in local competitions.  I hope it becomes one of your favorites as well!',512),('Spicy Basil Chicken','https://www.allrecipes.com/recipe/68813/spicy-basil-chicken/','https://images.media-allrecipes.com/userphotos/560x315/1338859.jpg','An authentic taste of Thailand. Served best over white rice.',244),('Bacon, Egg, and Cheese Strata','https://www.allrecipes.com/recipe/132372/bacon-egg-and-cheese-strata/','https://images.media-allrecipes.com/userphotos/560x315/1970322.jpg','Eggs combine with cheese, bacon, and bread to become a fluffy cheese strata that no one can resist! This is an easy recipe for guys who want to surprise that special someone with breakfast in bed!',631),('Addictive Asian Beef Slaw (Crack Slaw)','https://www.allrecipes.com/recipe/247300/addictive-asian-beef-slaw-crack-slaw/','https://images.media-allrecipes.com/userphotos/560x315/3589695.jpg','This meal has it all - beef, shredded veggies, soy sauce, hot sauce, and lots of fresh cilantro. This dish is truly addictive.',451),('Green Tomato Casserole','https://www.allrecipes.com/recipe/229148/green-tomato-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1371685.jpg','I love the tangy taste of fried green tomatoes, but they are, well...fried! And messy to make. I developed this recipe to help assuage my hunger for fried green tomatoes, and yes, it does the job quite well. Without all the grease and batter, the tangy taste of the tomato can really shine through!',215),('Sweet Potato Minestrone','https://www.allrecipes.com/recipe/21013/sweet-potato-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/561951.jpg','This soup is full of healthy antioxidants. A very hearty soup for a cold winter night! I serve it with hot garlic bread. If you are lucky enough to have leftovers, it\'s great the next day!',201),('Yellow Dhal - Sweet Potato Soup','https://www.allrecipes.com/recipe/60007/yellow-dhal-sweet-potato-soup/','https://images.media-allrecipes.com/userphotos/250x250/203988.jpg','This is a hearty soup of yellow lentils and sweet potatoes. Adjust the seasoning as you like with the jalapeno, and garnish with your choice of cilantro or green onions.',212),('Gnocchi I','https://www.allrecipes.com/recipe/18465/gnocchi-i/','https://images.media-allrecipes.com/userphotos/560x315/1070416.jpg','This simple potato, flour, and egg recipe is one my family has used for generations.',329),('Mama\'s Hearty Minestrone','https://www.allrecipes.com/recipe/228968/mamas-hearty-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/1099612.jpg','I concocted this dish using my family\'s recipe and another recipe I found online as guidelines, while also putting my own spin on it. What it turned into was the best minestrone my family has had yet! My husband likes his soups with hardly any broth; thus, \'hearty minestrone!\' Enjoy!',237),('Chicken Fiesta Salad','https://www.allrecipes.com/recipe/14316/chicken-fiesta-salad/','https://images.media-allrecipes.com/userphotos/250x250/732063.jpg','This is an attractive and zesty all in one dish. It\'s full of veggies and chicken, and loaded with flavor. A quick fix for a long day. If desired, top with shredded cheese and tortilla chips.',311),('Homemade Lox','https://www.allrecipes.com/recipe/254896/homemade-lox/','https://images.media-allrecipes.com/userphotos/560x315/5116242.jpg','You can make your own lox at home. It takes some time, but the investment is well worth it. I prefer my lox without the smoke flavor. Try it once and see if you agree.',120),('Cape Malay Pickled Fish','https://www.allrecipes.com/recipe/104444/cape-malay-pickled-fish/','https://images.media-allrecipes.com/userphotos/560x315/4502274.jpg','This recipe is a traditional Easter time classic in Cape Town, South Africa. It is served mainly with hot cross buns or freshly baked bread.',337),('Garlic Roasted Broccoli with Parmesan Cheese','https://www.allrecipes.com/recipe/235691/garlic-roasted-broccoli-with-parmesan-cheese/','https://images.media-allrecipes.com/userphotos/250x250/1072731.jpg','Broccoli is roasted with garlic and olive oil, then tossed with lemon juice and shaved parmesan cheese.',123),('Sausage-Stuffed Eggplant','https://www.allrecipes.com/recipe/133722/sausage-stuffed-eggplant/','https://images.media-allrecipes.com/userphotos/560x315/5397308.jpg','A local winery/restaurant serves a stuffed eggplant appetizer that is so delicious.  While trying to duplicate it at home, I found this to be one of our favorite eggplant dinners.  Be sure to select an eggplant that is smooth, blemish-free and kind of heavy for it\'s size. Serve with a green salad.',836),('Eggs Benedict','https://www.allrecipes.com/recipe/17205/eggs-benedict/','https://images.media-allrecipes.com/userphotos/560x315/828993.jpg','Hot buttered English muffins, Canadian-style bacon, and poached eggs are topped with a heavenly drizzle of hollandaise sauce. Wonderful for Easter, Mother\'s Day, or anytime you want to treat yourself to the best brunch in the world! Serve with roasted potatoes for mopping up the extra egg yolk and hollandaise. If you prefer, you can substitute ham for the Canadian bacon in this recipe.',879),('Easy Quiche','https://www.allrecipes.com/recipe/23389/easy-quiche/','https://images.media-allrecipes.com/userphotos/560x315/1125179.jpg','This is an easy mix-it-up-in-one-bowl-and-cook recipe. I make it for every brunch I attend. You may substitute chopped spinach for the broccoli if you wish.',371),('Pork Chops with Raspberry Sauce','https://www.allrecipes.com/recipe/53733/pork-chops-with-raspberry-sauce/','https://images.media-allrecipes.com/userphotos/560x315/1368932.jpg','Succulent herbed boneless pork loin chops paired with a tangy raspberry sauce ... heaven on a plate! This is a special family dish or perfect for company. I accompanied it with mashed potatoes and julienned steamed carrots. My husband can\'t wait to have it again.',113),('Authentic Huevos Rancheros','https://www.allrecipes.com/recipe/57947/authentic-huevos-rancheros/','https://images.media-allrecipes.com/userphotos/560x315/578209.jpg','This is an easy to make tostada-type breakfast that will definitely satisfy your hunger until lunch.',494),('Air Fryer Breakfast Frittata','https://www.allrecipes.com/recipe/267403/air-fryer-breakfast-frittata/','https://images.media-allrecipes.com/userphotos/560x315/5682775.jpg','Frittatas are easy to make using a cake pan that fits in the air fryer basket. Switch up the ingredients to suit your taste. If you are worried about the frittata sticking to the cake pan, line the bottom of the pan with parchment paper.',380),('Firecracker Grilled Alaska Salmon','https://www.allrecipes.com/recipe/16699/firecracker-grilled-alaska-salmon/','https://images.media-allrecipes.com/userphotos/560x315/997347.jpg','These are salmon fillets in a tasty, tangy sauce with a little heat! Serve with rice and a simple stir-fry of baby corn, shiitake mushrooms and snow peas.',307),('Brooke\'s Best Bombshell Brownies','https://www.allrecipes.com/recipe/143667/brookes-best-bombshell-brownies/','https://images.media-allrecipes.com/userphotos/560x315/358859.jpg','These brownies are the bomb! I\'ve found the perfect combination of ingredients to make the fudgiest brownies yet... Enjoy!',248),('Pad Thai','https://www.allrecipes.com/recipe/42968/pad-thai/','https://images.media-allrecipes.com/userphotos/560x315/5354620.jpg','This is a traditional Pad Thai recipe used by a friend\'s mother. You can use chicken, pork, beef, tofu, or a combination. You may want to start with less pepper, and work your way up.',524),('Thai Pineapple Chicken Curry','https://www.allrecipes.com/recipe/86005/thai-pineapple-chicken-curry/','https://images.media-allrecipes.com/userphotos/560x315/3071027.jpg','This is a quick, easy, and authentic Thai curry dish that\'s sweet and very spicy. I became addicted to the dish at a local restaurant and then worked to duplicate it at home. I think I\'ve got the taste and presentation pegged. I\'m guesstimating on the amounts since I don\'t measure much when I cook. Feel free to adjust to taste.',623),('Buttermilk Strawberry Shortcake','https://www.allrecipes.com/recipe/220168/buttermilk-strawberry-shortcake/','https://images.media-allrecipes.com/userphotos/560x315/837619.jpg','A light biscuit topped with delicious strawberries.',322),('Broccoli Souffle','https://www.allrecipes.com/recipe/244514/broccoli-souffle/','https://images.media-allrecipes.com/userphotos/560x315/3029218.jpg','Passed down through the generations, this broccoli souffle recipe has become a holiday staple in our family. A savory taste with a crispy cheese topping makes it a sure win.',225),('Quiche Lorraine I','https://www.allrecipes.com/recipe/17515/quiche-lorraine-i/','https://images.media-allrecipes.com/userphotos/560x315/633691.jpg','Bacon, Swiss cheese and onions mingle in perfect harmony amidst the eggs and cream in this timeless classic. Perfect for breakfast, brunch, lunch, dinner or just an indulgent snack!',761),('Chakchouka (Shakshouka)','https://www.allrecipes.com/recipe/213717/chakchouka-shakshouka/','https://images.media-allrecipes.com/userphotos/560x315/2273713.jpg','Chakchouka (also called shakshouka) is a Tunisian and Israeli dish of tomatoes, onions, pepper, spices, and eggs. It\'s usually eaten for breakfast or lunch, but I think it\'s tasty anytime. And it\'s easy to make. It is similar to the Turkish dish \'Menemen\' and to the Latin American breakfast dish \'Huevos Rancheros.\'',209),('The Best Thai Peanut Sauce','https://www.allrecipes.com/recipe/72487/the-best-thai-peanut-sauce/','https://images.media-allrecipes.com/userphotos/560x315/1046799.jpg','This easy no-cook peanut sauce has a terrific authentic Thai taste. It is spicy and peanutty, and is perfect as a dipping sauce for chicken, shrimp, and beef...or even to use tossed with warm cooked noodles for a quick pasta dish.',160),('Slow Cooker Chicken with Mushroom Wine Sauce','https://www.allrecipes.com/recipe/25363/slow-cooker-chicken-with-mushroom-wine-sauce/','https://images.media-allrecipes.com/userphotos/250x250/787230.jpg','This is a creamy, tender and very tasty chicken dish. Cooking it in the slow cooker makes it so easy!',208),('Shrimp and Grits With Kielbasa','https://www.allrecipes.com/recipe/220905/shrimp-and-grits-with-kielbasa/','https://images.media-allrecipes.com/userphotos/560x315/1087461.jpg','This is a recipe my Alabama mama taught me, who picked it up when she lived in New Orleans. I make it for my family in Oregon and they love it too! This is a traditional Christmas dish for our family, but could be eaten as an entree, a side, or even breakfast anytime of the year!',751),('Bacon Cheddar Chive Muffins','https://www.allrecipes.com/recipe/16458/bacon-cheddar-chive-muffins/','https://images.media-allrecipes.com/userphotos/560x315/15880.jpg','Mm!!! I took care in making these into a perfect combination of flavors. A great muffin for breakfast, brunch, lunch, with soup or for a tasty snack. In our home they\'re gobbled up fast! Everybody LOVES these - You will too! Enjoy!',327),('Zucchini and Potato Bake','https://www.allrecipes.com/recipe/89195/zucchini-and-potato-bake/','https://images.media-allrecipes.com/userphotos/560x315/269912.jpg','This is a very easy and delicious dish that I like to make as a side dish for my summer barbecues.',243),('Sour Cream Coffee Cake I','https://www.allrecipes.com/recipe/7445/sour-cream-coffee-cake-i/','https://images.media-allrecipes.com/userphotos/560x315/388831.jpg','My mother-in-law gave this recipe to me, and I get compliments all the time.',353),('Split Pea Soup','https://www.allrecipes.com/recipe/13384/split-pea-soup/','https://images.media-allrecipes.com/userphotos/560x315/2182112.jpg','This is a wonderful, hearty split pea soup.  Great for a fall or blustery winter day.',310),('Jamie\'s Cranberry Spinach Salad','https://www.allrecipes.com/recipe/14469/jamies-cranberry-spinach-salad/','https://images.media-allrecipes.com/userphotos/560x315/273205.jpg','Everyone I have made this for RAVES about it! It\'s different and so easy to make!',338),('Cream of Cauliflower and Stilton Soup','https://www.allrecipes.com/recipe/55331/cream-of-cauliflower-and-stilton-soup/','https://images.media-allrecipes.com/userphotos/250x250/348006.jpg','I first experienced this great soup (the Stilton makes all the difference) on my honeymoon at a little cafe and bookstore near the train station in Edinburgh, Scotland.  The day was damp, misty and cool and we were tired from a long train trip from London.  I encourage you to enjoy this on a similar day along with some good chunks from a baguette.',238),('Basic Chicken Salad','https://www.allrecipes.com/recipe/8499/basic-chicken-salad/','https://images.media-allrecipes.com/userphotos/560x315/1105316.jpg','This is a family favorite. I like to use baked thighs or breasts that have been sprinkled with basil or rosemary.',779),('Black Bean and Couscous Salad','https://www.allrecipes.com/recipe/24833/black-bean-and-couscous-salad/','https://images.media-allrecipes.com/userphotos/560x315/3359485.jpg','This is a great salad for a buffet, with interesting textures and southwest flavors combined in one delicious salad.  Leftovers store well refrigerated for several days.',253),('Tuna Salad Muffins','https://www.allrecipes.com/recipe/85735/tuna-salad-muffins/','https://images.media-allrecipes.com/userphotos/250x250/218330.jpg','Tuna Salad on the go! Low fat and very flavorful.',162),('Bacon Ranch Pasta Salad','https://www.allrecipes.com/recipe/69226/bacon-ranch-pasta-salad/','https://images.media-allrecipes.com/userphotos/560x315/580466.jpg','This is a very flavorful pasta salad. The crisp cooked bacon really adds a nice flavor. I get requests for this pasta salad for every get together and cook out.',336),('Broiled Tilapia Parmesan','https://www.allrecipes.com/recipe/50644/broiled-tilapia-parmesan/','https://images.media-allrecipes.com/userphotos/560x315/687910.jpg','Flavorful recipe for this farm raised fish that is easy and done in minutes! The fish is broiled with a creamy cheese coating for an impressive flavor and texture.',224),('Lena\'s Minestrone','https://www.allrecipes.com/recipe/13433/lenas-minestrone/','https://images.media-allrecipes.com/userphotos/250x250/125893.jpg','Minestrone means \'big soup\' in Italian, and this soup is sure to satisfy even the biggest of appetites. Served with a crisp loaf of bread, it\'s a meal in itself! Garnish with grated Romano cheese.',215),('Russian Green Bean and Potato Soup','https://www.allrecipes.com/recipe/111546/russian-green-bean-and-potato-soup/','https://images.media-allrecipes.com/userphotos/250x250/426910.jpg','This is a recipe that I  found in a vegetarian cookbook years ago.  I have modified it to my liking and have made it ever since. It\'s a hearty soup with a great flavor.  Add seasonal veggies for more variety.  Enjoy!',222),('Mexican Zucchini Cheese Soup','https://www.allrecipes.com/recipe/57544/mexican-zucchini-cheese-soup/','https://images.media-allrecipes.com/userphotos/560x315/240482.jpg','We can\'t wait to make this delicious, slightly spicy soup every summer when zucchini and squash are plentiful in our garden. We like to serve this soup with warm tortillas.',307),('Pumpkin Soup','https://www.allrecipes.com/recipe/9191/pumpkin-soup/','https://images.media-allrecipes.com/userphotos/560x315/2433016.jpg','This delicious, cream-like soup is served at our family\'s Thanksgiving dinner every year.',114),('Southern Fried Green Tomatoes','https://www.allrecipes.com/recipe/22174/southern-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/4481751.jpg','This is a recipe that I like.',289),('Green Chile Frittata','https://www.allrecipes.com/recipe/23519/green-chile-frittata/','https://images.media-allrecipes.com/userphotos/560x315/11585.jpg','This rich recipe is great for either a brunch or breakfast. You can make this a day ahead if you want to serve it for an early morning breakfast. Just reheat in the microwave. You may use any combination of cheese in this recipe, even non-fat.',225),('Creamy Summer Squash Soup','https://www.allrecipes.com/recipe/217987/creamy-summer-squash-soup/','https://images.media-allrecipes.com/userphotos/560x315/3781472.jpg','I adapted this recipe from another I\'d come across and created something a little more hearty and creamy.  All it needs is the right combination of spices. This is an extremely simple soup to create, and it goes well with any type of hearth or grainy bread.',163),('Homemade Deviled Ham Sandwiches','https://www.allrecipes.com/recipe/221036/homemade-deviled-ham-sandwiches/','https://images.media-allrecipes.com/userphotos/560x315/879703.jpg','You will never again buy a ham spread product after tasting this recipe. Use your mini chopper or food processor to whip up a large or small batch. Easily modified for personal tastes, but try it once as written - it is delicious - AND - it\'s low-fat too! Make delicious sandwiches on your choice of bread with a thin coat of mayo, sliced bread and butter pickles, and a generous layer of Deviled Ham. Men and kids love these.',128),('Broccoli and Rice Stir Fry','https://www.allrecipes.com/recipe/22916/broccoli-and-rice-stir-fry/','https://images.media-allrecipes.com/userphotos/250x250/356279.jpg','A quick and tasty side dish, or can be served as a meal. You can modify this recipe to include any veggies you choose.',187),('Thai Red Curry Paste','https://www.allrecipes.com/recipe/239501/thai-red-curry-paste/','https://images.media-allrecipes.com/userphotos/560x315/2935987.jpg','Great for Thai cooking. I got the recipe a long time ago from a friend, who suggested that making red curry paste is better than buying it in the store; he was right! You can mix the ingredients as you like. Curry is something that can be experimented with and should be! Just make sure that you do not remove the ingredients, as it will remove authenticity. For a more mild curry paste, remove and discard the chile pepper seeds.',103),('Jerre\'s Black Bean and Pork Tenderloin Slow Cooker Chili','https://www.allrecipes.com/recipe/193873/jerres-black-bean-and-pork-tenderloin-slow-cooker-chili/','https://images.media-allrecipes.com/userphotos/560x315/717464.jpg','My Aunt Jerre won THIRD PLACE with this recipe in the St. Louis Slow Cooker Cook Off in the past couple months!  We are proud, proud, proud!',245),('Herb Watermelon Feta Salad','https://www.allrecipes.com/recipe/222512/herb-watermelon-feta-salad/','https://images.media-allrecipes.com/userphotos/560x315/4527045.jpg','This is a delicious summer salad. The ingredients really go well together.',177),('Soft and Chewy Chocolate-Banana Oat Bars','https://www.allrecipes.com/recipe/267365/soft-and-chewy-chocolate-banana-oat-bars/','https://images.media-allrecipes.com/userphotos/560x315/5654490.jpg','Chocolate, banana, and coconut-filled bars! I love to eat these right out of the freezer for a tasty frozen snack. They make a quick breakfast or midday snack for kids and adults alike.',207),('Turkey Carcass Soup','https://www.allrecipes.com/recipe/218804/turkey-carcass-soup/','https://images.media-allrecipes.com/userphotos/560x315/4589306.jpg','A great way to not waste a single bite of turkey. This is a delicious soup and one of my favorites. If you want to freeze some, leave out the potatoes.',133),('Zucchini Soup II','https://www.allrecipes.com/recipe/13400/zucchini-soup-ii/','https://images.media-allrecipes.com/userphotos/560x315/1278099.jpg','A creamy vegetable soup with a wonderful flavor.  For variety you may add shrimp or chopped imitation crab.  As an added note, this recipe is how I met my husband online a year ago.',306),('Classic Cinnamon Rolls','https://www.allrecipes.com/recipe/215379/classic-cinnamon-rolls/','https://images.media-allrecipes.com/userphotos/250x250/981904.jpg','First Place Winner at the 2008 Iowa State Fair!',404),('Roasted Cauliflower, Garlic, and Leek Soup','https://www.allrecipes.com/recipe/239523/roasted-cauliflower-garlic-and-leek-soup/','https://images.media-allrecipes.com/userphotos/560x315/1530305.jpg','I absolutely love roasted cauliflower, so I came up with this soup one cold day. You don\'t even need to add cream to this soup to be completely satisfied with the thick creamy texture the cauliflower adds. Roasting the cauliflower and garlic brings the flavor of it to a whole other level. Double the recipe to assure leftovers, as it tastes almost better the next day for lunch! I serve this soup for lunch or dinner with a good cheesy bread. Enjoy!',277),('Chicken Parmesan','https://www.allrecipes.com/recipe/223042/chicken-parmesan/','https://images.media-allrecipes.com/userphotos/560x315/4572704.jpg','My version of chicken parmesan is a little different than what they do in the restaurants, with less sauce and a crispier crust.',471),('Clark\'s Quiche','https://www.allrecipes.com/recipe/50523/clarks-quiche/','https://images.media-allrecipes.com/userphotos/560x315/963661.jpg','This recipe is excellent served for breakfast with fruit or at lunch or dinnertime with a salad. This recipe makes two 9 inch pies. The reason for this is because if you only make one you will hate yourself the next day when there are no leftovers. The quiche microwaves well the next day. In fact most people say that the flavors have blended better on the second day... If in the strange case that you are filled up with one pie, this is a great gift to give a friend or relative, or if you are stingy...it freezes well with tin foil.',444),('Homemade Sweet Italian Sausage (Mild or Hot)','https://www.allrecipes.com/recipe/216319/homemade-sweet-italian-sausage-mild-or-hot/','https://images.media-allrecipes.com/userphotos/560x315/785124.jpg','This is a very versatile Italian sausage which can be used in many different ways. You can take it from mild to hot and it\'s very easy to use. There are also different options for type of meat to use, like ground chuck or ground turkey (do not use ground beef). If using ground turkey, you\'ll have to coat your skillet with a little olive or veggie oil before cooking as it has very little fat and will stick to skillet.',243),('Chef John\'s Banana Bread','https://www.allrecipes.com/recipe/219967/chef-johns-banana-bread/','https://images.media-allrecipes.com/userphotos/560x315/2221074.jpg','Banana bread is one of those things people rarely make on purpose, only when those last three bananas are almost black. This scrumptious banana-walnut loaf, spiked with dark chocolate chips, is so good you\'ll want to make it well before the bananas get to that condition.',334),('Apricot Glazed Carrots','https://www.allrecipes.com/recipe/88470/apricot-glazed-carrots/','https://images.media-allrecipes.com/userphotos/250x250/26216.jpg','Carrots are cooked tender then mixed with a tangy apricot sauce. Serve cold or slightly warm.',119),('Buttery Cooked Carrots','https://www.allrecipes.com/recipe/18256/buttery-cooked-carrots/','https://images.media-allrecipes.com/userphotos/560x315/5593276.jpg','Sweet cooked carrots that even my carrot hating family loves. There are never leftovers.',185),('Afghan Tomato Soup (Aush Goshti)','https://www.allrecipes.com/recipe/165713/afghan-tomato-soup-aush-goshti/','https://images.media-allrecipes.com/userphotos/560x315/251459.jpg','I had this in a restaurant and came up with a great recipe to mimic it. This soup is lemony and full of great dill flavors. It makes a popular first course and is a crowd pleaser for all ages.',383),('Italian Sausage Soup with Tortellini','https://www.allrecipes.com/recipe/13436/italian-sausage-soup-with-tortellini/','https://images.media-allrecipes.com/userphotos/560x315/4501939.jpg','This soup embodies all the wonders of Italian cooking: Italian sausage, garlic, tomatoes and red wines. Serve with hot bread and salad for a delicious meal. Garnish with Parmesan cheese.',324),('Croissant and Salmon Breakfast Casserole','https://www.allrecipes.com/recipe/216562/croissant-and-salmon-breakfast-casserole/','https://images.media-allrecipes.com/userphotos/250x250/833279.jpg','Delicious breakfast casserole that is great for Sunday brunch or Christmas morning!',492),('Sausage Casserole','https://www.allrecipes.com/recipe/24532/sausage-casserole/','https://images.media-allrecipes.com/userphotos/560x315/4501563.jpg','Mouth watering, bowl scraping good! This recipe also makes a great dinner entree!',355),('Khao Man Gai Thai Chicken and Rice (Healthy Version)','https://www.allrecipes.com/recipe/257375/khao-man-gai-thai-chicken-and-rice-healthy-version/','https://images.media-allrecipes.com/userphotos/560x315/3572007.jpg','Khao man gai or khao mun gai, literally meaning oily rice [with] chicken, is one of the most popular Thai dishes; it can be found everywhere in Thailand from streetfood stalls to restaurants. It is originally from Hainan, China. In Thailand, khao man gai is served with cucumbers, chicken blood tofu, coriander, and a bowl of soup. The heart of khao man gai is the sauce! This recipe is a healthy version of khao man gai; I used less oil and chicken breasts instead of the parts of chicken with fat and skin. Enjoy!',807),('Pumpkin Bread IV','https://www.allrecipes.com/recipe/6862/pumpkin-bread-iv/','https://images.media-allrecipes.com/userphotos/560x315/3850368.jpg','This is an all time, excellent, every time recipe. It is very simple, and so well loved by many. I make these for family, friends, school functions, work functions, for gifts etc. It has always been raved about - even by kids! I recommend bringing this to your Thanksgiving function; you will be thanked many times for this delicious taste treat. This is a large quantity, but you will end up making this size batch more than once. You can also make muffins and small loaves using this recipe; bake for 30 to 35 minutes.',247),('Jersey Fresh Tomato Soup','https://www.allrecipes.com/recipe/218791/jersey-fresh-tomato-soup/','https://images.media-allrecipes.com/userphotos/560x315/704856.jpg','New Jersey is a well-known producer of tomatoes.  Having our own garden leaves us with an abundance at the end of the season.  Not wanting the tomatoes to go to waste, Hubby and I came up with our favorite version of tomato soup.',234),('Peanut Butter Banana Smoothie','https://www.allrecipes.com/recipe/221261/peanut-butter-banana-smoothie/','https://images.media-allrecipes.com/userphotos/560x315/1011848.jpg','It is so refreshing and it\'s sweet and tasty.',335),('Navy Bean Soup I','https://www.allrecipes.com/recipe/12971/navy-bean-soup-i/','https://images.media-allrecipes.com/userphotos/560x315/4577480.jpg','A hearty soup that will warm you on a cold night.',236),('French Onion Soup Gratinee','https://www.allrecipes.com/recipe/91192/french-onion-soup-gratinee/','https://images.media-allrecipes.com/userphotos/560x315/5369970.jpg','About as good as it gets! This is the version of French Onion Soup that people seek when they go to restaurants. I have been making it for 30 years and it never fails to please. It makes an exquisite presentation, too!',618),('Authentic German Potato Salad','https://www.allrecipes.com/recipe/83097/authentic-german-potato-salad/','https://images.media-allrecipes.com/userphotos/560x315/586962.jpg','This is my mother\'s recipe.  Everyone, German or not, loves it. It is easy to double the recipe as well. I often bring it to potlucks, and we also have it at home on special occasions. There are usually no leftovers, but if there are, they don\'t last long!',183),('Quick Quiche','https://www.allrecipes.com/recipe/21551/quick-quiche/','https://images.media-allrecipes.com/userphotos/560x315/399957.jpg','When you don\'t have the time to make a pastry crust, try this quick lunch idea. You may add any other goodies you like, such as ham, chicken, crab, shrimp or broccoli.',291),('Buttery Garlic Green Beans','https://www.allrecipes.com/recipe/230103/buttery-garlic-green-beans/','https://images.media-allrecipes.com/userphotos/560x315/2432913.jpg','Only fresh green beans and garlic will do for this easy, healthy, and flavorful side dish.',116),('Beef Barley Vegetable Soup','https://www.allrecipes.com/recipe/13023/beef-barley-vegetable-soup/','https://images.media-allrecipes.com/userphotos/560x315/348836.jpg','Slow cooker, hearty, easy. Serve with a hearty bread, and enjoy.',321),('Thai Noodle Salad','https://www.allrecipes.com/recipe/27205/thai-noodle-salad/','https://images.media-allrecipes.com/userphotos/560x315/2066457.jpg','Here is a quick recipe for a salad with an Asian flair that is elegant and good enough for the fanciest party. It\'s not only a healthy alternative, but tastes fantastic.',141),('Broccoli Rice Casserole','https://www.allrecipes.com/recipe/18253/broccoli-rice-casserole/','https://images.media-allrecipes.com/userphotos/560x315/3627656.jpg','A creamy side dish that is baked in a delicious cheese sauce. This is the best broccoli rice casserole you will ever eat!',612),('New Orleans Barbeque Shrimp','https://www.allrecipes.com/recipe/71424/new-orleans-barbeque-shrimp/','https://images.media-allrecipes.com/userphotos/250x250/959220.jpg','A special entree, excellent with a loaf of French bread to dunk in the sauce, add a glass of wine and a pasta, and you have an incredible meal for any guest.',345),('Ninety Minute Cinnamon Rolls','https://www.allrecipes.com/recipe/17006/ninety-minute-cinnamon-rolls/','https://images.media-allrecipes.com/userphotos/560x315/4228724.jpg','Delicious cinnamon rolls made with a soft, quick rising dough.',347),('Grilled Hearts of Romaine','https://www.allrecipes.com/recipe/236863/grilled-hearts-of-romaine/','https://images.media-allrecipes.com/userphotos/560x315/2339950.jpg','This is truly and ridiculously easy. The trick is to get the grill grates very hot. And the result? A lightly caramelized surface and a slightly smoky flavor. The insides stay cool and crisp. It\'s quite a contrast of tastes and textures.',88),('Basic Crepes','https://www.allrecipes.com/recipe/16383/basic-crepes/','https://images.media-allrecipes.com/userphotos/560x315/5685183.jpg','Here is a simple but delicious crepe batter which can be made in minutes. It\'s made from ingredients that everyone has on hand.',216),('Karen\'s Fried Green Tomatoes','https://www.allrecipes.com/recipe/233896/karens-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/1038341.jpg','This recipe comes from my mom and they are, hands down, the best fried green tomatoes. She makes these every summer with fresh tomatoes from her garden. My sister begs her to make them for her as soon as she sees tomatoes growing big and green on the vines. While most recipes call for breadcrumbs and oil, this one calls for flour and has you fry the tomatoes in butter, which helps give these an incredible flavor.',629),('Honey Mustard Pork Chops','https://www.allrecipes.com/recipe/223296/honey-mustard-pork-chops/','https://images.media-allrecipes.com/userphotos/560x315/5433998.jpg','Quick, easy, and tasty way to prepare pork chops inside or outside. Just skip skillet if using grill.',287),('Best Brownies','https://www.allrecipes.com/recipe/10549/best-brownies/','https://images.media-allrecipes.com/userphotos/560x315/3850414.jpg','These brownies always turn out!',183),('Slow Cooker Chicken and Dumplings','https://www.allrecipes.com/recipe/8941/slow-cooker-chicken-and-dumplings/','https://images.media-allrecipes.com/userphotos/560x315/806223.jpg','This is an easy slow cooker recipe that cooks while you are at work! It is wonderful on a cold, snowy day. I have four children who are picky eaters, and they LOVE this! Enjoy!',385),('The Best Marinade Around','https://www.allrecipes.com/recipe/14591/the-best-marinade-around/','https://images.media-allrecipes.com/userphotos/560x315/800834.jpg','This recipe makes enough marinade for one steak, but can be multiplied for the amount you are grilling.',571),('Refried Beans Without the Refry','https://www.allrecipes.com/recipe/70312/refried-beans-without-the-refry/','https://images.media-allrecipes.com/userphotos/560x315/373926.jpg','Refried beans are simple to make when cooked in a slow cooker.  This recipe will yield flavorful, fat-free refried beans seasoned with garlic, jalapeno, and cumin.',139),('Green Tomato Pasta Toss','https://www.allrecipes.com/recipe/12070/green-tomato-pasta-toss/','https://images.media-allrecipes.com/userphotos/560x315/4067042.jpg','This recipe will have you singing the praises of green tomatoes. I made it up one year when the weather conspired against my bumper tomato crop and I ended up with tons of green tomatoes and no idea as to what to do with them.',418),('Cheddar Cheese Muffins','https://www.allrecipes.com/recipe/239856/cheddar-cheese-muffins/','https://images.media-allrecipes.com/userphotos/560x315/5080080.jpg','Nice bread-like cheese muffins. Not overly cheesy, but feel free to add more. One of my favorites!',448),('Simple Broccoli Soup with Cheddar Croutons ','https://www.allrecipes.com/recipe/239232/simple-broccoli-soup-with-cheddar-croutons/','https://images.media-allrecipes.com/userphotos/560x315/1447725.jpg','This is a classic and very simple technique for homemade vegetable soups. I\'m using broccoli, but almost any vegetable will work. I am a disciple of the Gordon Ramsey school of vegetable soups. It\'s basically the vegetable, some stock or water, cooked until tender, pureed, and seasoned simply. His \'crazy\' theory is that the star of the bowl should be the featured vegetable itself.',338),('World\'s Best Lasagna','https://www.allrecipes.com/recipe/23600/worlds-best-lasagna/','https://images.media-allrecipes.com/userphotos/560x315/3359675.jpg','It takes a little work, but it is worth it.',448),('Mexican Egg Bake','https://www.allrecipes.com/recipe/21358/mexican-egg-bake/','https://images.media-allrecipes.com/userphotos/560x315/885483.jpg','A zesty Mexican flavored casserole that is easy to prepare. Baked eggs, corn tortillas, and vegetables are smothered in a hearty enchilada sauce.',336),('Homemade Apple Cider','https://www.allrecipes.com/recipe/211772/homemade-apple-cider/','https://images.media-allrecipes.com/userphotos/560x315/1113438.jpg','Homemade apple cider.',83),('Apple Crisp II','https://www.allrecipes.com/recipe/12409/apple-crisp-ii/','https://images.media-allrecipes.com/userphotos/560x315/277929.jpg','A simple dessert that\'s great served with ice cream.',316),('Foolproof Rib Roast','https://www.allrecipes.com/recipe/97621/foolproof-rib-roast/','https://images.media-allrecipes.com/userphotos/560x315/792951.jpg','I was looking for an easy way to make our Christmas Rib Roast. It turned out PERFECT. Rib Roast can be expensive, so this is a total splurge or special occasion dish. Enjoy.',576),('Apple Turnovers','https://www.allrecipes.com/recipe/59124/apple-turnovers/','https://images.media-allrecipes.com/userphotos/560x315/690385.jpg','Delicious, yet so easy to make. Anyone can do these classic apple turnovers!',562),('Macaron (French Macaroon)','https://www.allrecipes.com/recipe/223234/macaron-french-macaroon/','https://images.media-allrecipes.com/userphotos/560x315/4329616.jpg','This is the quintessential macaron (NOT macaroon) recipe. I am a baker\'s apprentice, and after much trial and error, we (the baker and I) finally perfected the technique. We decided to share with you all. Pipe your choice of filling on a cookie and sandwich another cookie on top. These are like cloud cookie sandwiches and are delicious if done correctly.  If you want to do it the super-easy way, just fill with your favorite flavor of frosting. Enjoy!',189),('Eggplant Caponata (Sicilian Version)','https://www.allrecipes.com/recipe/247268/eggplant-caponata-sicilian-version/','https://images.media-allrecipes.com/userphotos/560x315/5695752.jpg','Delicious relish or appetizer that can be served hot or cold! Serve with toasted crusty bread.',56),('Thai Chicken with Basil Stir Fry','https://www.allrecipes.com/recipe/35892/thai-chicken-with-basil-stir-fry/','https://images.media-allrecipes.com/userphotos/560x315/2677.jpg','This is delicious and easy to make. Make it as spicy as you like or keep it mild.',506),('Best Fried Green Tomatoes','https://www.allrecipes.com/recipe/16760/best-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/888769.jpg','You can also fry up red tomatoes with this recipe but make sure they are not over ripe or they will be mushy.  Serve these tomatoes outside with a glass of iced tea one summer night and enjoy the sunset with someone you love.',510),('White Chocolate Raspberry Cheesecake','https://www.allrecipes.com/recipe/25642/white-chocolate-raspberry-cheesecake/','https://images.media-allrecipes.com/userphotos/560x315/584781.jpg','This makes an excellent cheesecake, similar to one you would get in a restaurant. Great for special occasions! Garnish with white chocolate curls if desired.',412),('Old Fashioned Potato Salad','https://www.allrecipes.com/recipe/16729/old-fashioned-potato-salad/','https://images.media-allrecipes.com/userphotos/560x315/829508.jpg','This is potato salad the old-fashioned way, with eggs, celery and relish. It\'s really good to serve with chili.',206),('Momma\'s Shrimp and Cheese Grits','https://www.allrecipes.com/recipe/220897/mommas-shrimp-and-cheese-grits/','https://images.media-allrecipes.com/userphotos/560x315/2009154.jpg','I have tried a number of shrimp and grits recipes, but have not found one I really like. So I decided to experiment a bit and created a simple but delicious recipe that will surely please the taste buds. In New Orleans we like our cayenne pepper, so use less if you don\'t like so much heat.',419),('Roasted Vegetables','https://www.allrecipes.com/recipe/9377/roasted-vegetables/','https://images.media-allrecipes.com/userphotos/560x315/1486.jpg','A casserole dish of seasonal vegetables that is so easy to prepare. It can be made a day ahead - just reheat before serving. Lemon juice can be substituted for balsamic vinegar, and you can use baking potatoes if you don\'t have any Yukon Golds on hand.',123),('Good Old Fashioned Pancakes','https://www.allrecipes.com/recipe/21014/good-old-fashioned-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/4948036.jpg','This is a great recipe that I found in my Grandma\'s recipe book. Judging from the weathered look of this recipe card, this was a family favorite.',158),('Annie\'s Fruit Salsa and Cinnamon Chips','https://www.allrecipes.com/recipe/26692/annies-fruit-salsa-and-cinnamon-chips/','https://images.media-allrecipes.com/userphotos/560x315/4536841.jpg','Easy to make, tasty fruit salsa and cinnamon tortilla chips. Great as an appetizer or a snack. Great for anytime!',312),('Laura\'s Quick Slow Cooker Turkey Chili','https://www.allrecipes.com/recipe/lauras-quick-slow-cooker-turkey-chili/','https://images.media-allrecipes.com/userphotos/560x315/1009122.jpg','This is an easy chili recipe that you can throw in the slow cooker and forget about all day. Great topped with Cheddar cheese, crushed corn chips, and a dollop of sour cream.',276),('French Toast I','https://www.allrecipes.com/recipe/7016/french-toast-i/','https://images.media-allrecipes.com/userphotos/560x315/234562.jpg','There are many, fancy variations on this basic recipe.  This recipe works with many types of bread - white, whole wheat, cinnamon-raisin, Italian or French. Serve hot with butter or margarine and maple syrup.',240),('Nan\'s Potato and Egg Frittata','https://www.allrecipes.com/recipe/23096/nans-potato-and-egg-frittata/','https://images.media-allrecipes.com/userphotos/560x315/3644381.jpg','A potato and 6 eggs are fried in olive oil to make this simple frittata. Cut it into rectangles or wedges and serve between 2 slices of Italian bread either by itself or with tomato slices. Delicious!',238),('Beef, Green Chili and Tomato Stew','https://www.allrecipes.com/recipe/25201/beef-green-chili-and-tomato-stew/','https://images.media-allrecipes.com/userphotos/560x315/392207.jpg','I love the green chilies in this stew and the rich, flavorful sauce of this stew is wonderful!  Serve over rice, or with a crusty bread, and salad for a wonderful winter meal.',465),('Taco Salad I','https://www.allrecipes.com/recipe/14253/taco-salad-i/','https://images.media-allrecipes.com/userphotos/560x315/38529.jpg','Put a twist on the conventional taco salad with this quick and easy recipe for a delicious salad meal. And it\'s fun for the children to help make.',846),('Spicy Garlic Lime Chicken','https://www.allrecipes.com/recipe/44868/spicy-garlic-lime-chicken/','https://images.media-allrecipes.com/userphotos/560x315/4873776.jpg','A delightful chicken dish with a little spicy kick. Serve with rice and your favorite vegetable.',220),('Creamy, Cheesy Zucchini Soup','https://www.allrecipes.com/recipe/234126/creamy-cheesy-zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/2384152.jpg','This zucchini soup is warm and creamy, perfect for fall or winter. Stock up and freeze when zucchini is in season. Perfect for low-carb diets!',471),('Grilled Garlic Parmesan Zucchini','https://www.allrecipes.com/recipe/200919/grilled-garlic-parmesan-zucchini/','https://images.media-allrecipes.com/userphotos/560x315/419851.jpg','This is a summer favorite at my house. So easy and tasty, and complements steak, ribs, chicken or fish. By the way, these can be done in the oven under the broiler as well.',146),('Quick Brussels and Bacon','https://www.allrecipes.com/recipe/150818/quick-brussels-and-bacon/','https://images.media-allrecipes.com/userphotos/560x315/491844.jpg','This very quick and flavorful side dish is easy for everyday dinner, but nice enough to serve for Thanksgiving!',189),('One Skillet Mexican Quinoa','https://www.allrecipes.com/recipe/241066/one-skillet-mexican-quinoa/','https://images.media-allrecipes.com/userphotos/560x315/4539591.jpg','With a large family, I love these one skillet dishes where, for at least 15 minutes, I can \'set it and forget it!\' And the kids love it! Serve it for Cinco de Mayo or any night of the week!',449),('Lamb Chops with Balsamic Reduction','https://www.allrecipes.com/recipe/74037/lamb-chops-with-balsamic-reduction/','https://images.media-allrecipes.com/userphotos/560x315/31252.jpg','This recipe for lamb chops is a favorite in my house.  It is an easy and quick recipe for two people (we eat two chops each). Rosemary and thyme give it great flavor.  If you double the recipe, remember that the sauce will take longer to reduce.',255),('Chef John\'s Steak Diane','https://www.allrecipes.com/recipe/247365/chef-johns-steak-diane/','https://images.media-allrecipes.com/userphotos/560x315/3699741.jpg','Steak Diane was a staple on menus in fine dining establishments back in the day. Prepared tableside where the server ignited the cognac, it was an impressive sight. You don\'t need to flame the cognac; just keeping it on the heat will eventually evaporate the alcohol. But be careful--it can still flare up if the heat\'s high enough when you\'re reducing the sauce.',1050),('Baked Asparagus with Balsamic Butter Sauce','https://www.allrecipes.com/recipe/59671/baked-asparagus-with-balsamic-butter-sauce/','https://images.media-allrecipes.com/userphotos/560x315/2464024.jpg','This is a simple and delicious side dish. Fresh asparagus is baked until tender, and dressed with a blend of butter, soy sauce, and balsamic vinegar.',77),('Oat Crusted Fish','https://www.allrecipes.com/recipe/88308/oat-crusted-fish/','https://images.media-allrecipes.com/userphotos/560x315/17208.jpg','Another way to enjoy your deep-fried fish. I think it is traditionally Scottish. Try it for a change. Serve warm with chips and lemon or salad.',764),('Old Fashioned Onion Rings','https://www.allrecipes.com/recipe/82659/old-fashioned-onion-rings/','https://images.media-allrecipes.com/userphotos/560x315/207422.jpg','This is an actual recipe from a former employee of a popular drive-in restaurant. Crispy coated onion rings like the pro\'s make!',641),('Irresistible Double Chocolate Muffins','https://www.allrecipes.com/recipe/191936/irresistible-double-chocolate-muffins/','https://images.media-allrecipes.com/userphotos/560x315/1013651.jpg','The absolute best muffins! Don\'t be fooled by all the healthful ingredients - these sinful muffins are good for curing chocolate cravings!',237),('Smoked Salmon and Egg Salad','https://www.allrecipes.com/recipe/16855/smoked-salmon-and-egg-salad/','https://images.media-allrecipes.com/userphotos/250x250/22201.jpg','A great change from the standard egg salad, this is fabulous served on toasted whole grain bread. It can also be spooned into hollowed out tomatoes for a fancy presentation at a luncheon.',333),('Slow Cooker Vegetarian Minestrone','https://www.allrecipes.com/recipe/230298/slow-cooker-vegetarian-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/2591435.jpg','Slow cooking this family favorite soup allows all the flavors and spices to intensify and delivers a delicious, hearty meal every one is sure to enjoy. Serve with a green salad and garlic bread for dipping.',138),('Zucchini Soup III','https://www.allrecipes.com/recipe/15430/zucchini-soup-iii/','https://images.media-allrecipes.com/userphotos/560x315/4547353.jpg','This is a soup with a zip to it. Zucchini are plentiful and this is a good way to use them. Tastes so good in colder weather. This soup may be frozen.',158),('Lemon-Parsley Green Beans','https://www.allrecipes.com/recipe/146100/lemon-parsley-green-beans/','https://images.media-allrecipes.com/userphotos/560x315/3581150.jpg','This is a delicious lemony, fried green bean recipe. I found it while shopping one Saturday at the local produce market.',119),('Sweet Restaurant Slaw','https://www.allrecipes.com/recipe/142027/sweet-restaurant-slaw/','https://images.media-allrecipes.com/userphotos/560x315/2276935.jpg','This tastes just like the cole slaw served at popular fried chicken or fish restaurants. It\'s excellent with burgers or on top of BBQ\'d pork sandwiches, too!!!',200),('Andrea\'s Pasta Fagioli','https://www.allrecipes.com/recipe/25690/andreas-pasta-fagioli/','https://images.media-allrecipes.com/userphotos/250x250/223672.jpg','This is a recipe I have adapted a bit from my grandmother\'s.  It\'s easy and perfect for a Sunday afternoon with fresh Italian bread.',403),('Oven Roasted Potatoes','https://www.allrecipes.com/recipe/20963/oven-roasted-potatoes/','https://images.media-allrecipes.com/userphotos/560x315/19781.jpg','A great roasted potato side dish made with olive oil and herbs.',289),('Insalata Caprese II','https://www.allrecipes.com/recipe/insalata-caprese-ii/','https://images.media-allrecipes.com/userphotos/560x315/874978.jpg','Because this salad is so simple, fresh, top-quality tomatoes and mozzarella are important.',311),('Quick Pumpkin Oatmeal','https://www.allrecipes.com/recipe/230970/quick-pumpkin-oatmeal/','https://images.media-allrecipes.com/userphotos/560x315/1037281.jpg','A healthy and delicious way to start your day!',337),('Chocolate Protein Muffins','https://www.allrecipes.com/recipe/267361/chocolate-protein-muffins/','https://images.media-allrecipes.com/userphotos/560x315/5704373.jpg','Chocolate muffin loaded with protein, low in fat, yet high in flavor.',170),('Chef John\'s Ham and Potato Soup','https://www.allrecipes.com/recipe/220127/chef-johns-ham-and-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/813027.jpg','You can never have too many soup recipes. This hearty soup is definitely filling enough to serve as a main course.',452),('Crabmeat Quiche','https://www.allrecipes.com/recipe/42879/crabmeat-quiche/','https://images.media-allrecipes.com/userphotos/560x315/4485302.jpg','Serve for a delicious and elegant luncheon!',403),('Cauliflower Soup','https://www.allrecipes.com/recipe/15598/cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/4441371.jpg','This is a modification of a soup starter my mom bought when I was a teenager. It is mild, easy to make and almost everyone loves it. Serve with grated Parmesan cheese sprinkled on top.',95),('Spinach and Potato Frittata','https://www.allrecipes.com/recipe/47044/spinach-and-potato-frittata/','https://images.media-allrecipes.com/userphotos/560x315/51272.jpg','This dish is not only delicious, but easy to make. I make this for Saturday family brunches and get togethers. It\'s a big hit.',281),('Easy Zucchini Soup','https://www.allrecipes.com/recipe/234117/easy-zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/1044933.jpg','This creamy (but cream-free!) soup is a great addition to any meal. It\'s quick and easy, you will have your guests thinking that you have been cooking all day!',199),('Picante Chicken Chili','https://www.allrecipes.com/recipe/260998/picante-chicken-chili/','https://images.media-allrecipes.com/userphotos/560x315/4574116.jpg','A delicious low-fat chili with a kick! We make it every year for our Halloween block party. You can adjust any of the flavors to your liking and it always turns out fantastic. Top with cheese, sour cream, and cilantro. Great when made ahead to let the flavors meld. Freezes well too!',336),('Smoked Salmon Pizette','https://www.allrecipes.com/recipe/24216/smoked-salmon-pizette/','https://images.media-allrecipes.com/userphotos/560x315/217917.jpg','Bagels or tortillas can be substituted for pita bread in this is a quick and easy recipe.',647),('The Best Bean and Ham Soup','https://www.allrecipes.com/recipe/105518/the-best-bean-and-ham-soup/','https://images.media-allrecipes.com/userphotos/250x250/115379.jpg','I make this hearty soup using the ham bone from our Easter spiral ham.  I serve it with corn muffins and fresh fruit.  It makes a huge pot of soup, so invite some friends or just freeze several portions for later use.  Remember to soak the beans the night before you make the soup.',260),('Drop Dead Delicious Tuna Salad','https://www.allrecipes.com/recipe/16215/drop-dead-delicious-tuna-salad/','https://images.media-allrecipes.com/userphotos/560x315/4482410.jpg','This is the BEST tuna salad ever! The last recipe you\'ll try. This has been in my family for generations, now it can be in yours!',790),('Authentic Chicken Tikka Masala','https://www.allrecipes.com/recipe/228446/authentic-chicken-tikka-masala/','https://images.media-allrecipes.com/userphotos/560x315/1064912.jpg','This authentic chicken tikka masala dish follows an old family recipe.',403),('Bacon and Egg Breakfast Salad with Avocado Dressing','https://www.allrecipes.com/recipe/267869/bacon-and-egg-breakfast-salad-with-avocado-dressing/','https://images.media-allrecipes.com/userphotos/560x315/5689066.jpg','Add a little green to your morning bacon and eggs by turning them into a salad! Refrigerate any unused dressing and use within a few days.',414),('Classic Minestrone','https://www.allrecipes.com/recipe/13163/classic-minestrone/','https://images.media-allrecipes.com/userphotos/250x250/448549.jpg','This famous Italian soup has been much imitated around the world with very different results.  The homemade version is a delicious revelation and is also extremely healthy, as it has pasta, beans and fresh vegetables. Try to make the minestrone a day early and refrigerate as this improves the flavors. Serve with grated Parmesan cheese and chopped fresh parsley.',320),('The Best Vegetarian Chili in the World','https://www.allrecipes.com/recipe/72508/the-best-vegetarian-chili-in-the-world/','https://images.media-allrecipes.com/userphotos/560x315/4565674.jpg','Break out your soup pot and fix up a batch of this delicious, spicy vegetarian chili today! It\'s ready in no time, and packed with vegetables, beans - and flavor!',391),('Tim Perry\'s Soup (Creamy Curry Cauliflower and Broccoli Soup)','https://www.allrecipes.com/recipe/142382/tim-perrys-soup-creamy-curry-cauliflower-and-broccoli-soup/','https://images.media-allrecipes.com/userphotos/560x315/372865.jpg','My boss brought this soup to the office one fine day and I was hooked on it from the first taste.  It is a snap to make and the flavors are mild, yet very distinct.  My kids loved it the first time I made it at home and it instantly became known as \'Tim Perry\'s Soup.\' You might like a stronger curry flavour or a creamier soup, so adjust the seasonings to your taste.  It\'s ready within the hour, but the longer it simmers the better the flavor. Serve with crusty bread and butter.',348),('Zucchini Tomato Soup I','https://www.allrecipes.com/recipe/13402/zucchini-tomato-soup-i/','https://images.media-allrecipes.com/userphotos/560x315/3107456.jpg','I got this recipe from a neighbor and my family really liked it. I have shared the recipe with many!',483),('Quick and Easy Eggs Benedict','https://www.allrecipes.com/recipe/70628/quick-and-easy-eggs-benedict/','https://images.media-allrecipes.com/userphotos/560x315/2481664.jpg','This is a no-fuss, easy recipe. The sauce is simply put together in a blender - no double boiling necessary. Assemble eggs with sauce over hot buttered English muffins with Canadian bacon, or if you prefer, Serrano ham. Yum!',690),('Garlic Red Potatoes','https://www.allrecipes.com/recipe/25272/garlic-red-potatoes/','https://images.media-allrecipes.com/userphotos/560x315/44536.jpg','Simple, savory, and very flavorful variation on new red potatoes. Excellent side dish!',279),('Scrambled Egg Muffins','https://www.allrecipes.com/recipe/222586/scrambled-egg-muffins/','https://images.media-allrecipes.com/userphotos/560x315/2414284.jpg','These scrambled egg muffins with plenty of sausage and Cheddar cheese make a filling and fun treat at your next brunch. They\'re pretty, hearty, and fun to serve.',143),('Simple Garlic Shrimp','https://www.allrecipes.com/recipe/220597/simple-garlic-shrimp/','https://images.media-allrecipes.com/userphotos/560x315/1330843.jpg','If you like shrimp and LOVE garlic, I hope you give this fast and delicious recipe a try soon. Enjoy!',196),('Spinach Quiche','https://www.allrecipes.com/recipe/16664/spinach-quiche/','https://images.media-allrecipes.com/userphotos/560x315/2144550.jpg','Let me start by saying that I devised this recipe myself, and I just sort of add \'this and that.\' This recipe is VERY forgiving, so you can add or remove ingredients according to your taste!',613),('Broccoli With Lemon Almond Butter','https://www.allrecipes.com/recipe/13920/broccoli-with-lemon-almond-butter/','https://images.media-allrecipes.com/userphotos/560x315/186939.jpg','This is a quickly and easily prepared broccoli dish. This recipe can also be made with frozen broccoli.',170),('Vegan Red Lentil Soup','https://www.allrecipes.com/recipe/70330/vegan-red-lentil-soup/','https://images.media-allrecipes.com/userphotos/250x250/109892.jpg','I made up this fusion recipe one night when my friend came over. It is a creamy, delicious soup.',303),('Spicy Grilled Broccoli','https://www.allrecipes.com/recipe/266399/spicy-grilled-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/5537405.jpg','Loaded with flavor and just the right amount of char from the grill. The best way to try grilled broccoli!',286),('Curried Cauliflower Soup','https://www.allrecipes.com/recipe/161601/curried-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/1081842.jpg','A simple, delicious soup for cold winter days.',130),('Simple Cauliflower Soup','https://www.allrecipes.com/recipe/18060/simple-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/250x250/154109.jpg','A nice and simple healthy soup. First the cauliflower is sauteed in butter with potatoes and onions, and then simmered in vegetable stock.',137),('Roasted Broccoli','https://www.allrecipes.com/recipe/166467/roasted-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/766052.jpg','Tender, flavorful, delicious, and a nice twist to steaming vegetables. This has become the new favorite way to prepare broccoli in our house. Try substituting asparagus or stir-fry vegetables too!',69),('Old-World Cabbage Soup','https://www.allrecipes.com/recipe/13100/old-world-cabbage-soup/','https://images.media-allrecipes.com/userphotos/560x315/10940.jpg','A hearty soup, great for a cold, blustery March day--or any day! My husband Tom developed this recipe and got it just right on the second try. Best if cooked one day ahead, refrigerated overnight and heated just before serving.',39),('Awesome Broccoli Marinara','https://www.allrecipes.com/recipe/71881/awesome-broccoli-marinara/','https://images.media-allrecipes.com/userphotos/560x315/346114.jpg','This is a great quick version of an Italian traditional side dish in our family all the way from Italy.  You can use fresh tomatoes and basil. However, as a mother of four, I opt for the quick method as I\'m sure other parents of small ones can appreciate. The kids really love this dish too. Buon Appetito!',121),('Fried Cabbage with Bacon, Onion, and Garlic','https://www.allrecipes.com/recipe/196732/fried-cabbage-with-bacon-onion-and-garlic/','https://images.media-allrecipes.com/userphotos/560x315/230003.jpg','This is a family favorite that is put into every cookbook for my kids when they move out and get married. It is a beautiful dish with many colors and full of flavor. Warning, it is addictive.',194),('Banana Banana Bread','https://www.allrecipes.com/recipe/20144/banana-banana-bread/','https://images.media-allrecipes.com/userphotos/560x315/4565477.jpg','Why compromise the banana flavor? This banana bread is moist and delicious with loads of banana flavor! Friends and family love my recipe and say it\'s by far the best! It\'s wonderful toasted!! Enjoy!',229),('Roasted Apples and Brussels Sprouts','https://www.allrecipes.com/recipe/216806/roasted-apples-and-brussels-sprouts/','https://images.media-allrecipes.com/userphotos/560x315/783770.jpg','Apple, onion, and Brussels sprouts are roasted together with a hint of lemon. My wife and I can go through an entire tray of these by ourselves. Yummo!',88),('Eggs n\' Fries','https://www.allrecipes.com/recipe/242100/eggs-n-fries/','https://images.media-allrecipes.com/userphotos/560x315/2217331.jpg','I just don\'t like eating plain eggs, so when I got this recipe from my grandmother it immediately became my favorite breakfast food.',212),('Best Darn Minestrone Soup Around','https://www.allrecipes.com/recipe/50901/best-darn-minestrone-soup-around/','https://images.media-allrecipes.com/userphotos/560x315/21173.jpg','This is a recipe for a Minestrone Soup that is very similar to Lelli\'s Minestrone soup here in Detroit.  Make sure you use a large stock pot, because this recipe is big.  SIMPLY AMAZING!',587),('Hash Brown and Pork Chop Casserole','https://www.allrecipes.com/recipe/14735/hash-brown-and-pork-chop-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1757363.jpg','If homey casseroles are your thing, this dish is for you! Rich and creamy its sure to satisfy!',523),('Vegetable Beef Minestrone','https://www.allrecipes.com/recipe/21051/vegetable-beef-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/4799860.jpg','Plenty of vegetables, chick peas or beans of your choice plus pasta.',273),('Daddy\'s Fried Corn and Onions','https://www.allrecipes.com/recipe/18219/daddys-fried-corn-and-onions/','https://images.media-allrecipes.com/userphotos/560x315/877040.jpg','Combining my two favorites, fried onions and fresh corn, my husband came up with this very simple, delicious side dish.',162),('Zucchini Fenchel Suppe (Zucchini and Fennel Soup)','https://www.allrecipes.com/recipe/255024/zucchini-fenchel-suppe-zucchini-and-fennel-soup/','https://images.media-allrecipes.com/userphotos/560x315/3884493.jpg','A very refined soup and so easy to make! Zucchini and fennel combine with chicken stock and simple pantry spices for a soup that is great to make when in season.',103),('Easy Mac and Cheese Muffins','https://www.allrecipes.com/recipe/111361/easy-mac-and-cheese-muffins/','https://images.media-allrecipes.com/userphotos/560x315/3557771.jpg','This takes a fun approach to the traditional mac and cheese recipe. Kids can eat it like a muffin and with their hands, making it a new mac and cheese experience!',208),('Strawberry Pie II','https://www.allrecipes.com/recipe/15836/strawberry-pie-ii/','https://images.media-allrecipes.com/userphotos/560x315/401339.jpg','This is my favorite pie. It is very easy to make. I got the recipe many years ago in North Jersey. It is from the Sussex County Strawberry Farms.',265),('Chocolate Cream Puff Swans','https://www.allrecipes.com/recipe/237598/chocolate-cream-puff-swans/','https://images.media-allrecipes.com/userphotos/560x315/4472585.jpg','These chocolate ganache-filled cream puff swans would be a great way to say thanks to your mother for that whole giving-you-life thing. I think once she tastes them, she\'ll agree that it was all worth it after all. Make more swan \'heads\' so that you have extra in case one breaks.',335),('Apple Cider Glazed Doughnuts','https://www.allrecipes.com/recipe/218695/apple-cider-glazed-doughnuts/','https://images.media-allrecipes.com/userphotos/250x250/986258.jpg','What could be better than homemade doughnuts? Fresh warm homemade doughnuts with cinnamon and an apple cider glaze!',293),('Minestrone Soup I','https://www.allrecipes.com/recipe/13187/minestrone-soup-i/','https://images.media-allrecipes.com/userphotos/560x315/283528.jpg','All the food groups are represented.  Serve this hearty soup with lightly toasted bread to get every last drop.  Recipe can be doubled.',292),('Make-Ahead Breakfast Bars','https://www.allrecipes.com/recipe/265839/make-ahead-breakfast-bars/','https://images.media-allrecipes.com/userphotos/560x315/5506506.jpg','I like to make a batch of these and then cut them and wrap single servings in foil to have handy in the freezer for the week. Much cheaper than the freezer breakfasts from the store and you can basically add/substitute whatever ingredients you want or have handy.',233),('Ashley\'s Apple Cider Doughnuts','https://www.allrecipes.com/recipe/239019/ashleys-apple-cider-doughnuts/','https://images.media-allrecipes.com/userphotos/560x315/1949773.jpg','A wonderful recipe for autumn.',333),('Barbie\'s Tuna Salad','https://www.allrecipes.com/recipe/98579/barbies-tuna-salad/','https://images.media-allrecipes.com/userphotos/560x315/4539967.jpg','This is a really great tuna salad recipe I got from a friend who used it in her catering service business many years ago. The secret ingredients are the curry and Parmesan cheese! Odd combinations but this makes a terrific tuna sandwich! She used it for an appetizer with gourmet crackers and people always wanted her recipe. I have never tasted another tuna salad quite like this one, and it has been my favorite recipe for tuna salad for many, many years.',228),('Cheesy Ham and Hash Brown Casserole','https://www.allrecipes.com/recipe/20096/cheesy-ham-and-hash-brown-casserole/','https://images.media-allrecipes.com/userphotos/560x315/566024.jpg','I mostly use this as a breakfast casserole, but it\'s great anytime. May be served with or without diced ham. Quick and easy to make, not to mention delicious!',415),('Fried Broccoli','https://www.allrecipes.com/recipe/187946/fried-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/2245571.jpg','This is a recipe I came up with when I was on the South Beach Diet. It is a very healthy recipe and my husband asks for it almost all the time.',61),('Broccoli Rabe with Roasted Peppers','https://www.allrecipes.com/recipe/217975/broccoli-rabe-with-roasted-peppers/','https://images.media-allrecipes.com/userphotos/250x250/942578.jpg','These are great with Italian porketta.',93),('Mawmaw\'s Simple Fried Green Tomatoes','https://www.allrecipes.com/recipe/222921/mawmaws-simple-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/1355354.jpg','My grandmother\'s fried green tomatoes were famous in our community. The recipe is so simple, but the results are delicious!',280),('To Die For Blueberry Muffins','https://www.allrecipes.com/recipe/6865/to-die-for-blueberry-muffins/','https://images.media-allrecipes.com/userphotos/560x315/662790.jpg','These muffins are extra large and yummy with the sugary-cinnamon crumb topping. I usually double the recipe and fill the muffin cups just to the top edge for a wonderful extra-generously-sized deli style muffin.  Add extra blueberries too, if you want!',383),('Broccoli with Poppy Seed Butter and Parmesan Cheese','https://www.allrecipes.com/recipe/166835/broccoli-with-poppy-seed-butter-and-parmesan-cheese/','https://images.media-allrecipes.com/userphotos/250x250/254199.jpg','Steamed broccoli is topped with a lightly seasoned butter and fresh Parmesan cheese.',157),('Gluten Free Fried Green Tomatoes','https://www.allrecipes.com/recipe/265354/gluten-free-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/5439682.jpg','This classic summer dish with a Gluten Free twist is perfect for warm nights and those not-quite-ripe tomatoes. Get ready to satisfy and delight your whole family.',260),('Easy Pumpkin Pancakes','https://www.allrecipes.com/recipe/239810/easy-pumpkin-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/5843821.jpg','Threw this together for my family for Thanksgiving breakfast and it was a hit. The boys asked if it was pumpkin pie! If desired, you can add chocolate chips after pancakes are poured onto the skillet, pat them with a bit of batter so they don\'t stick when turned.',165),('Bird\'s Nest Breakfast Cups','https://www.allrecipes.com/recipe/231488/birds-nest-breakfast-cups/','https://images.media-allrecipes.com/userphotos/560x315/1043708.jpg','I got the basics of this recipe from a friend of mine and thought it was a great idea since these little nests can be made ahead, which I love. They are delicious, easy to make, and can be customized to your own tastes. I not only use the recipe as a delicious grab-and-go breakfast, but serve it to guests nestled into some lovely cheese grits, alongside fresh fruits and French toast made on a panini press. Oh, and don\'t forget the mimosas!',210),('Easy Lemon and Garlic Broccoli','https://www.allrecipes.com/recipe/228221/easy-lemon-and-garlic-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/999101.jpg','This is an easy recipe for a delicious broccoli side that takes just a few minutes to make.',120),('Pumpkin Waffles with Apple Cider Syrup','https://www.allrecipes.com/recipe/65691/pumpkin-waffles-with-apple-cider-syrup','https://images.media-allrecipes.com/userphotos/560x315/493193.jpg','A fall, winter and special occasion family favorite, these are fairly easy to make and delicious! They\'re sure to please even picky eaters.',530),('French Toast Casserole','https://www.allrecipes.com/recipe/22389/french-toast-casserole/','https://images.media-allrecipes.com/userphotos/560x315/2138347.jpg','Tastes good for breakfast,  just like French toast. It\'s easy to make too! Serve warm with maple syrup on top.',207),('Apple Orchard Punch','https://www.allrecipes.com/recipe/20580/apple-orchard-punch/','https://images.media-allrecipes.com/userphotos/560x315/23493.jpg','This quick and easy punch would be delightful at a country wedding or any celebration. Champagne can be used instead of ginger ale for an adult punch.',168),('Easy Spicy Thai Slow Cooker Chicken','https://www.allrecipes.com/recipe/213269/easy-spicy-thai-slow-cooker-chicken/','https://images.media-allrecipes.com/userphotos/250x250/727506.jpg','This is an inexpensive, time-saving recipe for anyone who loves spicy Thai but can\'t always afford to get carry-out.',564),('Shrimp and Veggie Stew','https://www.allrecipes.com/recipe/72859/shrimp-and-veggie-stew/','https://images.media-allrecipes.com/userphotos/250x250/250459.jpg','If you like easy to make, spicy one dish meals, this recipe is for you!',191),('Watermelon Basil Salad','https://www.allrecipes.com/recipe/254422/watermelon-basil-salad/','https://images.media-allrecipes.com/userphotos/560x315/3730421.jpg','A quick salad of watermelon and basil. The chili powder plays well with the sweetness of the melon.',10),('The Best Rolled Sugar Cookies','https://www.allrecipes.com/recipe/10402/the-best-rolled-sugar-cookies/','https://images.media-allrecipes.com/userphotos/560x315/1863306.jpg','Whenever you make these cookies for someone, be sure to bring along several copies of the recipe!  You will be asked for it, I promise! NOTE: I make icing with confectioners\' sugar and milk. I make it fairly thin, as I \'paint\' the icing on the cookies with a pastry brush. Thin enough to spread easily but not so thin that it just makes your cookies wet and runs off.',109),('Cindy\'s Coleslaw','https://www.allrecipes.com/recipe/223409/cindys-coleslaw/','https://images.media-allrecipes.com/userphotos/560x315/875071.jpg','No fuss, no muss with this easiest coleslaw ever.',214),('Chef John\'s Quiche Lorraine','https://www.allrecipes.com/recipe/223196/chef-johns-quiche-lorraine/','https://images.media-allrecipes.com/userphotos/560x315/875235.jpg','In my opinion, a proper quiche should be rich, custardy, and luxurious--not some kind of dense, baked omelet. This has only enough eggs and yolks to hold things together, but that means you need to let it cool to just warm before serving, to fully enjoy the experience.',491),('Mulligatawny Soup I','https://www.allrecipes.com/recipe/13087/mulligatawny-soup-i/','https://images.media-allrecipes.com/userphotos/560x315/3573231.jpg','The name Mulligatawny means \'pepper water\', and curry is the particular ingredient that gives this incredible soup such a delicious flavor...so I\'m told. This old recipe was given to me long ago.',223),('Garlic Mashed Cauliflower','https://www.allrecipes.com/recipe/230816/garlic-mashed-cauliflower/','https://images.media-allrecipes.com/userphotos/560x315/1014180.jpg','This recipe is so easy and healthy. I love mashed potatoes, and when I started the South Beach Diet and couldn\'t have them, I had to find an alternative. This is an awesome alternative, and people who hate vegetables love it. I do recommend using a large food processor for this recipe.',98),('Cauliflower Potato Soup','https://www.allrecipes.com/recipe/234991/cauliflower-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/1092709.jpg','A yummy cauliflower and potato soup that tastes just like potato soup. Serve topped with shredded cheese.',417),('Easy Pineapple Chicken','https://www.allrecipes.com/recipe/262797/easy-pineapple-chicken/','https://images.media-allrecipes.com/userphotos/560x315/5151529.jpg','An easy weeknight dinner, this quick chicken stir-fry with pineapple is as delicious as it is colorful! Serve with rice for a complete meal, or fried rice for a treat. Add red chile flakes to the mix if you want something sweet and spicy!',307),('Perfect Ten Baked Cod','https://www.allrecipes.com/recipe/228319/perfect-ten-baked-cod/','https://images.media-allrecipes.com/userphotos/560x315/4523973.jpg','Simple, fast, and delicious describes this baked cod recipe. Bake for two sets of 10 minutes each and you have the perfect ten dinner! This recipe was a favorite request from a local restaurant. They closed after years in business and we are happy to share a version of their most requested recipe. I serve this with rice pilaf and fresh spinach that has been lightly seared in olive oil and garlic. Yummy!',280),('Easy Buttermilk Baking Sheet Pancakes','https://www.allrecipes.com/recipe/258359/easy-buttermilk-baking-sheet-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/5342628.jpg','So you\'d rather hang with your brunch guests than stand over a hot oven flipping flapjacks? Gather everyone around for a giant baking sheet pancake, instead! When you set this hot cake in the center of the table, everyone can add their own toppings and slice at will. A great choice for busy moms, too: just give the kids cookie cutters to make their own fun and you\'ll both have a great breakfast! Serve with syrups, jams, and fresh fruit.',277),('Vietnamese Rice Noodle Salad','https://www.allrecipes.com/recipe/14087/vietnamese-rice-noodle-salad/','https://images.media-allrecipes.com/userphotos/560x315/17635.jpg','This is a good salad for a hot day.',432),('Pumpkin French Toast Bake','https://www.allrecipes.com/recipe/217955/pumpkin-french-toast-bake/','https://images.media-allrecipes.com/userphotos/560x315/718700.jpg','A delicious breakfast indulgence, perfect for those crisp autumn Saturday mornings.',305),('Scrambled Eggs Done Right','https://www.allrecipes.com/recipe/86587/scrambled-eggs-done-right/','https://images.media-allrecipes.com/userphotos/560x315/4512134.jpg','The right way to scramble eggs. There is more to just mixing eggs and cooking! This will make a believer out of you.',210),('Panang Curry with Chicken','https://www.allrecipes.com/recipe/213947/panang-curry-with-chicken/','https://images.media-allrecipes.com/userphotos/560x315/815395.jpg','Panang curry with chicken represents the diversity of Thailand\'s southern region. Panang refers to the island of Penang in Northern Malaysia bordering southern Thailand. Use 4 tablespoons curry paste from a fresh curry paste recipe or 5 tablespoons pre-made curry paste if time does not permit making your own paste',596),('Chicken Satay','https://www.allrecipes.com/recipe/17511/chicken-satay/','https://images.media-allrecipes.com/userphotos/560x315/817812.jpg','Why go out for Thai food when you can make it at home? These delicious Thai-style chicken satay are made of chicken marinated in a peanutty sauce, and then grilled.',162),('New Wife Tuna Salad','https://www.allrecipes.com/recipe/73223/new-wife-tuna-salad/','https://images.media-allrecipes.com/userphotos/560x315/818338.jpg','My husband says this tuna salad is even better than his mother\'s.  Not too pickly tasting, mild with a nice blend of flavor. You can add more mayo for a creamier salad.',186),('Zucchini Soup I','https://www.allrecipes.com/recipe/13060/zucchini-soup-i/','https://images.media-allrecipes.com/userphotos/560x315/391636.jpg','A delicious soup served anytime.',133),('Kecia\'s Broccoli Salad','https://www.allrecipes.com/recipe/14234/kecias-broccoli-salad/','https://images.media-allrecipes.com/userphotos/250x250/422820.jpg','Broccoli florets in a tangy dressing. The sweetness of the raisins is a perfect foil for the salt and savory taste of the bacon.',675),('Roasted Cauliflower Soup','https://www.allrecipes.com/recipe/142481/roasted-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/250x250/767016.jpg','I created this delicious and creamy soup to bring to work for a healthy lunch.  I hope you enjoy it too!',135),('Refined Sugar Free-Mango Sticky Rice','https://www.allrecipes.com/recipe/256566/refined-sugar-free-mango-sticky-rice/','https://images.media-allrecipes.com/userphotos/560x315/3492580.jpg','If you have been following me on Instagram or Facebook for a while, you know that mango sticky rice is one of my favorite sweets ever. And this is especially true when you can turn this naturally gluten-free dessert into a healthy gluten-free recipe! Read on and I will show how to turn this yummy treat in a refined sugar-free dessert. The first time I tried mango sticky rice I was just in the right place: Bangkok. As you can imagine, mangoes in Thailand are the best in the whole world! Anywhere you go, from Chiang Mai to Phuket, you\'ll find food carts selling fresh mangoes.',332),('Thai Green Curry Chicken','https://www.allrecipes.com/recipe/141833/thai-green-curry-chicken/','https://images.media-allrecipes.com/userphotos/560x315/2352284.jpg','In this quick and easy recipe that never fails, the chicken stays moist and tender. Serve over jasmine rice for a satisfying meal.',472),('Simple Roasted Butternut Squash','https://www.allrecipes.com/recipe/229733/simple-roasted-butternut-squash/','https://images.media-allrecipes.com/userphotos/560x315/957758.jpg','Butternut squash is so good on its own, that barely any seasoning is needed. This recipe is so simple and easy.',177),('Sarah\'s Fried Green Tomatoes','https://www.allrecipes.com/recipe/233126/sarahs-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/2802185.jpg','Mmmmm...batter-dipped, crispy, fried green tomatoes. Very good with a side of blue cheese dressing!',557),('Green Tomato Raspberry Jam','https://www.allrecipes.com/recipe/20953/green-tomato-raspberry-jam/','https://images.media-allrecipes.com/userphotos/560x315/42598.jpg','Nobody guesses that green tomatoes are in this very tasty jam.  It freezes well, cans easily, and the preparation is very quick.',38),('Sweet Potato, Carrot, Apple, and Red Lentil Soup','https://www.allrecipes.com/recipe/186378/sweet-potato-carrot-apple-and-red-lentil-soup/','https://images.media-allrecipes.com/userphotos/560x315/4058018.jpg','This winter pureed soup will warm you up on the inside while still protecting the waistline.',322),('Mango-Bacon-Butternut Squash Hash','https://www.allrecipes.com/recipe/228100/mango-bacon-butternut-squash-hash/','https://images.media-allrecipes.com/userphotos/560x315/3781372.jpg','All the Paleo staples in one!',424),('Aussie Breakfast Egg Mess','https://www.allrecipes.com/recipe/143403/aussie-breakfast-egg-mess/','https://images.media-allrecipes.com/userphotos/560x315/968466.jpg','This is a quick and easy spin on scrambled eggs. Ingredients can be prepared the night before to save time in the morning. A surefire hit back home and a much-loved addition to my husband\'s hit list!',427),('Saltfish Buljol','https://www.allrecipes.com/recipe/16200/saltfish-buljol/','https://images.media-allrecipes.com/userphotos/560x315/1060027.jpg','A favorite Sunday morning breakfast on the island of Trinidad in the Caribbean. Saltfish can be found in many grocery stores, ask your grocer to help you locate it. Serve this dish with sliced hard boiled eggs or simply serve with toast.',431),('Curried Butternut Squash Soup','https://www.allrecipes.com/recipe/235295/curried-butternut-squash-soup/','https://images.media-allrecipes.com/userphotos/560x315/5965464.jpg','This is a soup that will keep you warm during a long, cold winter!',296),('Zucchini Gazpacho','https://www.allrecipes.com/recipe/244531/zucchini-gazpacho/','https://images.media-allrecipes.com/userphotos/560x315/2429051.jpg','A perfect no-cook soup for a hot summer day! A great way to use and serve bountiful garden zucchini! The garbanzo beans add substance, texture, and protein too. Garnish with sour cream and freshly ground black pepper, if desired.',155),('Sean\'s Falafel and Cucumber Sauce','https://www.allrecipes.com/recipe/25309/seans-falafel-and-cucumber-sauce/','https://images.media-allrecipes.com/userphotos/560x315/200866.jpg','This is a great recipe for falafel. Everyone that I have made it for loves it. Yum!',586),('Sukhothai Pad Thai','https://www.allrecipes.com/recipe/19306/sukhothai-pad-thai/','https://images.media-allrecipes.com/userphotos/560x315/459698.jpg','This dish can be made with shrimp, chicken or pork instead of tofu. Look for the more exotic items in the Asian foods section at your local grocery store. Adjust the pad Thai sauce ingredients to taste.',619),('Tom Ka Gai (Coconut Chicken Soup)','https://www.allrecipes.com/recipe/13161/tom-ka-gai-coconut-chicken-soup/','https://images.media-allrecipes.com/userphotos/560x315/7670.jpg','The quintessential Thai soup.',433),('Fresh Tomato Zucchini Soup','https://www.allrecipes.com/recipe/75188/fresh-tomato-zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/1029409.jpg','At a point of abundance with tomatoes and zucchini from my garden I came up with this soup. A friend said it was like a soup you would get at one of those chic 5 star restaurants! Serve with crusty French bread and salad. This soup tastes wonderful after a little cooking or simmering a long time. Sometimes I add cooked rice to give a bit more substance.',88),('Copycat Panera Broccoli Cheddar Soup','https://www.allrecipes.com/recipe/235874/copycat-panera-broccoli-cheddar-soup/','https://images.media-allrecipes.com/userphotos/560x315/1087142.jpg','My husband loves Panera broccoli cheddar soup but it went up in price and therefore we set out on a hunt to create the perfect broccoli cheddar soup. Here is what we came up with. There are tons of variations and options to make this soup your own. You can add extra veggies, different cheeses, garlic to your onions, a little nutmeg to the finished soup, green onions, sour cream, etc. The list goes on and on. Make it your own! Serve topped with cheese!',304),('Quick and Simple Broccoli and Cheese','https://www.allrecipes.com/recipe/21155/quick-and-simple-broccoli-and-cheese/','https://images.media-allrecipes.com/userphotos/250x250/210133.jpg','This recipe is great for just-getting-started-cooks.',152),('Keto Instant Pot Soup (Low Carb)','https://www.allrecipes.com/recipe/260502/keto-instant-pot-soup-low-carb/','https://images.media-allrecipes.com/userphotos/560x315/4950304.jpg','Just a recipe I threw together while entertaining my 6-month-old on a soccer night for my older kiddos when we had limited time. This is an alternative to fast food on busy hectic nights. I prechopped my veggies during nap time, so all  I had to do was add them to the Instant Pot! Garnish with green onions, Cheddar cheese, and bacon.',347),('Pasta Salad','https://www.allrecipes.com/recipe/14385/pasta-salad/','https://images.media-allrecipes.com/userphotos/560x315/3512373.jpg','A dear friend gave me this recipe many years ago and I\'ve been making it ever since. It\'s great for barbecues.',400),('Three Cheese Breakfast Bake','https://www.allrecipes.com/recipe/33124/three-cheese-breakfast-bake/','https://images.media-allrecipes.com/userphotos/250x250/267502.jpg','This rich egg and cheese casserole is a great way to start the day.',374),('Hash Brown and Egg Casserole','https://www.allrecipes.com/recipe/87013/hash-brown-and-egg-casserole/','https://images.media-allrecipes.com/userphotos/560x315/2331971.jpg','This is my family\'s recipe that has been handed down through the years.  We\'ve always used the maple flavored pork sausage but any kind is good.  This casserole is a nice and cozy breakfast or brunch meal that everyone will enjoy.  It\'s got the perfect taste with lots of cheese. Yum! Be sure to use a baking dish that is deep enough to cover with aluminum foil.',616),('Best Big, Fat, Chewy Chocolate Chip Cookie','https://www.allrecipes.com/recipe/25037/best-big-fat-chewy-chocolate-chip-cookie/','https://images.media-allrecipes.com/userphotos/560x315/1107530.jpg','These cookies are the pinnacle of perfection! If you want a big, fat, chewy cookie like the kind you see at bakeries and specialty shops, then these are the cookies for you!',285),('Browned Butter Vegetables with Almonds','https://www.allrecipes.com/recipe/63336/browned-butter-vegetables-with-almonds/','https://images.media-allrecipes.com/userphotos/560x315/211416.jpg','I don\'t quite know what happens when butter just starts to brown, but it takes on a wonderful \'nutty\' aroma. Once the butter starts to simmer, watch very closely to make sure it doesn\'t burn. My husband loves vegetables cooked this way. I have used many different types of fresh vegetables and this seems to work with most any vegetable. (This recipe is for 1 1/2 pounds vegetables.)',185),('Thai Carrot Salad','https://www.allrecipes.com/recipe/239964/thai-carrot-salad/','https://images.media-allrecipes.com/userphotos/560x315/1603188.jpg','I got this recipe from the cook at my favorite Thai restaurant in Cincinnati. His carrot salad was one of his most popular salads/appetizers, people would buy multiple orders to go so they could bring this as a take along dish to an event. This is even better made a day ahead.',183),('Zesty Quinoa Salad','https://www.allrecipes.com/recipe/229156/zesty-quinoa-salad/','https://images.media-allrecipes.com/userphotos/560x315/1005880.jpg','This bright and colorful salad is a great summertime recipe (or anytime you want to feel like it\'s summertime). Light and citrusy, it\'s a whole new way to enjoy quinoa. Lime juice and cilantro give a refreshing kick, while quinoa and black beans provide tasty vegan protein. If you\'re not vegan, add even more protein by adding chunks of chicken or turkey. Yum!',270),('Red Curry Coconut Squash Soup','https://www.allrecipes.com/recipe/267054/red-curry-coconut-squash-soup/','https://images.media-allrecipes.com/userphotos/560x315/1610720.jpg','This curried squash soup has such an amazing balance of flavors and has officially become my favorite soup. Perfect for a chilly fall day! The fall weather always serves as inspiration for soup, especially butternut squash soups. I really wanted to put a spin on the typical squash soup this time, though. Optional garnishes include sliced scallions, toasted squash seeds, or shrimp. I highly suggest the toasted squash seeds as a garnish. They really add a lot!',303),('Creamy Pesto Shrimp','https://www.allrecipes.com/recipe/11808/creamy-pesto-shrimp/','https://images.media-allrecipes.com/userphotos/250x250/59215.jpg','One of our family\'s favorites, it\'s also great when made with crab meat instead of the shrimp.',646),('Blueberry Walnut Salad','https://www.allrecipes.com/recipe/72721/blueberry-walnut-salad/','https://images.media-allrecipes.com/userphotos/560x315/652457.jpg','An easy, yummy salad, perfect for any season, with berries, nuts, and greens. For an entree add chicken, diced apples, and diced green onions!',128),('Lemon-Garlic Shrimp and Grits','https://www.allrecipes.com/recipe/220894/lemon-garlic-shrimp-and-grits/','https://images.media-allrecipes.com/userphotos/250x250/1001970.jpg','Classic Carolina Shrimp and Grits! Serve with lemon wedges.',197),('Buttermilk Pancakes II','https://www.allrecipes.com/recipe/24530/buttermilk-pancakes-ii/','https://images.media-allrecipes.com/userphotos/560x315/439719.jpg','A very light and fluffy pancake that requires fresh buttermilk, but it\'s the best I\'ve ever made!',219),('Butternut Squash Soup','https://www.allrecipes.com/recipe/12974/butternut-squash-soup/','https://images.media-allrecipes.com/userphotos/560x315/45392.jpg','Delicious and very easy to make. You can use 3 to 4 cups of chicken broth instead of the water and bouillon cubes. Also works well with half as much cream cheese if you don\'t want it too rich.',397),('Summer Corn Salad','https://www.allrecipes.com/recipe/summer-corn-salad/','https://images.media-allrecipes.com/userphotos/560x315/1169760.jpg','This fresh and flavorful salad features buttery yellow corn tossed with chunks of tomato and onion with a fresh basil vinaigrette.',305),('Ginger Glazed Mahi Mahi','https://www.allrecipes.com/recipe/45833/ginger-glazed-mahi-mahi/','https://images.media-allrecipes.com/userphotos/560x315/958722.jpg','This Ginger Glazed Mahi Mahi is bursting with flavor and combines both sweet and sour taste sensations.  The 30 minute prep time includes 20 minutes to marinate.  This recipe is a snap and so delicious.  You\'ll love it!',259),('Angela\'s Awesome Enchiladas','https://www.allrecipes.com/recipe/83549/angelas-awesome-enchiladas/','https://images.media-allrecipes.com/userphotos/560x315/683438.jpg','The secret is in the seasonings!  I whipped these up on my own using stuff I had on hand. Shredding the chicken is the most time-consuming step, but it\'s worth it in the end. Give these babies a try! Serve with sour cream and a side of Spanish rice.',709),('Greek Chicken Pasta','https://www.allrecipes.com/recipe/12072/greek-chicken-pasta/','https://images.media-allrecipes.com/userphotos/560x315/220541.jpg','This pasta dish incorporates some of the flavors of Greece. It makes a wonderfully complete and satisfying meal. For extra flavor, toss in a few kalamata olives. Use whatever pasta you have or prefer.',488),('Crab Brunch Casserole','https://www.allrecipes.com/recipe/25353/crab-brunch-casserole/','https://images.media-allrecipes.com/userphotos/250x250/580933.jpg','A delicious casserole - elegant enough for a Sunday brunch!',273),('Fried Green Tomatoes','https://www.allrecipes.com/recipe/37705/fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/250x250/92479.jpg','These wonderful country-fried green tomatoes make a great side dish for summer!',310),('Easy Beef Stew for the Slow Cooker','https://www.allrecipes.com/recipe/236449/easy-beef-stew-for-the-slow-cooker/','https://images.media-allrecipes.com/userphotos/560x315/1965851.jpg','Very easy to prepare beef stew. Lots of flavor and quick to prepare.',252),('Minestrone Soup II','https://www.allrecipes.com/recipe/13339/minestrone-soup-ii/','https://images.media-allrecipes.com/userphotos/250x250/972767.jpg','This is a wonderful minestrone soup that \'s filled with tons of vegetables.  Feel free to add different vegetables or ingredients. Serve with grated Parmesan cheese.',387),('Skewered Grilled Potatoes','https://www.allrecipes.com/recipe/91353/skewered-grilled-potatoes/','https://images.media-allrecipes.com/userphotos/560x315/1031640.jpg','New potatoes coated in a rosemary and garlic marinade then skewered and grilled.',137),('Oatmeal Pancakes II','https://www.allrecipes.com/recipe/21384/oatmeal-pancakes-ii/','https://images.media-allrecipes.com/userphotos/560x315/1011512.jpg','I make this for my kids quite often.  It is very simple.  Preparing the batter in the food processor makes it that much easier. Serve with syrup and butter.  Also good with applesauce!',207),('Curry Stand Chicken Tikka Masala Sauce','https://www.allrecipes.com/recipe/228293/curry-stand-chicken-tikka-masala-sauce/','https://images.media-allrecipes.com/userphotos/560x315/5504832.jpg','A classic curry-stand recipe. This is not haute cuisine; this is the kind of nuclear-orange tikka masala that you crave when you stumble out of a pub at 2 a.m. I make vast quantities of the sauce at one time, and it freezes very well. I also added much more cayenne pepper than 1 teaspoon, but I give out the recipe like this for people who don\'t like heat.',328),('Whole Wheat, Oatmeal, and Banana Pancakes','https://www.allrecipes.com/recipe/166601/whole-wheat-oatmeal-and-banana-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/506758.jpg','A basic whole-grain pancake to get you going in the morning. We also like to change it up a bit by adding 1/2 cup applesauce and 1 1/2 teaspoons of cinnamon instead of the banana.',333),('Buttermilk Doughnuts','https://www.allrecipes.com/recipe/240501/buttermilk-doughnuts/','https://images.media-allrecipes.com/userphotos/560x315/4563054.jpg','Cake-like buttermilk doughnuts are fried and topped with an optional vanilla sugar glaze. Decorate with nuts or candy sprinkles, if desired.',172),('Curried Coconut Chicken','https://www.allrecipes.com/recipe/68532/curried-coconut-chicken/','https://images.media-allrecipes.com/userphotos/560x315/3591067.jpg','Curried chicken simmered in coconut milk and tomatoes makes for a mouthwatering hint of the tropics! Goes great with rice and vegetables.',375),('Bean Soup With Kale','https://www.allrecipes.com/recipe/78023/bean-soup-with-kale/','https://images.media-allrecipes.com/userphotos/250x250/328678.jpg','Each serving supplies 7mg of lutein, a healthy dose for the day.',182),('Curried Zucchini Soup','https://www.allrecipes.com/recipe/80878/curried-zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/219051.jpg','Delicious soup with simple ingredients. Easy to make.',74),('Butternut Squash and Turkey Chili','https://www.allrecipes.com/recipe/131107/butternut-squash-and-turkey-chili/','https://images.media-allrecipes.com/userphotos/560x315/274283.jpg','This is a delicious, filling chili.  Serve topped with sour cream and tortilla chips!',165),('Chinese Chicken Fried Rice II','https://www.allrecipes.com/recipe/16954/chinese-chicken-fried-rice-ii/','https://images.media-allrecipes.com/userphotos/560x315/5645767.jpg','Chicken, rice, soy sauce and shredded egg stir fried together. This is a very simple recipe. It is easy, but tasty! Note: Never use rice that you have just cooked.',255),('Zucchini Patties','https://www.allrecipes.com/recipe/13941/zucchini-patties/','https://images.media-allrecipes.com/userphotos/560x315/388342.jpg','These cheesy zucchini patties are an excellent way to use up that abundance of zucchini from the garden. Serve with a bit of tomato sauce or sour cream dabbed on top.',245),('Spicy Garlic and Pepper Shrimp','https://www.allrecipes.com/recipe/12818/spicy-garlic-and-pepper-shrimp/','https://images.media-allrecipes.com/userphotos/560x315/5351454.jpg','Spicy Thai style shrimp. Chicken, pork, beef, calamari, scallops, or tofu can easily be substituted for shrimp. This makes for a wonderful supper.',406),('Mama Kathy\'s Minestrone','https://www.allrecipes.com/recipe/83201/mama-kathys-minestrone/','https://images.media-allrecipes.com/userphotos/250x250/48706.jpg','This is a tasty and filling soup for those cold winter nights. The mix of the vegetables tastes wonderful. Make homemade baked bread and you will have a winter\'s delight.',402),('Instant Pot Vegan Vegetable and Barley Soup','https://www.allrecipes.com/recipe/263038/instant-pot-vegan-vegetable-and-barley-soup/','https://images.media-allrecipes.com/userphotos/560x315/5181992.jpg','Barley, zucchinis, carrots, tomatoes, and corn combine to make this hearty, versatile, filling vegan soup that is just so easy to make in your Instant Pot.',212),('Ken\'s Minestrone Soup','https://www.allrecipes.com/recipe/14110/kens-minestrone-soup/','https://images.media-allrecipes.com/userphotos/250x250/132833.jpg','My husband and I love the minestrone soup at restaurants, so he came home and started experimenting.  This is the delicious soup that he came up with.',225),('Vietnamese Fresh Spring Rolls','https://www.allrecipes.com/recipe/24239/vietnamese-fresh-spring-rolls/','https://images.media-allrecipes.com/userphotos/560x315/5265636.jpg','These spring rolls are a refreshing change from the usual fried variety, and have become a family favorite.  They are great as a cool summertime appetizer, and are delicious dipped in one or both of the sauces.',82),('Slow Cooker Thai Peanut Pork','https://www.allrecipes.com/recipe/186965/slow-cooker-thai-peanut-pork/','https://images.media-allrecipes.com/userphotos/560x315/635640.jpg','This is a easy pork dish that your whole family will enjoy.',209),('Strawberry Oatmeal Breakfast Smoothie','https://www.allrecipes.com/recipe/23539/strawberry-oatmeal-breakfast-smoothie/','https://images.media-allrecipes.com/userphotos/560x315/409456.jpg','This is a fast vegan smoothie with a deep pink color and a rich, creamy texture.  VERY filling, and perfect for people in a rush in the morning. You don\'t have to give up a good breakfast when it\'s this fast to make! I use vitamin fortified soy milk.',236),('Amazing Muffin Cups','https://www.allrecipes.com/recipe/231510/amazing-muffin-cups/','https://images.media-allrecipes.com/userphotos/560x315/4589482.jpg','Eggs, sausage, red bell pepper, and cheese are baked in hash brown potato \'cups\' for a delicious breakfast that will feed a crowd.',224),('Butternut and Acorn Squash Soup','https://www.allrecipes.com/recipe/59635/butternut-and-acorn-squash-soup/','https://images.media-allrecipes.com/userphotos/560x315/750081.jpg','This is a rich and sweet yet surprisingly simple soup that is wonderful served hot with crusty bread or cold with a dollop of sour cream.',266),('Frugal Fried Green Tomatoes','https://www.allrecipes.com/recipe/222922/frugal-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/250x250/908060.jpg','Cheapest way to make fried green tomatoes that are crunchy on the outside, and taste like apple pie on the inside. Great side-dish for any meal!',222),('Fat Granny\'s Minestrone Soup','https://www.allrecipes.com/recipe/228716/fat-grannys-minestrone-soup/','https://images.media-allrecipes.com/userphotos/560x315/4283763.jpg','Fresh vegetables, beans, and pasta are simmered in a seasoned tomato broth. Serve with garlic cheese bread and a fresh tossed green salad.',398),('Shrimp Quiche','https://www.allrecipes.com/recipe/86174/shrimp-quiche/','https://images.media-allrecipes.com/userphotos/560x315/1447283.jpg','A simple and easy and oh-so-good shrimp quiche.',294),('Thai Cucumber Salad','https://www.allrecipes.com/recipe/169593/thai-cucumber-salad/','https://images.media-allrecipes.com/userphotos/560x315/576740.jpg','This sweet and tangy summer salad of cucumber, cilantro, and peanuts with just a hint of heat is always a hit at picnics and potlucks since it doesn\'t need to be refrigerated and you\'re pretty much guaranteed to be the only one bringing this dish!',238),('Spicy Thai Basil Chicken (Pad Krapow Gai)','https://www.allrecipes.com/recipe/257938/spicy-thai-basil-chicken-pad-krapow-gai/','https://images.media-allrecipes.com/userphotos/560x315/4507925.jpg','My version of this classic Thai dish has spectacular taste even with regular basil instead of Thai or holy basil. The sauce actually acts like a glaze as the chicken mixture cooks over high heat. The recipe works best if you chop or grind your own chicken and have all ingredients prepped before you start cooking.',715),('Crustless Spinach Quiche','https://www.allrecipes.com/recipe/20876/crustless-spinach-quiche/','https://images.media-allrecipes.com/userphotos/560x315/451789.jpg','I serve this in the summer for brunch with a side of sausage links and a fresh fruit bowl!',309),('Kathy\'s Cabbage Soup','https://www.allrecipes.com/recipe/234906/kathys-cabbage-soup/','https://images.media-allrecipes.com/userphotos/560x315/3520163.jpg','This is a nutritious and hearty soup; it feeds a crowd, smells and tastes wonderful on a chilly day, makes great leftovers, and freezes well. The ingredients are easy to keep on hand, and it\'s pretty quick to throw together. It even tastes better the next day! Serve with crusty bread or cheddar biscuits.',196),('Baked Potato Soup I','https://www.allrecipes.com/recipe/12997/baked-potato-soup-i/','https://images.media-allrecipes.com/userphotos/560x315/5867379.jpg','Thick and creamy. Uses leftover baked potatoes.',748),('Bacon, Potato, and Egg Taco Ole','https://www.allrecipes.com/recipe/86422/bacon-potato-and-egg-taco-ole/','https://images.media-allrecipes.com/userphotos/560x315/4468324.jpg','This dish can be a comforting breakfast or a fast dinner food. Onions are sauteed with potatoes and eggs then served with crispy bacon on warm flour or corn tortillas or even on buttered toast.  Add your favorite salsa or for a zesty zip!',485),('Miso Soup','https://www.allrecipes.com/recipe/13107/miso-soup/','https://images.media-allrecipes.com/userphotos/560x315/365400.jpg','Dashi is a basic stock used in Japanese cooking which is made by boiling dried kelp (seaweed) and dried bonito (fish). Instant dashi granules are sold in conveniently-sized jars or packets and vary in strength. Add more dashi to your soup if you want a stronger stock. You can use yellow, white or red miso paste for this soup. Yellow miso is sweet and creamy, red miso is stronger and saltier.',63),('Curried Cream of Cauliflower Soup','https://www.allrecipes.com/recipe/240833/curried-cream-of-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/560x315/1943107.jpg','A rich and filling soup, perfect for cold winter nights.',359),('Award Winning Soft Chocolate Chip Cookies','https://www.allrecipes.com/recipe/15004/award-winning-soft-chocolate-chip-cookies/','https://images.media-allrecipes.com/userphotos/560x315/4538829.jpg','Everybody wants this recipe when I take them in for a carry-in. To make them award winning, my daughter, Tegan, made them for a cookie baking contest and won a red ribbon!  You can use any flavor pudding you like for this recipe.',177),('Simple Turkey Chili','https://www.allrecipes.com/recipe/80969/simple-turkey-chili/','https://images.media-allrecipes.com/userphotos/560x315/1106134.jpg','This is a very simple and hearty chili with plenty of flavor. It\'s even better the second day! I serve this with lowfat Cheddar cheese and lowfat sour cream. It\'s also delicious with crackers.',185),('Shrimp Scampi with Pasta','https://www.allrecipes.com/recipe/229960/shrimp-scampi-with-pasta/','https://images.media-allrecipes.com/userphotos/560x315/2606852.jpg','Well-rounded seafood and pasta dish. Good with any pasta; angel hair is less filling.',511),('Turkey Veggie Meatloaf Cups','https://www.allrecipes.com/recipe/216688/turkey-veggie-meatloaf-cups/','https://images.media-allrecipes.com/userphotos/560x315/4556887.jpg','This super-delicious and incredibly easy recipe has become one of my absolute favorites. I pass it on to everyone I know, and they all rave about it too!',119),('Simple Scones','https://www.allrecipes.com/recipe/79470/simple-scones/','https://images.media-allrecipes.com/userphotos/560x315/691937.jpg','Make a holiday breakfast -- or afternoon tea -- really special with these sweet bakery treats.',319),('Tomato Basil Penne Pasta','https://www.allrecipes.com/recipe/193187/tomato-basil-penne-pasta/','https://images.media-allrecipes.com/userphotos/560x315/242356.jpg','A Mediterranean-style family staple.',502),('Smoked Salmon Scramble','https://www.allrecipes.com/recipe/24277/smoked-salmon-scramble/','https://images.media-allrecipes.com/userphotos/560x315/3807043.jpg','A special version of scrambled eggs which is quick and easy to make before getting on with the task of cooking Christmas dinner.',367),('Minestrone Soup','https://www.allrecipes.com/recipe/14118/minestrone-soup/','https://images.media-allrecipes.com/userphotos/250x250/449163.jpg','This soup is very filling and healthy. If possible use fresh vegetables and herbs from the garden. If you like, you can replace the kidney beans with cannelini beans.',399),('Cheesy Amish Breakfast Casserole','https://www.allrecipes.com/recipe/229150/cheesy-amish-breakfast-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1334701.jpg','This hearty casserole has bacon, eggs, hash browns, and three different cheeses all baked into a comforting breakfast dish, perfect for feeding a crowd.',314),('Baked Milk Fish','https://www.allrecipes.com/recipe/19927/baked-milk-fish/','https://images.media-allrecipes.com/userphotos/560x315/2399247.jpg','Easy to prepare and very tasty!  A simple recipe for fish baked in milk with almost no fat! You may use your favorite variety of white fish.',189),('Herb \'n Honey Cucumber Tomato Salad','https://www.allrecipes.com/recipe/254495/herb-n-honey-cucumber-tomato-salad/','https://images.media-allrecipes.com/userphotos/560x315/3774683.jpg','Crisp and sweetly delicious, this salad is a wonderful addition to any summer picnic. May serve immediately or cover and refrigerate up to four hours before serving for enhanced flavor.',167),('Pesto Chicken Penne Casserole','https://www.allrecipes.com/recipe/216470/pesto-chicken-penne-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1634867.jpg','Creamy, flavorful and so easy to fix. This meal-in-one will wow family and friends. Makes a lot, so freeze some or halve the recipe.',760),('Quinoa Black Bean Burgers','https://www.allrecipes.com/recipe/220661/quinoa-black-bean-burgers/','https://images.media-allrecipes.com/userphotos/560x315/5858755.jpg','These vegetarian burgers are delicious! Your carnivorous friends will be impressed. My favorite way to serve is on a whole-wheat bun with garlic-lemon mayonnaise, fresh raw spinach, sliced tomato, and caramelized onions!',245),('Black Bean and Corn Salad II','https://www.allrecipes.com/recipe/13933/black-bean-and-corn-salad-ii/','https://images.media-allrecipes.com/userphotos/560x315/226330.jpg','This salad is very colorful and includes a very tasty lime dressing.',391),('Beef and Guinness Stew','https://www.allrecipes.com/recipe/234534/beef-and-guinness-stew/','https://images.media-allrecipes.com/userphotos/560x315/1111973.jpg','The maltiness of dark beer really does amazing things for this gravy. It\'s a very simple dish, but at the same time it has a deep, complex, rich flavor. I served this in a nice ring of green onion-mashed potatoes. I hope you give this a try, whether for St. Patrick\'s Day or anytime of the year.',528),('Green Tomato Relish','https://www.allrecipes.com/recipe/19584/green-tomato-relish/','https://images.media-allrecipes.com/userphotos/560x315/4554361.jpg','This delicious, tangy relish of green tomatoes, onions, bell peppers, and spices,  is perfect with sandwiches, potatoes, cheese, and lots of other entrees. A jar of this makes a great gift, too!',32),('Indian Fish Curry','https://www.allrecipes.com/recipe/213238/indian-fish-curry/','https://images.media-allrecipes.com/userphotos/560x315/779645.jpg','A very spicy dish. This recipe is inspired by my mother\'s Bengali fish recipe she used to make in India.',338),('Spicy Edam Shrimp Quiche','https://www.allrecipes.com/recipe/132578/spicy-edam-shrimp-quiche/','https://images.media-allrecipes.com/userphotos/250x250/32235.jpg','Shrimp, Edam, and mushroom make this an elegant quiche. I use Red Hot Dutch Edam to give this a spicy kick, but if you can\'t find it, use regular Edam and spike it with red pepper flakes instead.',244),('Thai Chicken Balls','https://www.allrecipes.com/recipe/23764/thai-chicken-balls/','https://images.media-allrecipes.com/userphotos/560x315/255920.jpg','These chicken balls are so tasty! You have to try them!',313),('Filet Mignon with Rich Balsamic Glaze','https://www.allrecipes.com/recipe/30578/filet-mignon-with-rich-balsamic-glaze/','https://images.media-allrecipes.com/userphotos/560x315/468582.jpg','This is an elegant and quick romantic dinner for two. Wonderful served with steamed asparagus and baby red potatoes.',367),('Sarah\'s Applesauce','https://www.allrecipes.com/recipe/51301/sarahs-applesauce/','https://images.media-allrecipes.com/userphotos/560x315/25840.jpg','This applesauce is delicious! I make it for my younger brother all the time and he loves it - and he hates canned applesauce!',121),('Healing Cabbage Soup','https://www.allrecipes.com/recipe/82923/healing-cabbage-soup/','https://images.media-allrecipes.com/userphotos/560x315/3016182.jpg','My body craves this soup whenever I have a cold, but it\'s good anytime. Due to the garlic, however, it might be a good idea to be sure that everyone around you eats it, too!',82),('Cauliflower-Cheese Soup','https://www.allrecipes.com/recipe/12996/cauliflower-cheese-soup/','https://images.media-allrecipes.com/userphotos/560x315/4971449.jpg','A soothing cheesy soup. Serve with a roll and a salad.',385),('Superfast Asparagus','https://www.allrecipes.com/recipe/161685/superfast-asparagus/','https://images.media-allrecipes.com/userphotos/250x250/354443.jpg','Roast asparagus is a 15-minute side dish (and YUM).',32),('Grandma\'s Lemon Meringue Pie','https://www.allrecipes.com/recipe/15093/grandmas-lemon-meringue-pie/','https://images.media-allrecipes.com/userphotos/560x315/672049.jpg','This is a very fun recipe to follow, because Grandma makes it sweet and simple. This pie is thickened with cornstarch and flour in addition to egg yolks, and contains no milk.',298),('Brown Sugar Meatloaf','https://www.allrecipes.com/recipe/25203/brown-sugar-meatloaf/','https://images.media-allrecipes.com/userphotos/560x315/2573174.jpg','This is an easy tasty meatloaf. It tastes as good as it smells!',353),('Pumpkin Pancakes','https://www.allrecipes.com/recipe/17036/pumpkin-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/705316.jpg','These are good any season but taste best on cold winter mornings. You can use canned or cooked fresh pumpkin.',278),('Absolutely The Best Shrimp Scampi','https://www.allrecipes.com/recipe/23194/absolutely-the-best-shrimp-scampi/','https://images.media-allrecipes.com/userphotos/560x315/3517481.jpg','The best scampi ever. Will melt in your mouth. Serve with a rice pilaf and salad for a wonderful meal.',500),('Carol\'s Baked Ziti Casserole','https://www.allrecipes.com/recipe/222638/carols-baked-ziti-casserole/','https://images.media-allrecipes.com/userphotos/560x315/962516.jpg','Packed with cheese, sauce, and pasta, this baked casserole is as comforting as it is filling.',314),('Tequila Shrimp','https://www.allrecipes.com/recipe/22256/tequila-shrimp/','https://images.media-allrecipes.com/userphotos/560x315/377618.jpg','This is a very simple and excellent recipe. Goes great over pasta.',205),('Glazed Carrots','https://www.allrecipes.com/recipe/229669/glazed-carrots/','https://images.media-allrecipes.com/userphotos/560x315/3892550.jpg','Simple dish with tender carrots with a buttery glaze and a mild sweetness.',124),('Sheet Pan Chicken Fajitas','https://www.allrecipes.com/recipe/255038/sheet-pan-chicken-fajitas/','https://images.media-allrecipes.com/userphotos/560x315/3910454.jpg','Quick and easy way to prepare homemade, flavorful fajitas for a crowd!',200),('Breakfast Pies','https://www.allrecipes.com/recipe/49629/breakfast-pies/','https://images.media-allrecipes.com/userphotos/560x315/4516111.jpg','Individual breakfast pies that can be made ahead of time, and microwaved as needed. My 3 year old grandson loves them, and they are finger food for the little ones. The big guys love them too. I fix hash browns and gravy as side dishes for the big guys, and it is a huge hit!',247),('Maple Bacon Monkey Bread','https://www.allrecipes.com/recipe/234756/maple-bacon-monkey-bread/','https://images.media-allrecipes.com/userphotos/560x315/1708960.jpg','Sweet and salty monkey bread with a delicious twist - bacon! This recipe was created from two existing recipes, with the idea courtesy of the St. Louis Post Dispatch.',374),('Pan Fried Brussels Sprouts','https://www.allrecipes.com/recipe/216805/pan-fried-brussels-sprouts/','https://images.media-allrecipes.com/userphotos/560x315/1122911.jpg','Don\'t be afraid of Brussels sprouts ... yes, they are green, but they are so delicious! Pan frying them brings out their flavor. Use as a side dish ... or if you\'re like me, an on-the-go breakfast item!',87),('Monkey Bread I','https://www.allrecipes.com/recipe/6815/monkey-bread-i/','https://images.media-allrecipes.com/userphotos/560x315/546316.jpg','Refrigerated biscuits with cinnamon bake in a tube pan. My 7 year old daughter, Leah, loves her Monkey Bread. Enjoy!',418),('The Most Easy and Delish Meatloaf EVER!','https://www.allrecipes.com/recipe/133640/the-most-easy-and-delish-meatloaf-ever/','https://images.media-allrecipes.com/userphotos/560x315/239269.jpg','This meatloaf only calls for a few easy ingredients, no chopping whatsoever! If you wish to add ketchup on top, remove the meatloaf at 50 minutes, add ketchup, then return to oven for the remaining 10 minutes.',246),('Cheesy Bacon-Sausage-Egg-Hash Brown Skillet','https://www.allrecipes.com/recipe/261541/cheesy-bacon-sausage-egg-hash-brown-skillet/','https://images.media-allrecipes.com/userphotos/560x315/4536885.jpg','Cheesy bacon-sausage-egg-hash brown skillet is a scrumptious, easy breakfast loaded with bacon, sausage, hash browns, cheese, and eggs! Garnish with 2 thinly sliced green onions, if desired.',312),('Broccoli and Brussels Sprout Delight','https://www.allrecipes.com/recipe/239919/broccoli-and-brussels-sprout-delight/','https://images.media-allrecipes.com/userphotos/560x315/1647607.jpg','Broccoli and Brussels sprouts combine and come together in delightful way. If you love Brussels sprouts, this is a nice way to reintroduce them to your friends and family. Use fresh Brussels sprouts and broccoli. If the sprouts are large, trim and quarter them.',115),('Fried Green Tomatoes with Shrimp Remoulade','https://www.allrecipes.com/recipe/127164/fried-green-tomatoes-with-shrimp-remoulade/','https://images.media-allrecipes.com/userphotos/560x315/452149.jpg','A classic New Orleans delicacy, fried green tomatoes are complete only with a spicy shrimp remoulade over a bed of greens.',618),('Oven Scrambled Eggs','https://www.allrecipes.com/recipe/57459/oven-scrambled-eggs/','https://images.media-allrecipes.com/userphotos/560x315/642809.jpg','These light and fluffy scrambled eggs  are a snap to put together for a big crowd. I usually make 2 pans for our Christmas Brunch, and I never have much left over!',236),('Maria\'s Broccoli Rabe','https://www.allrecipes.com/recipe/21181/marias-broccoli-rabe/','https://images.media-allrecipes.com/userphotos/560x315/2728046.jpg','This is a nice side dish served with baked chicken or fish.  Virtually not fattening and very healthy for you.',192),('Banana Pancakes I','https://www.allrecipes.com/recipe/20334/banana-pancakes-i/','https://images.media-allrecipes.com/userphotos/560x315/708583.jpg','Crowd pleasing banana pancakes made from scratch. A fun twist on ordinary pancakes.',193),('Wonton Soup','https://www.allrecipes.com/recipe/13199/wonton-soup/','https://images.media-allrecipes.com/userphotos/560x315/223371.jpg','A simple, light \'Chinese dumpling\' classic ...whether in soup or fried, wontons will always bring you that mysteriously delicious taste of the Far East ...! Garnish with fresh scallions.',145),('Absolutely Ultimate Potato Soup','https://www.allrecipes.com/recipe/13218/absolutely-ultimate-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/168555.jpg','I have made this for many whom have given it the title. This takes a bit of effort but is well worth it. Please note: for those who do not wish to use bacon, substitute 1/4 cup melted butter for the bacon grease and continue with the recipe.  (I generally serve this soup as a special treat as it is not recommended for people counting calories.)',594),('Crispy Fish','https://www.allrecipes.com/recipe/12739/crispy-fish/','https://images.media-allrecipes.com/userphotos/560x315/4459872.jpg','I have tried this recipe with several varieties of white fish and it is always wonderful. This recipe also works without the flour for those of you who have allergies to wheat. I run a fish market and have shared this recipe with many people and they always come back with rave reviews. Serve with your favorite tartar sauce and chips (French fries)!',446),('The Best Meatloaf','https://www.allrecipes.com/recipe/25198/the-best-meatloaf/','https://images.media-allrecipes.com/userphotos/560x315/4558014.jpg','I have used this recipe for 30 years. My husband loves it and he is picky.',288),('Green Squash Soup','https://www.allrecipes.com/recipe/247125/green-squash-soup/','https://images.media-allrecipes.com/userphotos/560x315/3667359.jpg','A great way to use all of those CSA veggies and it\'s creamy and vegan. You can really use any vegetables in this and different amounts. You can\'t even taste the lettuce or kale.',240),('Smoked Salmon Frittata','https://www.allrecipes.com/recipe/71928/smoked-salmon-frittata/','https://images.media-allrecipes.com/userphotos/560x315/2054809.jpg','A delicious Pacific Northwest recipe made with smoked salmon and cream cheese. Garnish with fresh herbs or avocado slices for a beautiful presentation.',401),('Oven Baked Sweet Potato Fries','https://www.allrecipes.com/recipe/237083/oven-baked-sweet-potato-fries/','https://images.media-allrecipes.com/userphotos/560x315/5482892.jpg','Need a side dish? Bake a batch of sweet potato fries that will please your friends and family. Soybean oil, labeled vegetable oil, helps brown evenly. Season as you please!',287),('Zucchini Gazpacho with Basil Cream','https://www.allrecipes.com/recipe/238974/zucchini-gazpacho-with-basil-cream/','https://images.media-allrecipes.com/userphotos/560x315/1389995.jpg','This is my variation on a recipe I found in a magazine. Garnish soup with fresh basil leaves and a drizzle of olive oil to serve.',453),('Honey Roasted Sweet Potatoes','https://www.allrecipes.com/recipe/240137/honey-roasted-sweet-potatoes/','https://images.media-allrecipes.com/userphotos/560x315/1924503.jpg','Sweet and tasty side to any meal!',468),('Sour Cream Coffee Cake III','https://www.allrecipes.com/recipe/8130/sour-cream-coffee-cake-iii/','https://images.media-allrecipes.com/userphotos/560x315/4809969.jpg','This cake is so moist. Enjoy it with a delicious cup of tea or coffee in the morning.',306),('Mango with Sticky Coconut Rice (Kao Niaw)','https://www.allrecipes.com/recipe/236476/mango-with-sticky-coconut-rice-kao-niaw/','https://images.media-allrecipes.com/userphotos/560x315/1099412.jpg','This is my favorite Thai dessert. There is something very comforting about it. I also like to eat it for breakfast.',701),('Fantastic Black Bean Chili','https://www.allrecipes.com/recipe/23336/fantastic-black-bean-chili/','https://images.media-allrecipes.com/userphotos/560x315/1520442.jpg','I never knew what I was missing until my mother-in-law made this! Everyone begged her for the recipe. A nice and easy way to feed a crowd. Thanks to my mother-in-law this has become a favorite dish!  Can be frozen very well and doubled for a larger crowd.  Top with your favorite shredded cheese.',366),('Cauliflower and White Cheddar Cheese Soup','https://www.allrecipes.com/recipe/14111/cauliflower-and-white-cheddar-cheese-soup/','https://images.media-allrecipes.com/userphotos/560x315/2825130.jpg','A creamy cauliflower and cheddar soup. Instead of the cauliflower you can also use broccoli, corn kernels or even pumpkin.',411),('Carrot and Ginger Soup','https://www.allrecipes.com/recipe/68002/carrot-and-ginger-soup/','https://images.media-allrecipes.com/userphotos/560x315/5716858.jpg','A recipe a friend gave me, that I\'ve used a couple of times with great success!! Butternut squash, carrots, and ginger each bring a unique quality to this delicious pureed vegetable soup. Absolutely lovely.',246),('Baked Shrimp Scampi','https://www.allrecipes.com/recipe/229959/baked-shrimp-scampi/','https://images.media-allrecipes.com/userphotos/560x315/1189502.jpg','I\'ve probably been making this recipe since I got it from my Mom in about 1985. I have no idea where she got the recipe from. I\'ve been changing it over the years, and now I call it my own. When we started dating back in 1997, my husband would every now and then order shrimp scampi at a restaurant and always regret it afterwards, saying none of them competed with mine. You can vary the amounts of some of the ingredients, like the cayenne and garlic, to suit your taste. That\'s what I\'ve done here because we like spicy and garlicky. Yum! Serve over angel hair pasta or any pasta of your choosing.',574),('Greek Salad I','https://www.allrecipes.com/recipe/14373/greek-salad-i/','https://images.media-allrecipes.com/userphotos/560x315/827520.jpg','This is an incredibly good Greek salad recipe, nice and tangy and even better in the summer when you use fresh vegetables!',265),('Sour Cream Blueberry Coffee Cake','https://www.allrecipes.com/recipe/229029/sour-cream-blueberry-coffee-cake/','https://images.media-allrecipes.com/userphotos/560x315/896162.jpg','This is a spin on traditional coffee cake that me and my fiance love!',639),('Best Italian Sausage Soup','https://www.allrecipes.com/recipe/25713/best-italian-sausage-soup/','https://images.media-allrecipes.com/userphotos/560x315/3219698.jpg','This is one of my favorite soups and it always gets rave reviews! Salad, hard rolls and wine make a meal! You can make this 24 hours ahead of time without the noodles and wait to add the spinach noodles until soup is reheated for serving. Yummy! Serve topped with grated Parmesan!',436),('Homemade Black Bean Veggie Burgers','https://www.allrecipes.com/recipe/85452/homemade-black-bean-veggie-burgers/','https://images.media-allrecipes.com/userphotos/560x315/4548470.jpg','You will never want to eat frozen veggie burgers again. These are so easy, and you\'ll be proud to have created such a vegetarian delight.',198),('Acorn Squash','https://www.allrecipes.com/recipe/16796/acorn-squash/','https://images.media-allrecipes.com/userphotos/560x315/1403075.jpg','Sweet and buttery squash--this is quick and easy, and my family loves it.',189),('Slow Cook Thai Chicken','https://www.allrecipes.com/recipe/76778/slow-cook-thai-chicken/','https://images.media-allrecipes.com/userphotos/560x315/572192.jpg','Slow cooked chicken breasts in a rich, peanutty, slightly spicy sauce.  Serve over rice.',408),('Zucchini Tomato Soup II','https://www.allrecipes.com/recipe/19765/zucchini-tomato-soup-ii/','https://images.media-allrecipes.com/userphotos/560x315/2958320.jpg','A great way to use up all those extra fresh tomatoes and zucchini from the garden during late summer. My family loves this soup! If you like, this soup can be thinned with a little bit of milk or cream.',46),('Veggie Pesto Soup','https://www.allrecipes.com/recipe/76880/veggie-pesto-soup/','https://images.media-allrecipes.com/userphotos/560x315/2077628.jpg','Home recipe for an easy and very delicious soup. Best served with fresh warm bread.',134),('Broccoli Cheese Bake','https://www.allrecipes.com/recipe/20516/broccoli-cheese-bake/','https://images.media-allrecipes.com/userphotos/560x315/392594.jpg','This is a great casserole that I threw together one day when a friend requested Broccoli au Gratin for her birthday dinner.  This is a great idea for those who aren\'t big fans of bread crumbs.  Also, the eggs can be taken out for a great sauce and using skim milk and fat-free cheese works well, too.  It\'s basically a great recipe that can be easily altered according to taste. Enjoy!',441),('Roasted Beets \'n\' Sweets','https://www.allrecipes.com/recipe/77215/roasted-beets-n-sweets/','https://images.media-allrecipes.com/userphotos/250x250/705153.jpg','This is a great autumn or winter side dish, especially for those who like things sweet and salty. The colors are beautiful and make a nice autumn presentation.',198),('Chicken and Corn Chili','https://www.allrecipes.com/recipe/12906/chicken-and-corn-chili/','https://images.media-allrecipes.com/userphotos/560x315/1964141.jpg','This is an easy slow cooker meal - use your imagination and season it up as you like! Great on a c-c-c-cold winter night! I serve this with grated cheese, sour cream, chopped cilantro and green onions, and flour tortillas on the side.',188),('Slow Cooker Pulled Pork','https://www.allrecipes.com/recipe/141678/slow-cooker-pulled-pork/','https://images.media-allrecipes.com/userphotos/560x315/586964.jpg','Pork simmered in root beer makes all the difference. Topped with your favorite BBQ sauce, it\'s sure to bring rave reviews.',335),('Corrigan\'s Minestrone','https://www.allrecipes.com/recipe/100218/corrigans-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/363843.jpg','Hearty and filling vegetarian soup with potatoes, carrots, celery, onion, garlic, beans and pasta. Make sure you have the storage for the left-overs.',221),('Mini Meatloaves','https://www.allrecipes.com/recipe/15715/mini-meatloaves/','https://images.media-allrecipes.com/userphotos/560x315/5725906.jpg','Quick and easy to make. A family favorite. The ketchup and brown sugar give these loaves a tangy flavor.',255),('Day-After-Thanksgiving Turkey Carcass Soup','https://www.allrecipes.com/recipe/130979/day-after-thanksgiving-turkey-carcass-soup/','https://images.media-allrecipes.com/userphotos/560x315/744656.jpg','This easy and delicious turkey soup is made using leftovers from Thanksgiving or Christmas dinner. I usually make cornbread muffins to serve with it.',370),('Apple Cider Doughnuts','https://www.allrecipes.com/recipe/235088/apple-cider-doughnuts/','https://images.media-allrecipes.com/userphotos/560x315/1061800.jpg','Wonderful and warm, these donuts are delicious! Though perfect for fall, these treats are great year-round. I even make the batter the night before and then finish them in the morning. I also like to dust them with powdered sugar...YUM!',219),('Asparagus, Potato, and Onion Frittata','https://www.allrecipes.com/recipe/198723/asparagus-potato-and-onion-frittata/','https://images.media-allrecipes.com/userphotos/560x315/658659.jpg','I had some asparagus and ham to use so I came up with this combination for lunch today!',281),('Super-Delicious Zuppa Toscana','https://www.allrecipes.com/recipe/143069/super-delicious-zuppa-toscana/','https://images.media-allrecipes.com/userphotos/560x315/1115547.jpg','This is an oh-so-good recipe. Just the right amount of spice to make you take a cold drink but definitely keep coming back for more! This soup is irresistible!',554),('Chef John\'s Stuffed Peppers','https://www.allrecipes.com/recipe/222002/chef-johns-stuffed-peppers/','https://images.media-allrecipes.com/userphotos/560x315/1415039.jpg','This recipe\'s roots can be traced back to the Great Depression, when farmers first began selling the unripe peppers out of necessity. Of course, we did what Americans always do when faced with a new variety of food, we stuffed meat in it.',377),('Awesome Slow Cooker Pot Roast','https://www.allrecipes.com/recipe/16066/awesome-slow-cooker-pot-roast/','https://images.media-allrecipes.com/userphotos/560x315/2287775.jpg','This is a very easy recipe for a delicious pot roast. It makes its own gravy. It\'s designed especially for the working person who does not have time to cook all day, but it tastes like you did.  You\'ll want the cut to be between 5 and 6 pounds.',426),('Cream of Cauliflower Soup With Bacon Gremolata','https://www.allrecipes.com/recipe/229456/cream-of-cauliflower-soup-with-bacon-gremolata/','https://images.media-allrecipes.com/userphotos/560x315/4575730.jpg','We\'re heading into the heart of hot soup season, and this cream of cauliflower will ward off autumn\'s chill with the best of them.',236),('Oven-Roasted Asparagus','https://www.allrecipes.com/recipe/214931/oven-roasted-asparagus/','https://images.media-allrecipes.com/userphotos/560x315/1001600.jpg','Salty and savory, the roasting method kills the natural bitterness of asparagus.  Try it next to grilled fish or lamb.',123),('Ratatouille','https://www.allrecipes.com/recipe/18411/ratatouille/','https://images.media-allrecipes.com/userphotos/560x315/818555.jpg','This terrific dish is loaded with succulent Mediterranean vegetables.',251),('Polish Cream Cheese Coffee Cake','https://www.allrecipes.com/recipe/229630/polish-cream-cheese-coffee-cake/','https://images.media-allrecipes.com/userphotos/560x315/1123718.jpg','Delicious and warm. Wake up and smell the coffee cake. I love this recipe, although it is a bit time-consuming.',575),('Quinoa and Black Beans','https://www.allrecipes.com/recipe/49552/quinoa-and-black-beans/','https://images.media-allrecipes.com/userphotos/560x315/357989.jpg','Very flavorful alternative to black beans and rice. Quinoa is a nutty grain from South America.',153),('Butternut and Apple Harvest Soup','https://www.allrecipes.com/recipe/149141/butternut-and-apple-harvest-soup/','https://images.media-allrecipes.com/userphotos/560x315/125872.jpg','My friend Diana generously shared her wonderful Fall themed soup recipe. The medley of Autumn vegetables combine to make a wonderfully warm and comforting soup. Pair this with crusty bread and a salad, and dinner is served!',268),('Garden Fresh Tomato Soup','https://www.allrecipes.com/recipe/39544/garden-fresh-tomato-soup/','https://images.media-allrecipes.com/userphotos/560x315/1869714.jpg','A quick and easy recipe for real homemade tomato soup like no other you\'ve had before.',80),('Parmalet (Crisp Parmesan Omelet)','https://www.allrecipes.com/recipe/255334/parmalet-crisp-parmesan-omelet/','https://images.media-allrecipes.com/userphotos/560x315/3933273.jpg','I was attempting to achieve a crispy, inside-out Parmesan omelet--and it worked! The caramelized cheese formed a thin but protective layer and, since the eggs had never directly touched the pan, they were moist and tender. This will also work whether you use one or three eggs, depending on the texture you\'re going for. Using a single egg is kind of a cool trick, since the cheese layer is almost as thick, and you can really appreciate the crispness even more.',291),('Garden Veggie Zucchini Soup','https://www.allrecipes.com/recipe/234118/garden-veggie-zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/1603725.jpg','A great way to make use of your garden veggies. Zucchini, carrot, potato, and onion combined with some herbs and cheese...delicious! Fresh veggies and herbs make a big difference! You can puree the soup if you prefer.',185),('Prosciutto Fave Minestrone alla Riso ','https://www.allrecipes.com/recipe/25653/prosciutto-fave-minestrone-alla-riso/','https://images.media-allrecipes.com/userphotos/560x315/1951816.jpg','This ham, bean and rice soup is my favorite and it is a hearty dinner soup.  Sprinkle bowls of soup with Parmesan cheese and serve hot.  Serve extra cheese at the table.  Offer crusty, Italian bread with the soup.  You may substitute macaroni for the rice.',283),('Savory French Crepes ','https://www.allrecipes.com/recipe/223531/savory-french-crepes/','https://images.media-allrecipes.com/userphotos/560x315/1980918.jpg','At 611 Supreme in Seattle, authentic French crepes are filled with either savory or sweet fillings. In this recipe, a buckwheat crepe is filled with mushrooms, tomatoes, spinach, and Gruyere cheese.',507),('Creamy Corn Chowder','https://www.allrecipes.com/recipe/21844/creamy-corn-chowder/','https://images.media-allrecipes.com/userphotos/250x250/394672.jpg','This is a recipe that I\'ve modified to be low-fat and vegetarian. The original called for heavy cream and chicken broth. I think it is quite yummy, and especially good on chilly evenings!',294),('Zucchini Soup','https://www.allrecipes.com/recipe/234066/zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/1281646.jpg','My boyfriend typically does not like zucchini but loved this soup. Gluten free, nightshade free, dairy free.',56),('Lemon Chicken Piccata','https://www.allrecipes.com/recipe/214488/lemon-chicken-piccata/','https://images.media-allrecipes.com/userphotos/560x315/450856.jpg','This delicious chicken dish is exquisite and easy to prepare. The light and luscious lemon sauce really pops without being too acidic; it is simply divine. Serve it with herb-roasted potatoes or lemon-rice pilaf.',421),('Red Lentil Curry','https://www.allrecipes.com/recipe/16641/red-lentil-curry/','https://images.media-allrecipes.com/userphotos/560x315/490284.jpg','This is a rich and hearty lentil curry, great as a main meal rather than as a side dish like the more traditional Indian dhal. Don\'t let the ingredient list faze you, this really is an easy dish to make. This dish is great served with basmati rice.',192),('The Best Thai Coconut Soup','https://www.allrecipes.com/recipe/146035/the-best-thai-coconut-soup/','https://images.media-allrecipes.com/userphotos/560x315/2319909.jpg','Authentic, bold, and delicious Thai flavors make this soup irresistible! This is the best Thai coconut soup I\'ve had. You won\'t be disappointed with this one! Serve over steamed rice.',368),('Light and Fluffy Spinach Quiche','https://www.allrecipes.com/recipe/45394/light-and-fluffy-spinach-quiche/','https://images.media-allrecipes.com/userphotos/560x315/3171807.jpg','Very tasty and fluffy quiche. Easy to prepare. You\'ll love it. The spinach can be substituted for any fresh or frozen vegetable.',356),('Fried Green Tomatoes II','https://www.allrecipes.com/recipe/14085/fried-green-tomatoes-ii/','https://images.media-allrecipes.com/userphotos/250x250/878908.jpg','Tomatoes dipped in a breadcrumb batter and fried to your heart\'s content.',185),('Savory Bacon and Crab Bread Pudding Eggs Benedict','https://www.allrecipes.com/recipe/221128/savory-bacon-and-crab-bread-pudding-eggs-benedict/','https://images.media-allrecipes.com/userphotos/560x315/1011588.jpg','This will certainly make any brunch special, especially a Mother\'s Day brunch, which will be here before you know it.',717),('Sicilian Sunset','https://www.allrecipes.com/recipe/214634/sicilian-sunset/','https://images.media-allrecipes.com/userphotos/250x250/947204.jpg','This colorful drink will brighten up any party. Lemon-lime soda can be substituted for the Prosecco for a non-alcoholic version.',115),('Easy Bacon and Cheese Quiche','https://www.allrecipes.com/recipe/24474/easy-bacon-and-cheese-quiche/','https://images.media-allrecipes.com/userphotos/560x315/3782238.jpg','This is an easy, delicious quiche that will take no time to prepare and your friends will ask for the recipe!  I have made this for numerous office gatherings and everyone raves about it!',462),('Fluffy Pancakes','https://www.allrecipes.com/recipe/162760/fluffy-pancakes/','https://images.media-allrecipes.com/userphotos/560x315/3213063.jpg','Tall and fluffy.  These pancakes are just right.  Topped with strawberries and whipped cream, they are impossible to resist.',230),('Slow Cooker Beef Stew I','https://www.allrecipes.com/recipe/14685/slow-cooker-beef-stew-i/','https://images.media-allrecipes.com/userphotos/560x315/1098570.jpg','A hearty, savory slow cooker stew with potatoes, carrots, celery, broth, herbs and spices. You won\'t be slow to say \'yum\'!',576),('Beaker\'s Vegetable Barley Soup','https://www.allrecipes.com/recipe/78052/beakers-vegetable-barley-soup/','https://images.media-allrecipes.com/userphotos/560x315/336612.jpg','Easy to make and delicious. Vegetable broth, barley, and lots of veggies make this soup hearty and filling. I use and recommend organic products. Please add a review if you make it. Enjoy!',188),('Easy Roasted Broccoli','https://www.allrecipes.com/recipe/240438/easy-roasted-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/1765553.jpg','Easy roasted broccoli. My favorite part is the roasted sliced stem pieces.',63),('Baked Broccoli','https://www.allrecipes.com/recipe/215676/baked-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/1130058.jpg','A delicious and rich alternative to bland steamed broccoli! It caramelizes perfectly, and the spices give it a great flavor that kids and parents will love.',189),('Marinated Cucumber, Onion, and Tomato Salad','https://www.allrecipes.com/recipe/237984/marinated-cucumber-onion-and-tomato-salad/','https://images.media-allrecipes.com/userphotos/560x315/1143759.jpg','This is an easy salad that is perfect for a warm summer day.',156),('Spicy Chipotle Sweet Potato Soup','https://www.allrecipes.com/recipe/230369/spicy-chipotle-sweet-potato-soup/','https://images.media-allrecipes.com/userphotos/560x315/2735494.jpg','Can be mildly spicy to REALLY spicy depending on your taste. The chipotle gives the soup a really nice smoky taste. Use two cans of chipotle peppers for extra spice.',353),('Roasted Sage Broccoli','https://www.allrecipes.com/recipe/229211/roasted-sage-broccoli/','https://images.media-allrecipes.com/userphotos/560x315/969011.jpg','Easy and tasty veggie side dish. The fresh sage leaves become crispy and add texture and flavor.',97),('Awesome Pasta Salad','https://www.allrecipes.com/recipe/52734/awesome-pasta-salad/','https://images.media-allrecipes.com/userphotos/560x315/1282511.jpg','This is the best pasta salad I\'ve ever eaten, and people request it frequently. It\'s a very easy, light-tasting side dish for a picnic or dinner.',310),('RITZ Everything Bites with Lox and Schmear','https://www.allrecipes.com/recipe/235903/ritz-everything-bites-with-lox-and-schmear/','https://images.media-allrecipes.com/userphotos/250x250/1078041.jpg','All of the flavors of a New York City lox and schmear bagel--cream cheese, capers, cucumber and lox--in a single, delicious bite.',87),('Yam Taeng (Spicy Cucumber Salad)','https://www.allrecipes.com/recipe/213923/yam-taeng-spicy-cucumber-salad/','https://images.media-allrecipes.com/userphotos/560x315/5106737.jpg','This recipe is based on the same flavors as \'Som Tam\' (green papaya salad). Packed with flavor; use this salad as a side dish and serve with Thai glutinous rice.',347),('Baked French Toast','https://www.allrecipes.com/recipe/20934/baked-french-toast/','https://images.media-allrecipes.com/userphotos/560x315/1760545.jpg','I got this recipe from my sister in law. She and my brother had it at their gift opening after the wedding. I make it any time we have people staying with us, and it is always a hit. You may sprinkle the top with pecans if you wish.',395),('The Real Mojito','https://www.allrecipes.com/recipe/147363/the-real-mojito/','https://images.media-allrecipes.com/userphotos/560x315/679757.jpg','This is an authentic recipe for mojito. I sized the recipe for one serving, but you can adjust it accordingly and make a pitcher full. It\'s a very refreshing drink for hot summer days. Be careful when drinking it, however. If you make a pitcher you might be tempted to drink the whole thing yourself, and you just might find yourself talking Spanish in no time! Tonic water can be substituted instead of the soda water but the taste is different and somewhat bitter.',0),('Chef John\'s Shrimp and Grits ','https://www.allrecipes.com/recipe/236806/chef-johns-shrimp-and-grits/','https://images.media-allrecipes.com/userphotos/560x315/2148226.jpg','Shrimp and grits is a very simple recipe, but make sure you have everything ready before you start cooking the shrimp. They only take a few minutes to saut¨¦, so you don\'t have time to run and chop scallions or juice a lemon. Once everything is assembled, this recipe is a snap. To make things even easier, you can make the grits a bit ahead since they stay hot a very long time.',434),('Roasted Cauliflower and Leek Soup','https://www.allrecipes.com/recipe/229372/roasted-cauliflower-and-leek-soup/','https://images.media-allrecipes.com/userphotos/560x315/1025801.jpg','This is a really delicious soup I make.',209),('Slow Cooker Zucchini Soup','https://www.allrecipes.com/recipe/232096/slow-cooker-zucchini-soup/','https://images.media-allrecipes.com/userphotos/560x315/1275097.jpg','This is great as thick soup served with French bread or served over rice or noodles. Better the next day!',389),('Creamy Zucchini Soup','https://www.allrecipes.com/recipe/65303/creamy-zucchini-soup/','https://images.media-allrecipes.com/userphotos/250x250/68490.jpg','This is a delicious soup recipe that is great for using up all that extra zucchini you have in the garden. Creamy texture comes from cottage cheese and tofu.',159),('Cheesy Sausage and Vegetable Soup','https://www.allrecipes.com/recipe/255685/cheesy-sausage-and-vegetable-soup/','https://images.media-allrecipes.com/userphotos/560x315/4023539.jpg','Sausage, zucchini, carrots and onions in a creamy, cheesy broth make a soothing, hearty dinner on a chilly night.',731),('Banana Crumb Muffins','https://www.allrecipes.com/recipe/17652/banana-crumb-muffins/','https://images.media-allrecipes.com/userphotos/560x315/428420.jpg','The crumb topping is what makes these banana muffins stand apart from the ordinary. They\'re scrumptious!',263),('Rach\'s Broccoli Casserole','https://www.allrecipes.com/recipe/164998/rachs-broccoli-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1105518.jpg','Broccoli dish mixed with cream of mushroom soup, cheese, and other various ingredients topped with crushed Ritz crackers.',546),('Mini Spinach and Crab Quiche','https://www.allrecipes.com/recipe/229198/mini-spinach-and-crab-quiche/','https://images.media-allrecipes.com/userphotos/250x250/929764.jpg','Bite-size mini quiches packed with flavor and nutrition. They can be filled with a variety of your favorite meats, cheeses, and veggies, but spinach and crab are a favorite in our family! Serve warm topped with a dollop of sour cream and salsa or just alone as a great portable and easy breakfast.',90),('Quick Tuna Salad','https://www.allrecipes.com/recipe/139487/quick-tuna-salad/','https://images.media-allrecipes.com/userphotos/560x315/575897.jpg','This tuna salad is great when you are in a hurry; very quick and easy to make. It tastes great every time!',142),('Chicken Cordon Bleu I','https://www.allrecipes.com/recipe/8495/chicken-cordon-bleu-i/','https://images.media-allrecipes.com/userphotos/560x315/4222341.jpg','This entree is easy and delicious!  It\'s one of my husband\'s favorites! Try to use the largest chicken breasts you can find so you\'ll be able to roll them easier.',419),('Cinnamon Rolls III','https://www.allrecipes.com/recipe/24556/cinnamon-rolls-iii/','https://images.media-allrecipes.com/userphotos/560x315/4459950.jpg','Here\'s an easy alternative to buying those famous cinnamon rolls in the mall. They taste exactly the same, and the dough is made in the bread machine.',372),('Baked Butternut Squash','https://www.allrecipes.com/recipe/159433/baked-butternut-squash/','https://images.media-allrecipes.com/userphotos/560x315/1070738.jpg','This simple baked butternut squash is easy to make, delicious to eat, and looks beautiful on the plate.',281),('Mountain Apple Cobbler','https://www.allrecipes.com/recipe/200135/mountain-apple-cobbler/','https://images.media-allrecipes.com/userphotos/560x315/578449.jpg','A surprising ingredient is used in making this classic Southern dessert. Serve with a scoop of vanilla ice cream.',613),('Roasted Garlic Cauliflower','https://www.allrecipes.com/recipe/54675/roasted-garlic-cauliflower/','https://images.media-allrecipes.com/userphotos/560x315/3513330.jpg','Wonderful roasted cauliflower, my 11 year old son loves this! Add more spices and herbs to suit your taste.',118),('Cream Corn Like No Other','https://www.allrecipes.com/recipe/53304/cream-corn-like-no-other/','https://images.media-allrecipes.com/userphotos/560x315/745492.jpg','This is NOTHING like canned creamed corn!  My husband is not a fan of corn or creamed dishes, but he thinks this is great.  Easy and quick to prepare  and is an especially delicious side dish for chicken or pork.  Everyone always asks for the recipe.',253),('Crab and Swiss Quiche','https://www.allrecipes.com/recipe/20750/crab-and-swiss-quiche/','https://images.media-allrecipes.com/userphotos/560x315/543260.jpg','My aunt gave me this recipe because she knew I loved imitation crab.  It is amazing how simple and quick it is and VERY GOOD!',343),('Sausage, Peppers, Onions, and Potato Bake','https://www.allrecipes.com/recipe/214500/sausage-peppers-onions-and-potato-bake/','https://images.media-allrecipes.com/userphotos/560x315/3384034.jpg','This is an Italian comfort food classic!  The smell of this cooking in my kitchen transports me back to playing on the street in front of my Papa and Gigi\'s house in Brooklyn.  I make 2 trays of this for every family get-together, and it\'s gone in a flash!',539),('Chicken Massaman Curry','https://www.allrecipes.com/recipe/142055/chicken-massaman-curry/','https://images.media-allrecipes.com/userphotos/560x315/5573606.jpg','This curry, flavored with tamarind and coconut milk, is ready in under an hour. Serve over plain white rice.',690),('Baked Oatmeal Breakfast Bars','https://www.allrecipes.com/recipe/245914/baked-oatmeal-breakfast-bars/','https://images.media-allrecipes.com/userphotos/560x315/3290983.jpg','I wanted an on-the-go oatmeal bar without the artificial ingredients of commercial bars. This is the base for the bars, a recipe easily modified to suit your own tastes.',184),('Insanely Easy Vegetarian Chili','https://www.allrecipes.com/recipe/22919/insanely-easy-vegetarian-chili/','https://images.media-allrecipes.com/userphotos/560x315/5864274.jpg','This chili is SO easy to make. You can pretty much throw whatever you have into the pot and it\'ll be great. (I added some leftover salsa once.) It\'s very colorful, not to mention delicious.',155),('Seafood Omelets with Creamy Cheese Sauce','https://www.allrecipes.com/recipe/133235/seafood-omelets-with-creamy-cheese-sauce/','https://images.media-allrecipes.com/userphotos/250x250/56921.jpg','Thin, rich omelets are wrapped around a crab and shrimp filling. A luscious Cheddar cheese sauce is draped overtop.',652),('Lactose Free Corn Chowder','https://www.allrecipes.com/recipe/15387/lactose-free-corn-chowder/','https://images.media-allrecipes.com/userphotos/560x315/4516586.jpg','A delicious corn chowder discovered by accident. I ran out of milk and only had nondairy creamer, which is lactose free.',185),('Chef John\'s Chicken Tikka Masala','https://www.allrecipes.com/recipe/239867/chef-johns-chicken-tikka-masala/','https://images.media-allrecipes.com/userphotos/560x315/3537206.jpg','I probably get more requests for Indian food than any other ethnic cuisine, so I was very excited to be posting this recipe for chicken tikka masala; until I found out it\'s actually a British recipe. This is usually done with heavy cream, but I like to use coconut milk instead; the subtle sweetness it provides works beautifully with the spices in the dish. Serve with steamed rice.',625),('Banana Cinnamon Roll Casserole','https://www.allrecipes.com/recipe/246318/banana-cinnamon-roll-casserole/','https://images.media-allrecipes.com/userphotos/560x315/3397499.jpg','A new version of French toast casserole. I had some left over cinnamon rolls that had become stale and still wanted to use them so I came up with this recipe and it was a huge hit at my Sunday brunch.',305),('Eggs Benedict Breakfast Pizza','https://www.allrecipes.com/recipe/172077/eggs-benedict-breakfast-pizza/','https://images.media-allrecipes.com/userphotos/250x250/944618.jpg','Super easy to make with all the great flavor of Eggs Benedict.  Feed a crowd.',300),('Mediterranean Zucchini \'Pasta\' Salad','https://www.allrecipes.com/recipe/258933/mediterranean-zucchini-pasta-salad/','https://images.media-allrecipes.com/userphotos/560x315/5487774.jpg','The perfect \'pasta\' salad for summer!',303),('Roasted Yam and Kale Salad','https://www.allrecipes.com/recipe/217266/roasted-yam-and-kale-salad/','https://images.media-allrecipes.com/userphotos/560x315/865543.jpg','A bright contrast in flavors makes this salad a favorite among friends and family. The yams have a subtle sweetness that pairs nicely with the caramelized onions and kale.',274),('Baked Potato Soup V','https://www.allrecipes.com/recipe/25665/baked-potato-soup-v/','https://images.media-allrecipes.com/userphotos/560x315/507463.jpg','The last recipe you\'ll ever have to get for Baked Potato Soup.  It\'s thick soup and could be served with just a salad.  Everyone in the family will love this one.',440),('Easy Salsa Meatloaf','https://www.allrecipes.com/recipe/88281/easy-salsa-meatloaf/','https://images.media-allrecipes.com/userphotos/250x250/76178.jpg','A crowd pleasing meatloaf, may be made with ground beef or ground turkey. Both are yummy.',221),('Caesar Salad Supreme','https://www.allrecipes.com/recipe/14172/caesar-salad-supreme/','https://images.media-allrecipes.com/userphotos/560x315/4523712.jpg','A wonderful, rich, anchovy dressing makes this salad a meal. Serve with crusty Italian Bread.',384),('Garlic Green Beans','https://www.allrecipes.com/recipe/18288/garlic-green-beans/','https://images.media-allrecipes.com/userphotos/560x315/610614.jpg','Caramelized garlic and cheese! Is there anything better with green beans? You\'d better make plenty for everyone!',157),('Ooey-Gooey Cinnamon Buns','https://www.allrecipes.com/recipe/21461/ooey-gooey-cinnamon-buns/','https://images.media-allrecipes.com/userphotos/560x315/353408.jpg','These buns are sooo good hot from the oven when they\'re gooey and warm.',392),('Sharon\'s Awesome Chicago Chili','https://www.allrecipes.com/recipe/31772/sharons-awesome-chicago-chili/','https://images.media-allrecipes.com/userphotos/560x315/31260.jpg','Every time I make this chili, people beg for the recipe. My husband wants this made at least once a month. It is delicious topped with shredded Cheddar cheese and sour cream.',389),('Grandma Jeanette\'s Amazing German Red Cabbage','https://www.allrecipes.com/recipe/139977/grandma-jeanettes-amazing-german-red-cabbage/','https://images.media-allrecipes.com/userphotos/560x315/398520.jpg','This yummy, sweet and sour German red cabbage is easy to make!',148),('Hash Brown Casserole I','https://www.allrecipes.com/recipe/13750/hash-brown-casserole-i/','https://images.media-allrecipes.com/userphotos/560x315/54210.jpg','This hash brown casserole is similar to one served at a popular restaurant chain.',392),('Fried Green Tomatoes III','https://www.allrecipes.com/recipe/16512/fried-green-tomatoes-iii/','https://images.media-allrecipes.com/userphotos/250x250/581260.jpg','Crispy green tomatoes try dipping them in hot pepper sauce for extra flavor enhancement. Easy to make and  good to eat what more could you ask for?',273),('Cream of Cauliflower Soup I','https://www.allrecipes.com/recipe/13184/cream-of-cauliflower-soup-i/','https://images.media-allrecipes.com/userphotos/560x315/4500487.jpg','Add the optional Swiss cheese for a cheesy soup.',256),('Baked Homemade Macaroni and Cheese','https://www.allrecipes.com/recipe/102393/baked-homemade-macaroni-and-cheese/','https://images.media-allrecipes.com/userphotos/560x315/2588250.jpg','This recipe was given to me by my friend Katie. It\'s a longtime favorite in her family.',810),('Baked Salmon II','https://www.allrecipes.com/recipe/34746/baked-salmon-ii/','https://images.media-allrecipes.com/userphotos/560x315/593567.jpg','This is a great recipe for beginners! This was my first time making fish and it was a hit. Even my 9 year old daughter who wouldn\'t dream of eating fish EVER had half of my portion!',613),('Zucchini Soup with Herbs','https://www.allrecipes.com/recipe/13173/zucchini-soup-with-herbs/','https://images.media-allrecipes.com/userphotos/560x315/5058090.jpg','A fragrant zucchini soup that makes a very satisfying light meal.',171),('Easy Garlic-Lemon Scallops','https://www.allrecipes.com/recipe/132358/easy-garlic-lemon-scallops/','https://images.media-allrecipes.com/userphotos/560x315/5916120.jpg','Scallops sauteed in butter and garlic will melt in your mouth. Lemon juice gives it a nice kick.',408),('Baked Buffalo Wings','https://www.allrecipes.com/recipe/166638/baked-buffalo-wings/','https://images.media-allrecipes.com/userphotos/560x315/1132784.jpg','These easy to make hot wings are crispy without being fried. Always yummy to snack on. They only take 10 minutes for prep, but need to be refrigerated for about an hour so the flour coating is firm. You can add more cayenne or use a higher hot sauce to butter ratio if you like them spicier! Enjoy.',125),('Grandma\'s Slow Cooker Vegetarian Chili','https://www.allrecipes.com/recipe/14021/grandmas-slow-cooker-vegetarian-chili/','https://images.media-allrecipes.com/userphotos/560x315/804518.jpg','This is a simple crowd pleasing recipe that can sit in a slow cooker until it is time to serve.',260),('Perfect Summer Fruit Salad','https://www.allrecipes.com/recipe/214947/perfect-summer-fruit-salad/','https://images.media-allrecipes.com/userphotos/560x315/2289556.jpg','The perfect fruit salad for a backyard bbq or any occasion. There are never leftovers! This is one of my favorite fruit salad recipes, as I think the sauce really makes it. This salad is tastier the longer you can let it soak in its juices. I prefer 3 to 4 hours in the refrigerator before I serve it. Enjoy.',155),('Judy\'s Strawberry Pretzel Salad','https://www.allrecipes.com/recipe/16080/judys-strawberry-pretzel-salad/','https://images.media-allrecipes.com/userphotos/560x315/597421.jpg','This three-layer salad includes a pretzel crust, cream cheese center, and strawberry top.',371),('Smoked Salmon Dill Eggs Benedict','https://www.allrecipes.com/recipe/222399/smoked-salmon-dill-eggs-benedict/','https://images.media-allrecipes.com/userphotos/560x315/1112684.jpg','Despite the absence of the traditional hollandaise sauce, this smoked salmon eggs benedict is really, really good.',528),('Roasted Carrot and Cauliflower Curried Soup','https://www.allrecipes.com/recipe/228566/roasted-carrot-and-cauliflower-curried-soup/','https://images.media-allrecipes.com/userphotos/560x315/1105612.jpg','This restaurant-quality soup is hearty and very tasty! I didn\'t have onions at home when I made this. Although the soup turned out really flavorful without them, I will probably add an onion or two next time I make it. Garnish with basil, wonton noodles, and sour cream.',143),('Tender and Easy Buttermilk Waffles','https://www.allrecipes.com/recipe/233920/tender-and-easy-buttermilk-waffles/','https://images.media-allrecipes.com/userphotos/560x315/1120266.jpg','An easy waffle recipe that results in a nice crisp outside, and tender middle waffle. I love the results this gives while not having to separate the eggs and take time to whip egg whites! These will also reheat in the toaster for a quick work day breakfast.',318),('Salmon and Swiss Chard Quiche','https://www.allrecipes.com/recipe/103877/salmon-and-swiss-chard-quiche/','https://images.media-allrecipes.com/userphotos/560x315/416007.jpg','This is a crustless quiche that looks and tastes great.  Red Swiss chard makes the quiche very attractive.  It would also be good with half the salmon and twice the chard for a different flavor emphasis. The quiche can also be baked in your favorite crust if you prefer. Just bake a little longer',154),('Chef John\'s Minestrone Soup','https://www.allrecipes.com/recipe/223044/chef-johns-minestrone-soup/','https://images.media-allrecipes.com/userphotos/560x315/4425236.jpg','This is the type of dish I never make the same way twice, but I hope you give this amazing minestrone recipe a try soon, but only once.',484),('Antipasto Pasta Salad','https://www.allrecipes.com/recipe/14278/antipasto-pasta-salad/','https://images.media-allrecipes.com/userphotos/560x315/3192483.jpg','A delicious pasta, meat and cheese combination with a homemade dressing. It serves a crowd and is great for a picnic.',451),('Slow-Cooker Corned Beef and Cabbage  ','https://www.allrecipes.com/recipe/84270/slow-cooker-corned-beef-and-cabbage/','https://images.media-allrecipes.com/userphotos/560x315/2152835.jpg','No more dry corned beef!  Cook this in your slow cooker all day and you\'re guaranteed success!  Serve this with soda bread for a warm and satisfying meal.',472),('Whole Wheat Blueberry Muffins','https://www.allrecipes.com/recipe/218614/whole-wheat-blueberry-muffins/','https://images.media-allrecipes.com/userphotos/560x315/848322.jpg','These yummy muffins are made with all whole wheat flour and lots of fresh blueberries.  My husband says they\'re the best muffins he\'s ever tasted, and even my super picky kids love them!',183),('Slow Cooker Carnitas','https://www.allrecipes.com/recipe/139603/slow-cooker-carnitas/','https://images.media-allrecipes.com/userphotos/560x315/5369243.jpg','Carnitas means \'little meats\' and is traditionally fried then braised. This recipe is made much easier using the slow cooker but the results are just as tasty. This makes a great filling for tamales, enchiladas, tacos and burritos. This filling is also great combined with your favorite barbecue sauce and served on buns.',223),('Split Pea Soup with Rosemary','https://www.allrecipes.com/recipe/89199/split-pea-soup-with-rosemary/','https://images.media-allrecipes.com/userphotos/560x315/385476.jpg','The rosemary adds a distinctive flavor to this wonderful soup.',253),('Macho Minestrone','https://www.allrecipes.com/recipe/236136/macho-minestrone/','https://images.media-allrecipes.com/userphotos/560x315/1687797.jpg','It has everything: sausage, beans, pasta, potatoes, and lots of vegetables.',325),('Vegetarian Chickpea Sandwich Filling','https://www.allrecipes.com/recipe/16715/vegetarian-chickpea-sandwich-filling/','https://images.media-allrecipes.com/userphotos/560x315/362677.jpg','Serve this tasty sandwich spread on crusty whole grain rolls or pita bread, with lettuce and tomato. Other raw, chopped vegetables can be substituted for the celery.  Your favorite salad dressing can be substituted for the mayo.',259),('Cabbage and Smoked Sausage Soup','https://www.allrecipes.com/recipe/77836/cabbage-and-smoked-sausage-soup/','https://images.media-allrecipes.com/userphotos/560x315/714650.jpg','Even kids who don\'t care for vegetable soup may enjoy this one. Very good flavor. Sometimes I use crushed tomatoes with garlic, onion, or basil now that they\'re available. Turkey smoked sausage is great in this recipe!',404),('Thai Chicken Bites With Dipping Sauce','https://www.allrecipes.com/recipe/79255/thai-chicken-bites-with-dipping-sauce/','https://images.media-allrecipes.com/userphotos/250x250/68455.jpg','Let guests do the skewering by serving these chicken chunks with toothpicks.',29),('Old Fashioned Coconut Cream Pie','https://www.allrecipes.com/recipe/12481/old-fashioned-coconut-cream-pie/','https://images.media-allrecipes.com/userphotos/560x315/4899464.jpg','This is a tried-and-true, old-fashioned coconut cream pie. Took many years of searching and baking to find the right one and this is it! Enjoy!',423),('Easy Southern Fried Green Tomatoes','https://www.allrecipes.com/recipe/232360/easy-southern-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/1058985.jpg','Simple recipe for fried green tomatoes, perfect for appetizers or a unique fried green tomato B.L.T.!',189),('Thai Spicy Basil Chicken Fried Rice','https://www.allrecipes.com/recipe/145572/thai-spicy-basil-chicken-fried-rice/','https://images.media-allrecipes.com/userphotos/560x315/803638.jpg','This is a staple of Thai cooking. Adjust the spices to your own tastes for a really great use for leftover rice!! I get the basil from a local Asian market. It has a different flavor than that of regular basil and makes all the difference in this recipe. It is fast and fairly easy to make, but requires constant stirring.',794),('Hearty Corn and Pumpkin Soup','https://www.allrecipes.com/recipe/44823/hearty-corn-and-pumpkin-soup/','https://images.media-allrecipes.com/userphotos/560x315/2041608.jpg','A perfect, not too pumpkin-y pumpkin soup for chilly winter afternoons. Toasted pumpkin seeds are a fun add-in.',288),('Thai Chicken Satay','https://www.allrecipes.com/recipe/90294/thai-chicken-satay/','https://images.media-allrecipes.com/userphotos/560x315/3638371.jpg','The closest to my favorite satay served at my Thai restaurant. Prep is quick- best if left to marinade for a few hours or more.  Skewer up for the grill or saute on the stove! I buy the chicken tenderloin strips which are already boned, skinned and a nice size piece without slicing to save time.',391),('Sweet Russian Cabbage Soup','https://www.allrecipes.com/recipe/94031/sweet-russian-cabbage-soup/','https://images.media-allrecipes.com/userphotos/560x315/1244128.jpg','This is a simple recipe for a wonderful rich cabbage soup.',688),('Jill\'s Hash Brown Casserole','https://www.allrecipes.com/recipe/177777/jills-hash-brown-casserole/','https://images.media-allrecipes.com/userphotos/250x250/978037.jpg','Perfect as a side dish for brunch or dinner, this creamy and crunchy hash brown casserole always fits the bill.',409),('Jamie\'s Sweet and Easy Corn on the Cob','https://www.allrecipes.com/recipe/222352/jamies-sweet-and-easy-corn-on-the-cob/','https://images.media-allrecipes.com/userphotos/560x315/840195.jpg','My mother-in-law gave me this quick and easy recipe for the sweetest, tastiest corn cobs!',94),('Disney\'s Ratatouille','https://www.allrecipes.com/recipe/222006/disneys-ratatouille/','https://images.media-allrecipes.com/userphotos/560x315/3210754.jpg','The beautiful ratatouille served up in the movie by the same name. Long and narrow vegetables work best. Serve over a bed of brown rice, couscous, pasta or other starch, or with crusty bread.',275),('Classic Waffles','https://www.allrecipes.com/recipe/20513/classic-waffles/','https://images.media-allrecipes.com/userphotos/560x315/34761.jpg','A lovely, crispy waffle perfect for the morning.',379),('Vegan Black Bean Soup','https://www.allrecipes.com/recipe/25333/vegan-black-bean-soup/','https://images.media-allrecipes.com/userphotos/560x315/1098444.jpg','Easy to make, thick, hearty soup with a zesty flavor.',410),('Mexican Bean Salad','https://www.allrecipes.com/recipe/14169/mexican-bean-salad/','https://images.media-allrecipes.com/userphotos/560x315/828805.jpg','A colorful, spicy, and refreshing bean and corn salad.',334),('Broccoli and Tortellini Salad','https://www.allrecipes.com/recipe/14153/broccoli-and-tortellini-salad/','https://images.media-allrecipes.com/userphotos/560x315/841781.jpg','Crisp, fresh broccoli and cheese tortellini with a creamy dressing are the basis of this salad.  Raisins, sunflower seeds and red onion dress it up. This recipe is most requested at potlucks.',322),('Mediterranean Greek Salad','https://www.allrecipes.com/recipe/14403/mediterranean-greek-salad/','https://images.media-allrecipes.com/userphotos/250x250/18719.jpg','This is a great salad to take to a barbeque. All ingredients are approximate, so add more or less of any ingredient depending on your own taste.',131),('Broccoli Cheese Soup','https://www.allrecipes.com/recipe/13045/broccoli-cheese-soup/','https://images.media-allrecipes.com/userphotos/560x315/306621.jpg','This is a great, very flavorful soup. Good for serving at luncheons or special gatherings with a quiche. To make this soup a little fancier, add 1 cup sliced mushrooms and 1 cup white wine with the onions.',265),('Winter Fruit Salad with Lemon Poppyseed Dressing','https://www.allrecipes.com/recipe/13482/winter-fruit-salad-with-lemon-poppyseed-dressing/','https://images.media-allrecipes.com/userphotos/560x315/736393.jpg','Wonderful salad for the holiday seasons. Great to serve for dinner at home or to take to a family gathering during the holidays.',277),('Baked Ziti I','https://www.allrecipes.com/recipe/11758/baked-ziti-i/','https://images.media-allrecipes.com/userphotos/560x315/4557541.jpg','A lady I worked with brought this in one day, and it was a hit. Now it is the favorite of all my dinner guests. It\'s great for a covered dish dinner too. I have made this also without the meat, and it is well received.',578),('Nichole\'s Chicken Cauliflower Soup','https://www.allrecipes.com/recipe/221126/nicholes-chicken-cauliflower-soup/','https://images.media-allrecipes.com/userphotos/250x250/940274.jpg','A wonderfully light but filling soup. Perfect on a cold night with a loaf of sourdough bread.',201),('Fresh Southern Peach Cobbler','https://www.allrecipes.com/recipe/51535/fresh-southern-peach-cobbler/','https://images.media-allrecipes.com/userphotos/560x315/2500761.jpg','I\'ve been experimenting with cobbler for some time and this recipe is the final result. Loved by all. Use fresh Georgia peaches, of course!',562),('Alyson\'s Broccoli Salad','https://www.allrecipes.com/recipe/16098/alysons-broccoli-salad/','https://images.media-allrecipes.com/userphotos/560x315/503913.jpg','Confirmed broccoli haters have changed their minds after tasting this salad. It is great for potlucks or buffet meals. Make a day or so before you wish to serve to meld the ingredients. I have used sugar substitutes for the white sugar and also used nonfat or low-fat mayonnaise and it still tastes great!',559),('Roquefort Pear Salad','https://www.allrecipes.com/recipe/34613/roquefort-pear-salad/','https://images.media-allrecipes.com/userphotos/560x315/49064.jpg','This is the best salad I\'ve ever eaten and I make it all the time. It is tangy from the blue cheese, fruity from the pears, and crunchy from the caramelized pecans. The mustard vinaigrette pulls it all together.',426),('Easy Sausage Gravy and Biscuits','https://www.allrecipes.com/recipe/216391/easy-sausage-gravy-and-biscuits/','https://images.media-allrecipes.com/userphotos/560x315/571726.jpg','Hot jumbo buttermilk biscuits with creamy sausage gravy are ready in just 15 minutes for a hearty, family-favorite breakfast.',333),('Paleo Baked Eggs in Avocado','https://www.allrecipes.com/recipe/240744/paleo-baked-eggs-in-avocado/','https://images.media-allrecipes.com/userphotos/560x315/1903456.jpg','The contrast between the soft and fresh avocado and the creaminess of a poached egg is brilliant. Good thing is it\'s also very healthy and satisfying.',248),('Grandma Johnson\'s Scones','https://www.allrecipes.com/recipe/20163/grandma-johnsons-scones/','https://images.media-allrecipes.com/userphotos/560x315/344602.jpg','A basic scone recipe that really does the trick. Tried and tested through 3 generations of kids. Simply the best anywhere!',440),('Ultimate Twice Baked Potatoes','https://www.allrecipes.com/recipe/24332/ultimate-twice-baked-potatoes/','https://images.media-allrecipes.com/userphotos/560x315/4535940.jpg','I made these up years ago and have been making them ever since. They are always a big hit. These potatoes make a wonderful side dish for any meal and are terrific heated up the next day for lunch.',422),('Charleston Breakfast Casserole','https://www.allrecipes.com/recipe/51960/charleston-breakfast-casserole/','https://images.media-allrecipes.com/userphotos/560x315/5880.jpg','An easy, crowd-pleasing breakfast or brunch idea. Try playing with the ingredients to dress it up or down, depending on your occasion.',388),('Garlic Shrimp and Cheesy Grits','https://www.allrecipes.com/recipe/220898/garlic-shrimp-and-cheesy-grits/','https://images.media-allrecipes.com/userphotos/560x315/960223.jpg','Shrimp cooked with garlic and onion are served over garlic cheese grits. This is a dish for garlic lovers. Serve with garlic bread, or your preference of bread.',268),('Buffalo Chicken Wing Sauce','https://www.allrecipes.com/recipe/219109/buffalo-chicken-wing-sauce/','https://images.media-allrecipes.com/userphotos/560x315/955573.jpg','If you know someone from Buffalo, they know someone who told them the secret ingredients to the Anchor Bar\'s famous Buffalo chicken wings. I know people from Buffalo. This is my version, as described to me many years ago, over almost as many beers.',104),('Sugar Coated Pecans','https://www.allrecipes.com/recipe/13838/sugar-coated-pecans/','https://images.media-allrecipes.com/userphotos/560x315/403891.jpg','These sweet pecans are wonderful snacks for any occasion.',328),('Slow Cooker Texas Pulled Pork','https://www.allrecipes.com/recipe/92462/slow-cooker-texas-pulled-pork/','https://images.media-allrecipes.com/userphotos/560x315/4560053.jpg','Slow cooked, Texas-style pulled pork that is served on a buttered and toasted roll.  My family\'s favorite.',527),('Broccoli Cauliflower Casserole','https://www.allrecipes.com/recipe/234281/broccoli-cauliflower-casserole/','https://images.media-allrecipes.com/userphotos/560x315/1897099.jpg','Great broccoli cauliflower recipe that everyone will love! The croutons on top give it that crunchy flavor everyone will love.',721),('Shrimp and Grits Louisiana Style','https://www.allrecipes.com/recipe/220907/shrimp-and-grits-louisiana-style/','https://images.media-allrecipes.com/userphotos/560x315/1296334.jpg','Probably the best shrimp and grits recipe I have made! Easy and low ingredient count!',677),('Chicken Pot Pie IX','https://www.allrecipes.com/recipe/26317/chicken-pot-pie-ix/','https://images.media-allrecipes.com/userphotos/560x315/4535759.jpg','A delicious chicken pie made from scratch with carrots, peas and celery.',412),('Baked Sweet Potato Sticks','https://www.allrecipes.com/recipe/13517/baked-sweet-potato-sticks/','https://images.media-allrecipes.com/userphotos/560x315/1071759.jpg','Best eaten at room temperature.',132),('Baked Apple Roses','https://www.allrecipes.com/recipe/244198/baked-apple-roses/','https://images.media-allrecipes.com/userphotos/560x315/5859987.jpg','These were inspired by a cook named Ana, a Brazilian food blogger living in Italy. I really hope you give these gorgeous looking, and very delicious apple roses a try soon. Enjoy!',1058),('All-Around Good Smoothie','https://www.allrecipes.com/recipe/74174/all-around-good-smoothie/','https://images.media-allrecipes.com/userphotos/560x315/1017594.jpg','This is a recipe I experimented with to try to get a good amount of vitamins, calcium, protein and fiber in my diet. The great part of this is that I don\'t get bored with it (even though I drink it every day) because I can change the type of fruit I use whenever I want.',345),('Best White Chicken Chili','https://www.allrecipes.com/recipe/267915/best-white-chicken-chili/','https://images.media-allrecipes.com/userphotos/560x315/5705534.jpg','Change things up this winter by making chili with chicken instead of beef. For a milder version, you can substitute a green bell pepper for the jalapenos. Garnish with cheese and cilantro if desired.',390),('Pan-Fried Asparagus','https://www.allrecipes.com/recipe/18318/pan-fried-asparagus/','https://images.media-allrecipes.com/userphotos/560x315/214328.jpg','This garlic asparagus dish is a Northern Italian side dish.  My family loves it!  Even the kids!',188),('Shanghai Noodle Salad','https://www.allrecipes.com/recipe/218542/shanghai-noodle-salad/','https://images.media-allrecipes.com/userphotos/560x315/844709.jpg','Tangy, addictive, Asian  pasta salad. Great  for lunch boxes! Instead of chili flakes, you can add 1/4 teaspoon of chili paste to the whisked dressing ingredients.',258),('Lentil Soup','https://www.allrecipes.com/recipe/13978/lentil-soup/','https://images.media-allrecipes.com/userphotos/560x315/789512.jpg','Hearty lentil soup, chock full of veggies and very yummy. Serve with warm cornbread.',349),('Apple Stuffed Chicken Breast','https://www.allrecipes.com/recipe/8546/apple-stuffed-chicken-breast/','https://images.media-allrecipes.com/userphotos/560x315/1533241.jpg','This is a great dish for the fall.  Golden Delicious, Granny Smith, Newtown Pippin, Rome Beauty and/or Winesap apples may be used.',139),('Applesauce Pumpkin Spice Bread ','https://www.allrecipes.com/recipe/255621/applesauce-pumpkin-spice-bread/','https://images.media-allrecipes.com/userphotos/560x315/4108405.jpg','This is my favorite holiday food! It keeps well and is a great food to bring to holiday gatherings.',197),('Six Can Chicken Tortilla Soup','https://www.allrecipes.com/recipe/19766/six-can-chicken-tortilla-soup/','https://images.media-allrecipes.com/userphotos/560x315/2783081.jpg','Delicious and EASY zesty soup recipe that uses only 6 canned ingredients! Serve over tortilla chips, and top with shredded Cheddar cheese. Throw away the cans and no one will know that it is not from scratch!',214),('Campbell\'s Tuna Noodle Casserole','https://www.allrecipes.com/recipe/151593/campbells-tuna-noodle-casserole/','https://images.media-allrecipes.com/userphotos/250x250/979363.jpg','Campbell\'s Condensed Cream of Mushroom Soup flavors a creamy sauce that is mixed with tuna, egg noodles and peas, topped with a crunchy bread crumb topping and baked to perfection.',0),('Northern Fried Green Tomatoes','https://www.allrecipes.com/recipe/233902/northern-fried-green-tomatoes/','https://images.media-allrecipes.com/userphotos/560x315/2645041.jpg','A different take on the Southern classic, utilizing panko bread crumbs and Parmesan cheese.',395),('Israeli Tomato and Cucumber Salad','https://www.allrecipes.com/recipe/242304/israeli-tomato-and-cucumber-salad/','https://images.media-allrecipes.com/userphotos/560x315/2271347.jpg','Chopped tomatoes, cucumbers, onions, and parsley combine with a drizzled dressing of lemon juice, olive oil, garlic, and mint leaves.',208),('Chicken Milano','https://www.allrecipes.com/recipe/19304/chicken-milano/','https://images.media-allrecipes.com/userphotos/560x315/3741.jpg','A delicious pasta and chicken dish with garlic, sun-dried tomatoes and fresh basil. Use the dry packaged sun-dried tomatoes instead of the tomatoes packed in olive oil. The sauce can be kept, covered, for one day in the refrigerator; heat again over low heat. Try it with some crusty bread if desired.',641),('Baked Beans, Texas Ranger','https://www.allrecipes.com/recipe/47931/baked-beans-texas-ranger/','https://images.media-allrecipes.com/userphotos/250x250/498262.jpg','Want to wow everyone at the bar-b-que? Then this is the recipe. This is one of my most requested recipes!',301);
